(754, 1, '<p>Servicio de Actualizaci&oacute;n sobre <strong>www.trxconsulting.com</strong>, comprendiendo:</p>\r\n<ul>\r\n<li><span style="\\">Inclusi&oacute;n de documentos en <strong>Downloads</strong></span></li>\r\n<li><span style="\\">Adici&oacute;n de imagen en <strong>Geof&iacute;sica</strong></span></li>\r\n<li>Inserci&oacute;n de <strong>Keywords</strong> (seg&uacute;n lista suministrada por cliente) para Optimizaci&oacute;n de contenido y mejora de posicionamiento en buscadores SEO</li>\r\n</ul>\r\n<p>&nbsp;</p>', 950.000, 950.000),
