(849, 1, '<p class="\\" style="\\">Desarrollo y Programaci&oacute;n de m&oacute;dulo <strong>EDIL TITULARES (7)</strong>&nbsp;contentivo de secciones:</p>\r\n<ul>\r\n<li>(7.1) Sala de prensa</li>\r\n<li>(7.2) Suscripcion Boletin Informanto</li>\r\n<li>(7.3) Informanto</li>\r\n<li>(7.4) Carga noticias</li>\r\n</ul>', 19000.000, 19000.000),
