(883, 1, '<p>Modulo de e-commerce para solicitud de servicios de impresion y reproduccion, con configurador en linea, utilidad para carga de archivos, incorporacion de boton de pago via "mercado pago". Paneles para usuarios &auml;dministrador", &ouml;perario" y "gerencia".</p>', 35000.000, 35000.000),
