(885, 1, '<p><span style="font-family: Tahoma, Verdana, Arial, Helvetica, sans-serif; font-size: 11px; line-height: 17px;"><strong>Diagnostico y remoci&oacute;n </strong>de codigos malintencionados malware para&nbsp;</span>www.djoscarleal.com, para mudanza de Servidor.</p>\r\n<p>(* Este monto puede disminuir o incrementarse, en funci&oacute;n al estado en que se encuentra el WebSite; pudiendo incluso no ser necesario su cobro)&nbsp;</p>', 1900.000, 1900.000),
(887, 1, '<p>Desarrollo y Programacion de Modulo <strong>Directorio de Contactos</strong>, contentivo de las siguientes secciones:</p>\r\n<ul>\r\n<li>De prensa (Administracion y mercadeo)</li>\r\n<li>De Clientes&nbsp;(Administracion y mercadeo)</li>\r\n<li>De Alumnas&nbsp;(Administracion y mercadeo)</li>\r\n</ul>', 8000.000, 8000.000),
(905, 1, '<p>Desarrollo y Programacion de Modulo &nbsp;"<strong>Area de administracion</strong><strong>",</strong>&nbsp;a traves de este modulo el administrador podra<strong>:</strong></p>\r\n<ul>\r\n<li><span style="font-size: 10px;">Visualizar el status de inventarios y pedidos.</span></li>\r\n<li><span style="font-size: 10px;">Administrar (retirar, adicionar o modifica la oferta de items (productos o servicios) en la zona de clientes.</span></li>\r\n<li><span style="font-size: 10px;">Utilizar un directorio de contactos donde podra agregar, visualizar y modificar informacion de contacto de clientes, proveedores y colaboradores.</span></li>\r\n</ul>', 32000.000, 32000.000),
