(913, 1, '<p>Modulo Panel Administrativo de autogestion.</p>', 7000.000, 7000.000),
(920, 1, '<p>Desarollo y Programacion de Modulo <strong>Proyectos</strong>, con opciones para Agregar, Modificar y Eliminar. Conteniendo las siguientes secciones:</p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>Descripcion del proyecto</li>\r\n<li>Caracteristicas</li>\r\n<li>Imagen principal</li>\r\n<li>Galeria</li>\r\n<li>Listado de Proyectos</li>\r\n<li>Agregar Proyecto Nuevo</li>\r\n<li>Editar Proyectos existentes</li>\r\n<li>Eliminar Proyecto</li>\r\n<li>Editar Galeria&nbsp;</li>\r\n</ul>\r\n<p>&nbsp;</p>', 22500.000, 22500.000);
