INSERT INTO `planes_pago` (`id`, `nombre`, `resumen`, `descripcion`) VALUES
(1, 'Plan A', '35% - 35% - 30', '<strong>Plan A (3 cuotas) :</strong> 35% del monto total + IVA al pedido; 35% + IVA 30 dias a partir de la fecha del 1er pago; 30% + IVA a la entrega del proyecto'),
(2, 'Plan B', '40% - 20%', '<strong>Plan B (4 cuotas) :</strong> 40% del monto total + IVA al pedido; 20% + IVA 30 dias a partir de la fecha del 1er pago; 20% + IVA 30 dias a partir de la fecha del pago previo; 20% + IVA 30 dias a partir de la fecha del pago previo'),
(3, 'Plan C', '50% - 50%', '<strong>Plan C (2 cuotas) :</strong> 50% del monto total + IVA al pedido; 50% + IVA a la entrega del mismo'),
(4, 'Plan D', '100% al pedido', '<strong>Plan D (1 cuota) :</strong> 100% del monto total + IVA al pedido'),
(5, 'Plan Mantenimiento', '100% mes adelantado', '<strong>Plan de Mantenimiento: </strong>100% del monto total de mantenimiento + IVA mensualmente, a partir de 30 dias de la fecha de cancelación de la ultima couta del plan principal'),
(6, 'Plan E', '100% mes adelantado', '<strong>Plan Elaboración :</strong> 60% del monto total + IVA al pedido y 40% con la entrega del producto terminado'),
(7, 'Plan de Alquiler', '100% alquiler', '<strong>Plan de Alquiler :</strong> 100% del monto total + IVA por adelantado. Reintegro del deposito (si lo hubiere) a la culminacion de los días contratados.'),
