(204, 52, '19 de marzo de 2007', 0, 'direccion fisica', 'Proyecto Web', 4305000.000, 11, 473550.000, 'El Website estará programado con tecnología HTML+FLASH+XML que permitirá integrar animaciones, fotos y texto, creando un diseño amigable e interactivo. \r\nLas animaciones estarán presentes en Cabecera, Botones e Imágenes para lograr un site más agradable y captar mas atención y empatía con los usuarios. A su vez, será para la empresa reflejo de mayor tecnología, al mostrar un meticuloso y sobrio diseño. \r\n<br><br>\r\n* El Precio puede variar en funcion de la cantidad de secciones<br>\r\n* El costo por mantenimiento es cancelado mensualmente y puede ser modificado en funcion a la complejidad de los cambios solicitados por el cliente\r\n<br>\r\n<strong>* El pago por mantenimiento se realizará mensualmente a partir de 30 días de la fecha de cancelacion del monto total por el proyecto.</strong>', '30 días', '3', 17031028, '', '0'),
(205, 53, '22 de marzo de 2007', 0, 'direccion fisica', 'Proyecto Web', 4135000.000, 11, 454850.000, 'El Website estará programado con tecnología HTML+FLASH+XML que permitirá integrar animaciones, fotos y texto, creando un diseño amigable e interactivo. \r\nEl atractivo principal del desarrollo, sera el levantamiento del Trailer modelo, con la posibilidad para el usuario de visualizar varios angulos del mismo, en animacion. Esto logrará un site más agradable y captará mas la atención y empatía de los usuarios. A su vez, será para la empresa reflejo de mayor tecnología, al mostrar tambien un meticuloso y sobrio diseño. \r\n<br><br>\r\n* El costo por mantenimiento es cancelado mensualmente y puede ser modificado en funcion a la complejidad de los cambios solicitados por el cliente\r\n<br>\r\n<strong>* El pago por mantenimiento se realizará mensualmente a partir de 30 días de la fecha de cancelacion del monto total por el proyecto.</strong>', '30 días', '1', 15869947, '', '0'),
