(208, 53, '26 de marzo de 2007', 0, 'direccion fisica', 'Proyecto Web', 3870000.000, 11, 425700.000, 'El<strong> Website</strong> estará programado con tecnología HTML+PHP+FLASH que permitirá integrar animaciones, fotos y texto, creando un diseño amigable e interactivo. \r\n<br><br>\r\nLa <strong>Presentacion Multimedia</strong> tendrá como atractivo principal del desarrollo, un levantamiento de parque de trailers sencillo, con la posibilidad para el usuario de visualizar varios angulos del mismo, en animacion combinado con fotografias. Esto será para la empresa reflejo de mayor tecnología, al mostrar tambien un meticuloso y sobrio diseño. \r\n<br><br>', 'A convenir con el cliente', '4', 15869947, 'CD+WEB', '0'),
