(214, 58, '16 de mayo de 2007', 23, 'direccion fisica', 'Proyecto Web', 6435000.000, 11, 707850.000, 'El Website estará programado con tecnología HTML+PHP+FLASH+XML que permitirá integrar animaciones, fotos y texto, creando un diseño amigable e interactivo y muy dinamico en contenidos. \r\nLas animaciones estarán presentes en Cabecera, Botones e Imágenes para lograr un site más agradable y captar mas atención y empatía con los usuarios. A su vez, será para la institucion reflejo de mayor tecnología, al mostrar un meticuloso y sobrio diseño combinado con tecnologia de desarrollo. \r\n<br><br>\r\n* El Precio corresponde a la Fase 1 del Proyecto<br>\r\n* El costo por mantenimiento es cancelado mensualmente y puede ser modificado en funcion a la complejidad de los cambios estimados a solicitar por el cliente\r\n<br>\r\n* El pago por mantenimiento se realizará mensualmente a partir de 30 días de la fecha de cancelacion del monto total por el proyecto.', 'A convenir con el cliente', '1', 15869947, 'Fase 1', '0'),
(215, 51, '10 de abril de 2007', 0, 'direccion fisica', 'Proyecto Web', 5452000.000, 11, 599720.000, 'El Website estará programado con tecnología HTML+FLASH+XML que permitirá integrar animaciones, fotos y texto, creando un diseño amigable e interactivo. \r\nLas animaciones estarán presentes en Cabecera, Botones e Imágenes para lograr un site más agradable y captar mas atención y empatía con los usuarios. A su vez, será para la empresa reflejo de mayor tecnología, al mostrar un meticuloso y sobrio diseño. \r\n<br><br>\r\nEl Cliente contará con una herramienta para actualizar los contenidos de Top Chart y Encuestas.\r\n<br><br>\r\n* El Precio puede variar en función de la cantidad de secciones<br>\r\n* El costo por mantenimiento es cancelado mensualmente y puede ser modificado en función a la complejidad de los cambios solicitados por el cliente\r\n<br>\r\n<strong>* El pago por mantenimiento se realizará mensualmente a partir de 30 días de la fecha de cancelación del monto total por el proyecto.</strong>', '30 días', '1', 17031028, '', '0'),
