(217, 59, '17 de abril de 2007', 0, 'direccion fisica', 'Cd Multimedia', 1585000.000, 11, 174350.000, 'La<strong> Presentación Multimedia</strong> estará programado con tecnología XML+FLASH que permitirá integrar animaciones, fotos y texto, creando un diseño amigable e interactivo, totalmente identificado con la imagen y labor de la empresa. Igualmente setrabajará sobre meticuloso y sobrio diseño, que permita reflejar las fortalezas de la empresa. \r\n<br><br>', 'A convenir con el cliente', '3', 15869947, 'Corporacion Orion', '0'),
