(219, 3, '16 de abril de 2007', 0, 'direccion fisica', 'Proyecto Web', 5335000.000, 11, 586850.000, '* El <strong>Website</strong> estará programado con tecnología FLASH+XML+PHP que permitirá integrar animaciones, fotos y texto, creando un diseño interactivo y altamente dinámico.\r\n<br>\r\nLas animaciones estarán basadas en ejemplos de sitios de alta categoria como <strong>www.diesel.com, www.adidas.com/women</strong> para lograr un site impactante y con tecnologia de punta, digno de referencias internacionales a fin de captar la atención y empatía de los usuarios. El diseño tendrá como premisa la tendencia urbana que identifica a la marca.<br>\r\n* El sitio contará con un llamativo <strong>Catalogo Flash</strong> e igualmente con una version <strong>HTML</strong> del mismo, simple y navegable desde cualquier máquina o velocidad.<br>\r\n* El <strong>Plan de Mantenimiento</strong> comprende la inclusión en el catálogo de la página hasta 5 prendas por mes. En caso de requerir más piezas o de requerir actualizaciones más completas para el catálogo, debe ser solicitada la estimación de un nuevo presupuesto.\r\n<br>\r\n* La seleccion del <strong>Plan de Financiamiento</strong> para la cancelacion del Proyecto, es negociable<br>\r\n* El<strong>Tiempo de Entrega</strong> podrá aumentar o disminuir en función de la extensión del catálogo', '45 días', '3', 15860984, 'Tienda Ropa Urbana', '0'),
(220, 3, '16 de abril de 2007', 2, 'direccion fisica', 'Audiovisual', 730000.000, 11, 80300.000, '* La <strong>Duración</strong> de la pieza audiovisual puede variar en función de la necesidad del cliente.<br>\r\n* La pieza Audiovisual puede ser <strong>actualizada</strong> periódicamente segun requerimientos del cliente, y dependiendo del tipo de actualizacion, el costo será estimado.', 'A convenir con el cliente', '4', 15860984, 'Video Tienda Urbana', '0'),
