(226, 37, '23 de abril de 2007', 26, 'direccion fisica', 'Proyecto Web', 3550000.000, 11, 390500.000, 'El Website estará programado con tecnología HTML+FLASH+PHP que permitirá integrar animaciones, fotos y texto, creando un diseño amigable e interactivo. \r\nLas animaciones estarán probablemente presentes en Cabecera, Botones e Imágenes para lograr un site más agradable y captar mas atención y empatía con los usuarios. A su vez, será para la empresa reflejo de mayor tecnología, al mostrar un meticuloso y sobrio diseño. \r\n<br><br>\r\nEl Cliente contará con una poderosa "Herramienta de Administración", en Tecnologia PHP, que permitirá registrar usuarios, crear secciones, categorias, y actualizar contenidos con total autonomía.\r\n<br><br>\r\n* El costo por mantenimiento es cancelado mensualmente y puede ser modificado en función a la complejidad de los cambios solicitados por el cliente. Sin embargo, se estima este apartado para aplicar modificaciones en zonas no comprendidas en la herramienta de actualizacion a la que tendrá acceso el cliente (ej: botoneras, animaciones, etc). Igualmente se preparará un boletín mensual que será enviado a una lista de asociados con informacion de promocion de eventos, si asi se requiere<br><br>\r\n* El pago por mantenimiento se realizará mensualmente a partir de 30 días de la fecha de cancelación del monto total por el proyecto.', '45 días', '1', 15860984, 'Joomla', '0'),
