(276, 81, '13 de julio de 2007', 0, 'direccion fisica', 'Proyecto Web', 2500000.000, 9, 225000.000, '* El Website estará programado con tecnología HTML+FLASH+XML que permitirá integrar animaciones, fotos y texto, creando un diseño amigable e interactivo.  <br>\r\nLas animaciones estarán presentes en Cabecera, Botones e Imágenes para lograr un site más agradable y captar mas atención y empatía con los usuarios.<br>\r\n*El <strong>Diseño gráfico</strong> será suministrado por el cliente.<br>\r\n* El Sitio contará con un <strong>Sistema de Registro de Usuarios</strong> integrado con la Base de Datos manejada por el sistema operativo con el que cuenta la empresa actualmente.<br>\r\n*<strong> Las Noticias</strong> cuentan con un panel administrativo para el cliente que permite la publicacion de noticias "publicas", "dirigidas solo a usuarios registrados" y " dirigidas solo a usuarios determinados".<br>\r\n*<strong>El Area Privada para Usuarios Registrados</strong> permitirá a los usuarios obtener un detalle sobre su estado de cuenta relacionado al servicio contratado con la empresa de la pagina.<br>\r\n* Las bases originales del Proyecto nativas del programa de desarrollo no se incluyen en el compromiso de venta, y es politica de nuestra firma reservarlas para unica intervencion de nuestros programadores, por lo que no son cedidas al cliente. El Cliente puede modificar los contenidos de la pagina gracias a las herramientas administrativas q se desarrollarán para tal fin.', '30 días', '3', 15860984, 'Galpon de Productos', '0'),
(277, 60, '13 de julio de 2007', 0, 'direccion fiscal', 'Proyecto Web', 2235000.000, 9, 201150.000, 'El Website estará programado con tecnología HTML+FLASH+XML que permitirá integrar animaciones, fotos y texto, creando un diseño amigable e interactivo. Las animaciones estarán presentes en Cabecera, Botones e Imágenes para lograr un site más agradable y captar mas atención y empatía con los usuarios. A su vez, será para la empresa reflejo de mayor tecnología, al mostrar un meticuloso y sobrio diseño. Se contemplan espacios en home y secciones internas, para la venta de publicidad a sus clientes nuevos o de formato impreso. ', '30 días', '1', 15860984, 'PARA YUBIRI!!!', '0'),
