(280, 85, '23 de julio de 2007', 0, 'direccion fiscal', 'Impresos', 9999999.999, 9, 2788650.000, '<strong>* Tiempo general de entrega:</strong>\r\n<br> 10 a 15 días hábiles para cantidades inferiores a 5.000 unidades\r\n<br> 20 días hábiles para cantidades superiores a 5.000 unidades<br>\r\n* El tiempo de entrega puede variar en función de la necesidad del cliente. Sin embargo, <strong>para habilitar el costo sufrirá un recargo de 30%</strong><br>\r\n* Los costos incluyen unicamente precio de reproducción. <strong>El cliente suministrará los artes</strong>, los cuales serán verificados y adaptados por nuestro departamento de diseño en caso de ser necesario.<br>\r\n* Estos costos <strong>no incluyen servicio de entrega y encomienda</strong>.', 'A convenir con el cliente', '3', 15860984, 'Varios Parte 1', '0'),
(281, 85, '23 de julio de 2007', 0, 'direccion fiscal', 'Impresos', 8667000.000, 9, 780030.000, '* Cinta de embalaje tambien disponible en 3" y 4"<br>\r\n* El costo del Material P.O.P varia en función del modelo seleccionado.<br>\r\n<strong>* Tiempo general de entrega:</strong> 10 a 15 días hábiles.\r\n* Los costos incluyen unicamente precio de reproducción. <strong>El cliente suministrará los artes</strong>, los cuales serán verificados y adaptados por nuestro departamento de diseño en caso de ser necesario.<br>\r\n* Estos costos <strong>no incluyen servicio de entrega y encomienda</strong>.\r\n* Los precios de<strong> Rotulacion</strong> incluyen instalación en la dirección de la empresa. Costos aproximados, pueden variar en función al área de rotulación.', 'A convenir con el cliente', '3', 15860984, 'Varios Parte 2', '0'),
(282, 58, '24 de julio de 2007', 23, 'direccion fisica', 'Proyecto Web', 5450000.000, 9, 490500.000, 'El Website estará programado con tecnología HTML+PHP+FLASH+XML que permitirá integrar animaciones, fotos y texto, creando un diseño amigable e interactivo y muy dinamico en contenidos. \r\nLas animaciones estarán presentes en Cabecera, Botones e Imágenes para lograr un site más agradable y captar mas atención y empatía con los usuarios. A su vez, será para la institucion reflejo de mayor tecnología, al mostrar un meticuloso y sobrio diseño combinado con tecnologia de desarrollo. \r\n<br><br>\r\n* El Precio corresponde a la Fase 1 del Proyecto<br>\r\n* El costo por mantenimiento es cancelado mensualmente y puede ser modificado en funcion a la complejidad de los cambios estimados a solicitar por el cliente\r\n<br>\r\n* El pago por mantenimiento se realizará mensualmente a partir de 30 días de la fecha de cancelacion del monto total por el proyecto.', 'A convenir con el cliente', '1', 15869947, 'Fase 1 + Sin Dominio', '0'),
(283, 81, '25 de julio de 2007', 26, 'direccion fisica', 'Proyecto Web', 3150000.000, 9, 283500.000, 'El Website estará programado con tecnología HTML+FLASH+PHP que permitirá integrar animaciones, fotos y texto, creando un diseño amigable e interactivo. \r\nLas animaciones estarán probablemente presentes en Cabecera, Botones e Imágenes para lograr un site más agradable y captar mas atención y empatía con los usuarios. A su vez, será para la empresa reflejo de mayor tecnología, al mostrar un meticuloso y sobrio diseño. \r\n<br><br>\r\nEl Cliente contará con una poderosa \\"Herramienta de Administración\\", en Tecnologia PHP, que permitirá registrar usuarios, crear secciones, categorias, y actualizar contenidos con total autonomía.\r\n<br><br>\r\n* El costo por mantenimiento es cancelado mensualmente y puede ser modificado en función a la complejidad de los cambios solicitados por el cliente. Sin embargo, se estima este apartado para aplicar modificaciones en zonas no comprendidas en la herramienta de actualizacion a la que tendrá acceso el cliente (ej: botoneras, animaciones, etc). Igualmente se preparará un boletín mensual que será enviado a una lista de asociados con informacion de promocion de eventos, si asi se requiere<br><br>\r\n* El pago por mantenimiento se realizará mensualmente a partir de 30 días de la fecha de cancelación del monto total por el proyecto.', '45 días', '1', 15860984, 'Marketing Consulting + Descuento para Revendedores', '0'),
(284, 34, '28 de julio de 2007', 0, 'direccion fisica', 'Proyecto Web', 3335000.000, 9, 300150.000, 'El Website estará programado con tecnología HTML+FLASH+PHP que permitirá integrar animaciones, fotos y texto, creando un diseño amigable e interactivo. \r\nLas animaciones estarán probablemente presentes en Cabecera, Botones e Imágenes para lograr un site más agradable y captar mas atención y empatía con los usuarios.<br><br>\r\nEl Cliente contará con la activacion de un Modulo de Venta para Tickets, el cual será tramitado a través de acciones entre el Cliente, Banco Mercantil y Besign.\r\n<br>\r\n* El cliente contará también con una <strong>herramienta de administracion de contenido</strong> que permitirá la actualización de Proximos Eventos y Entradas y fechas disponibles.<br>\r\n* El tiempo de desarrollo para la <strong>1era Fase</strong> (incluye intro, home page y activacion del modulo de ventas) es de 15 días habiles aproximadamente a partir de la cancelacion de la primera cuota y de la recepcion del material suficiente para dichas secciones.<br>\r\n* El tiempo de desarrollo para la <strong>2da Fase</strong> (incluye el restante de las secciones, asi como la entrega de la herramienta administrativa para el cliente que permite la actualizacion de eventos) es de 20 días habiles aproximadamente.<br>\r\n* <strong>Besign, C.A.</strong> no se responsabiliza por demoras en el proceso de activacion del sistema de pago electronico causadas por el proceso de gestión del Banco o el Cliente, que puedan interferir con el cumplimiento de los tiempos aqui estipulados.<br><br>\r\n* <strong>Besign, C.A.</strong> ofrece sobre para ud, nuestro cliente Agencia de publicidad, un descuento del 20% sobre el monto de Diseño y Desarrollo del contratado.', '30 días', '1', 15860984, 'Coronel Macario', '0'),
(285, 5, '27 de julio de 2007', 0, 'direccion fiscal', 'Diseño Industrial', 1800000.000, 9, 162000.000, '* El precio proporcionado es referencial y corresponde a la tarifa minima por levantamiento de edificaciones. <br>\r\n*La tarifa variará en conformidad a la complejidad del modelo y el numero de elementos solicitados. \r\n\r\n', 'A convenir con el cliente', '3', 15869947, 'Levantamientos 3D', '0'),
