(287, 86, '30 de julio de 2007', 0, 'direccion fisica', 'Proyecto Web', 1750000.000, 9, 157500.000, 'El Website estará programado con tecnología HTML+FLASH+PHP que permitirá integrar animaciones, fotos y texto, creando un diseño amigable e dinámico.<br>\r\nLas animaciones estarán probablemente presentes en Cabecera, Botones e Imágenes para lograr un site más agradable y captar mas atención y empatía con los usuarios.<br><br>\r\n* El Cliente contará con la activacion de un Modulo de Venta para articulos, el cual será tramitado a través de acciones entre el Cliente, Banco Mercantil y Besign.<br><br>\r\n* El cliente contará con una <strong>herramienta de administracion de contenido</strong> que permitirá la actualización de toda la informacion de texto y banners en secciones de la pagina. Igualmente esta herramienta permite al cliente administrar con total autonomia el catálogo de productos, manejando precios, imagenes, categorias, subcategorias, marcas, politicas de envio<br>\r\n\r\n* El <strong>tiempo de desarrollo</strong> es de 30 días aproximadamente a partir de la cancelacion de la primera cuota y de la recepcion del material de contenido.<br>\r\n* El cliente recibirá un <strong>Entrenamiento e Induccion</strong> en sus oficinas de la herramienta de asministracion, de modo que pueda manejar con autonomia el contenido de la pagina. Le será entregado al cliente un manual impreso como referencia a la inducción<br>\r\n* Seran creadas por Besign todas las categorias de Productos existentes y se incluirá 1 producto por categoria para mostrar contenido, sin embargo el resto de los productos serán introducidos por el cliente.<br>\r\n* <strong>Besign, C.A.</strong> no se responsabiliza por demoras en el proceso de activacion del sistema de pago electronico causadas por el proceso de gestión del Banco o el Cliente, que puedan interferir con el cumplimiento de los tiempos aqui estipulados.<br><br>', '30 días', '1', 15860984, 'Carro de Compras Basico', '0'),
