(291, 88, '03 de agosto de 2007', 0, 'direccion fisica', 'Proyecto Web', 4900000.000, 9, 441000.000, '* El <strong>Website</strong> estará programado con tecnología FLASH+XML+PHP que permitirá integrar animaciones, fotos y texto, creando un diseño interactivo y altamente dinámico.\r\n<br>\r\nLas animaciones estarán basadas en ejemplos de sitios de alta categoria como <strong>www.diesel.com, www.adidas.com/women</strong> para lograr un site impactante y con tecnologia de punta, digno de referencias internacionales a fin de captar la atención y empatía de los usuarios. El diseño y concepto tendrá como premisa la tendencia que identifica a la marca.<br>\r\n* El sitio contará con un <strong>Catalogo de productos</strong> con opcion a compra en linea para usuarios registrados, simple y navegable desde cualquier máquina o velocidad.<br><br>\r\n* El Cliente contará con la activacion de un Modulo de Venta para articulos, el cual será tramitado a través de acciones entre el Cliente, Banco Mercantil y Besign.\r\nEl catalogo en linea, estará destinado a revendedores y mayoristas, que deberan registrarse en la pagina para navegar el contenido y obtener la lista de precios asi como realizar sus compras. La pagina manejará una base de datos de clientes para este fin.<br>\r\n\r\n* El tiempo de desarrollo es de 30 a 45 días aproximadamente a partir de la cancelacion de la primera cuota y de la recepcion del material de contenido.<br>\r\n\r\n* Besign, C.A. no se responsabiliza por demoras en el proceso de activacion del sistema de pago electronico causadas por el proceso de gestión del Banco o el Cliente, que puedan interferir con el cumplimiento de los tiempos aqui estipulados.\r\n\r\n<br><br>\r\n* El <strong>Plan de Mantenimiento</strong> comprende la inclusión en el catálogo de la página hasta 10 prendas por mes. En caso de requerir más piezas o de requerir actualizaciones más completas para el catálogo, debe ser solicitada la estimación de un nuevo presupuesto.\r\n<br>\r\n* La seleccion del <strong>Plan de Financiamiento</strong> para la cancelacion del Proyecto, es negociable<br>\r\n* El<strong>Tiempo de Entrega</strong> podrá aumentar o disminuir en función de la extensión del catálogo', '45 días', '1', 15860984, 'Andartu', '0'),
(292, 87, '05 de agosto de 2007', 0, 'direccion fiscal', 'Proyecto Web', 2885000.000, 9, 259650.000, 'El Website estará programado con tecnología HTML+FLASH+PHP que permitirá integrar animaciones, fotos y texto, creando un diseño amigable y dinámico.<br>\r\nLas animaciones estarán probablemente presentes en Cabecera, Botones e Imágenes para lograr un site más agradable y captar mas atención y empatía con los usuarios.<br><br>\r\n* El cliente contará con una <strong>cuota de mantenimiento</strong> que permitirá la actualización de toda la informacion de texto y banners en secciones de la pagina por parte de Besign, permitiendo hacer cambios en el catálogo de productos, manejo de precios, imagenes, categorias, subcategorias, marcas, etc.<br>\r\n\r\n* El <strong>tiempo de desarrollo</strong> es de 30 días aproximadamente a partir de la cancelacion de la primera cuota y de la recepcion del material de contenido.<br>\r\n\r\n* Se contemplan espacios en home y secciones internas, para la venta de publicidad a sus clientes en caso de que la empresa lo contemple dentro de sus requerimientos. ', '30 días', '3', 17031028, 'Página Web', '0');
INSERT INTO `presupuesto` (`id`, `id_cliente`, `fecha`, `persona_contacto`, `direccion`, `tipo`, `subtotal`, `iva`, `impuesto`, `nota`, `tiempo`, `pago`, `firma`, `titulo`, `data`) VALUES
(293, 89, '03 de agosto de 2007', 0, 'direccion fisica', '', 25150.000, 9, 2263.500, '* El costo por <strong> servicio de mensajería de texto</strong> es aplicado cada vez que el Cliente solicita el envío de un mensaje al grupo registrado. <br>\r\n* El <strong>costo unitario por mensaje de texto</strong> será totalizado contra la cantidad de mensajes enviados. Este total variará en función de la cantidad de registrados en la Base de Datos<br>\r\n* La línea utilizada para el Servicio de Mensajería es <strong>Movistar</strong>, pertenece a Besign, C.A., y está destinada únicamente para este servicio. No podrá ser utilizado como número de contacto, recepción de mensajes o buzón de voz. <br>\r\n* El <strong>máximo de caracteres</strong> por mensaje de texto es de 120.<br>\r\n* Cada envío debe ser solicitado con mínimo de <strong>anticipación de 24 h </strong> a la fecha deseada para circulación del mensaje.<br>\r\n* Se emitirá una <strong>factura mensual</strong> con el total de envios y mensajes acumulados correspondientes al uso en el mes que el cliente dé al servicio.\r\n<br>--------------------------------------------------<br>\r\n* Costos validos para 01 hasta 500 mensajes. Si la cantidad es superior, por favor solicite una nueva cotización', 'A convenir con el cliente', '4', 15860984, 'SMS Conciertos', '0'),
(294, 90, '07 de agosto de 2007', 32, 'direccion fisica', 'Proyecto Web', 4935000.000, 9, 444150.000, 'El Website estará programado con tecnología HTML+FLASH+PHP que permitirá integrar animaciones, fotos y texto, creando un diseño amigable e dinámico.<br>\r\nLas animaciones estarán probablemente presentes en Cabecera, Botones e Imágenes para lograr un site más agradable y captar mas atención y empatía con los usuarios; sin embargo, el sitio mantendrá un importante equilibrio entre animaciones y velocidad de carga, a modo de no demorar la navegación para el usuario.<br><br>\r\n* El cliente contará con una <strong>herramienta de administración de contenido</strong> que permitirá administrar con total autonomía el catálogo de productos, manejando precios, imágenes, categorías, subcategorías, marcas, modelos, tamaños, caracteristicas.<br>\r\n\r\n* El <strong>tiempo de desarrollo</strong> es de 45 días aproximadamente a partir de la cancelación de la primera cuota y de la recepción del material de contenido.<br>\r\n* El cliente recibirá un <strong>Entrenamiento e inducción</strong> en sus oficinas de la herramienta de administración, de modo que pueda manejar con autonomía el contenido del catálogo en linea. Le será entregado al cliente un manual impreso como referencia a la inducción<br>\r\n* Serán creadas por Besign todas las categorías de Productos existentes y se incluirán 5 productos por categoría para mostrar contenido, sin embargo el resto de los productos serán introducidos por el cliente.<br>\r\n* En caso de que el cliente requiera la inclusion total de sus productos en linea por parte de Besign, debe solicitar un anexo al presupuesto presente.', '45 días', '1', 15860984, 'Catalogo con Precios', '0'),
(295, 60, '06 de agosto de 2007', 0, 'direccion fiscal', 'Carnets', 9999999.999, 9, 1043280.000, '*El presente presupuesto deberá ser aprobado por escrito.<br>\r\n*El modelo de cinta presupuestado es el correspondiente al código: <strong>"metal-001" (archivo de imagen anexado en el presupuesto)<br>', '7 días', '3', 17031028, 'Carnets ExpoFevipan-PatrocinioMetal', '0'),
(296, 56, '06 de agosto de 2007', 0, 'direccion fiscal', 'Diseño Gráfico', 1382500.000, 9, 124425.000, '*El presente presupuesto deberá ser aprobado por escrito.<br>\r\n*La cuota asignada por cada corrección variará según la cantidad de modificaciones que sean realizadas a los artes propuestos.<br>\r\n*Si para la creación del Concepto e Imagen Gráfica de la Tienda es necesario hacer una Sesión de Fotos específica, sería necesario realizar una cotización aparte adaptada según las condiciones y requerimientos del cliente.', 'A convenir con el cliente', '3', 17031028, 'Tienda de Niños', '0'),
