(300, 60, '24 de agosto de 2007', 0, 'direccion fisica', 'Carnets', 8400000.000, 9, 756000.000, '*El presente presupuesto deberá ser aprobado por escrito.<br>\r\n*El modelo de cinta presupuestado es el correspondiente al código: <strong>"metal-001" (archivo de imagen anexado en el presupuesto).<br>\r\n* La cinta del carnet será de color blanco para una mejor visualización de los logotipos de Pepsi y Aspamegua impresos a full color.', 'A convenir con el cliente', '3', 17031028, 'Carnets ExpoFevipan-PatrocinioMetal', '0'),
(301, 92, '12 de agosto de 2007', 0, 'direccion fisica', 'Proyecto Web', 2285000.000, 9, 205650.000, 'El Website estará programado con tecnología HTML+FLASH+PHP que permitirá integrar animaciones, fotos y texto, creando un diseño amigable e dinámico.<br>\r\nLas animaciones estarán probablemente presentes en Cabecera, Botones e Imágenes para lograr un site más agradable y captar mas atención y empatía con los usuarios. Se aplicará un diseño con enfasis en imágenes ecológicas y relacionadas al ambiente, muy armonioso y pacifico para inspirar a los visitantes<br><br>\r\n* Los formularios para orientacion de los usuarios, seran suministrados por el Cliente, quien dará tambien instrucciones para su manejo.<br>\r\n* Se registrará una Base de Datos de las personas que den uso a los formularios de la página, lo que permitirá la posibilidad de hacer envios de correo de noticias, informacion de cursos, y publicaciones<br>\r\n* El <strong>tiempo de desarrollo</strong> es de 30 días aproximadamente a partir de la cancelacion de la primera cuota y de la recepcion del material de contenido.<br>', '30 días', '1', 15860984, 'Pasantia Ingrid', '0'),
(302, 60, '13 de agosto de 2007', 0, 'direccion fiscal', 'Proyecto Web', 2500000.000, 9, 225000.000, '* El precio por Cambio Adicional sera totalizado y facturado, a la culminación del proyecto (Este costo contempla cambios de gran formato dentro de la diagramación planteada para cada artículo en caso de que fuera necesario) .<br>\r\n* Los costos no incluyen los gastos de envío del material final para imprenta en digital.<br>', 'A convenir con el cliente', '3', 17031028, 'Revista AspameguaNº2', '0'),
(303, 72, '23 de August de 2007', 28, 'direccion fisica', 'Diseño Gráfico', 2300000.000, 9, 207000.000, '* El <strong>tiempo de entrega</strong>, será definido por el cliente y el mismo debe ser comunicado al diseñador con antelación de forma que pueda convenirse un calendario de trabajo entre la fundación y el diseñador<br>\r\n* Serán presentados inicialmente <strong>3 bocetos, sobre 1 pieza escogida a desarrollar</strong>, para definir la imagen sobre la que estarán basados el resto de los señalados en el presupuesto.<br>\r\n* Se contemplan el manejo de correcciones sobre el boceto seleccionado. Una vez definida la imagen, se desarrollaran el total de las piezas.<br>', 'A convenir con el cliente', '3', 15860984, 'Salón Nacional', '0'),
