(308, 56, '22 de August de 2007', 0, 'direccion fisica', 'Diseño Industrial', 9999999.999, 9, 9999999.999, '-Los Precios aquí presentados son estrictamente <strong>referenciales</strong> y se basan en una descripción general del trabajo por parte del cliente.<br>\r\n-El <strong>tiempo de realización</strong> sera de un mínimo de 4 semanas.<br>\r\n-Es indispensable la <strong>cancelación del adelanto</strong> para dar inicio a la fase de construcción. <br>\r\n-Los precios reflejados en este presupuesto no incluyen la realización de logotipos y avisos corpóreos iluminados (ej. luz de neón)', 'A convenir con el cliente', '6', 15869947, 'Presupuesto Stand Area Arquitectos', '0'),
(309, 72, '23 de August de 2007', 28, 'direccion fisica', 'Diseño Gráfico', 650000.000, 9, 58500.000, '* El <strong>tiempo de entrega</strong>, será definido por el cliente y el mismo debe ser comunicado al diseñador con antelación de forma que pueda convenirse un calendario de trabajo entre la fundación y el diseñador<br>\r\n* Serán presentados al cliente propuestas sobre formato para la carpeta, hoja y tarjeta.<br>\r\n*El contenido para la presentación Multimedia, será suministrado por el cliente<br>', 'A convenir con el cliente', '3', 15860984, 'Catálogo Institucional', '0'),
(310, 72, '23 de August de 2007', 28, 'direccion fisica', 'Diseño Gráfico', 1700000.000, 9, 153000.000, '* El <strong>tiempo de entrega</strong>, será definido por el cliente y el mismo debe ser comunicado al diseñador con antelación de forma que pueda convenirse un calendario de trabajo entre la fundación y el diseñador<br>\r\n* Serán presentados inicialmente <strong>3 bocetos, sobre 1 pieza escogida a desarrollar</strong>, para definir la imagen sobre la que estarán basados el resto de los señalados en el presupuesto.<br>\r\n* Se contemplan el manejo de correcciones sobre el boceto seleccionado. Una vez definida la imagen, se desarrollaran el total de las piezas.<br>', 'A convenir con el cliente', '3', 15860984, 'Exaltación al Salón de la Fama', '0'),
(311, 94, '24 de agosto de 2007', 0, 'direccion fisica', 'Proyecto Web', 35000.000, 9, 3150.000, '- La <strong>disponibilidad</strong> de horas en oferta es de 40 horas mensuales.<br>\r\n- La <strong>cantidad de horas mensuales</strong> en oferta puede variar en función de la disponibilidad de la empresa. Por favor consulte mensualmente para mayor coordinación entre las partes.<br>\r\n- El cliente postulará <strong>tiempos de entrega</strong> y los mismos son estudiados, adaptados y/o aceptados por Besign.<br>\r\n- El cliente suministra la información suficiente para el desarrollo de los trabajos.', 'A convenir con el cliente', '3', 15860984, 'Horas Desarrollo Multimedia', '0'),
