(313, 95, '24 de agosto de 2007', 0, 'direccion fiscal', 'Carnets', 3500000.000, 9, 315000.000, '*El presente presupuesto deberá ser aprobado por escrito.<br>\r\n*Tanto el color de la cinta como el del logotipo impreso deberá ser escogido por el cliente luego de ser comprobada su disponibilidad según la fecha de entrega.<br>\r\n*La fecha de entrega del material será establecida en el momento en que se realice el pago del 50% inicial y material informativo por parte del cliente.<br>', 'A convenir con el cliente', '3', 17031028, 'Indentificación Magallanes', '0'),
(314, 81, '29 de agosto de 2007', 0, 'direccion fisica', 'Proyecto Web', 6000000.000, 9, 540000.000, 'El Website estará programado con tecnología HTML+FLASH+XML que permitirá integrar animaciones, fotos y texto, creando un diseño elegante e interactivo. \r\nLas animaciones podrán estar presentes en Cabecera, Botones e Imágenes para lograr un site más agradable y captar mas atención y empatía con los usuarios. A su vez, será para la empresa reflejo de mayor tecnología, al mostrar un meticuloso y sobrio diseño. \r\n<br><br>\r\n* El Precio puede variar en función de la cantidad definitiva de secciones<br>\r\n* El costo por mantenimiento puede ser modificado en función a la complejidad de los cambios solicitados por el cliente\r\n<br>\r\n<strong>* El pago por mantenimiento se realizará mensualmente a partir de 30 días de la fecha de cancelación del monto total por el proyecto.</strong>', '45 días', '3', 15860984, '2 Sitios Ceramicas', '0'),
