(317, 93, '27 de agosto de 2007', 0, 'direccion fiscal', 'Carnets', 69000.000, 9, 6210.000, '*El presente presupuesto deberá ser aprobado por escrito.<br>\r\n*La cantidad mínima a manejar con éstos precios es de 50 unidades.<br>\r\n*Según las cantidades los precios se manejarían en el siguiente rango: de 50 a 100 Bs. 4000,00 / de 100 en adelante Bs. 3800,00<br>\r\n', 'A convenir con el cliente', '3', 17031028, 'Lista de precios carnets', '0'),
