(321, 97, '11 de septiembre de 2007', 0, 'direccion fiscal', 'Proyecto Web', 9999999.999, 9, 1035000.000, 'El Website estará programado con tecnología HTML+FLASH+XML que permitirá integrar animaciones, fotos y texto, creando un diseño amigable e interactivo. <br>\r\nLas animaciones estarán presentes en Cabecera, Botones e Imágenes para lograr un site más agradable y captar mas atención y empatía con los usuarios. A su vez, serán reflejo de mayor tecnología, al mostrar un meticuloso y sobrio diseño conjugado con animaciones de alto impacto.<br><br>\r\n* El paquete presentado en este presupuesto estima el desarrollo de los Proyectos<strong>"Space Music Records", "Johnny Sigal" y "Tartara"</strong><br>\r\n* Los Proyectos "Space Music Records" y "Johnny Sigal" contaran con <strong>herramientas administrativas</strong> para modificar contenido en linea, segun lo indicado en el SiteMap adjunto.<br>\r\n* El desarrollo de los 3 Proyectos no podrá ser simultaneo.<br>\r\n* El servicio de hosting y dominio es manejado directamente por el cliente y por ello no se incluye en el presente presupuesto.<br>', 'A convenir con el cliente', '1', 15860984, 'Jhonny Sigal + Tartara + Space', '0'),
(322, 97, '11 de septiembre de 2007', 0, 'direccion fisica', 'Mantenimiento', 410000.000, 9, 36900.000, '* El pago por mantenimiento se realizará mensualmente a partir de 30 días de la fecha de cancelación del monto total por el proyecto.<br>\r\n* El costo por mantenimiento para cada proyecto, es estimado en función de lo que Besign anticipa como frecuencia de cambios y modificaciones', 'Mensualmente', '5', 15860984, 'Jhonny Sigal + Tartara + Space', '0'),
