(329, 101, '04 de octubre de 2007', 0, 'direccion fisica', 'Proyecto Web', 3015000.000, 9, 271350.000, 'El Website estará programado con tecnología HTML+FLASH+PHP que permitirá integrar animaciones, fotos y texto, creando un diseño amigable e interactivo. \r\nLas animaciones estarán probablemente presentes en Cabecera, Botones e Imágenes para lograr un site más agradable y captar mas atención y empatía con los usuarios.<br>\r\n* El Catálogo de Productos, se incluirá en una segunda fase de desarrollo del Proyecto Web, y deberá ser cotizado en su momento, aparte.<br>\r\n* Este presupuesto ya refleja un descuento aplicado por<strong>Besign, C.A.</strong> del 15% sobre el monto de Diseño y Desarrollo del contratado.', '30 días', '1', 15860984, 'Sin Catalogo POP (inicialmente diseño eran 3.570mil)', '0'),
