(331, 57, '23 de septiembre de 2007', 0, 'direccion fiscal', 'Cd Multimedia', 7240000.000, 9, 651600.000, '* El Catálogo Digital o Multimedia, incluye animaciones y ambientación musical.<br>\r\n* El precio puede variar en función a la <strong>cantidad de paneles informativos y secciones</strong> a incluir.<br>\r\n* La página web:  <strong>http://www.entrance4.net/</strong>  es tomada como referencia para las animaciones y formas de visualización del Catálogo Multimedia.<br>\r\n* <strong>El tiempo de entrega estimado es para el 3 de diciembre, siempre y cuando el material, la aprobación de este presupuesto y la cancelación del primer 50% sean recibidos antes del 01/10.</strong><br>\r\n', 'A convenir con el cliente', '3', 17031028, 'MAI - El Carabobeño', '0'),
(332, 3, '18 de septiembre de 2007', 2, 'direccion fisica', 'Proyecto Web', 2460000.000, 9, 221400.000, 'El Website estará programado con tecnología HTML+FLASH que permitirá integrar animaciones, fotos y texto, creando un diseño amigable e interactivo. \r\nLas animaciones estarán presentes en Cabecera, Botones e Imágenes para lograr un site más agradable y captar mas atención y empatía con los usuarios.  \r\n<br>\r\nEl desarrollo del Sitio Web esta planteado bajo un Plan Básico, sin dejar de tener una excelente apariencia y presentación<br>\r\n* El costo por mantenimiento es cancelado mensualmente y puede ser modificado en función a la complejidad de los cambios solicitados por el cliente\r\n<br>\r\n<strong>* El pago por mantenimiento se realizará mensualmente a partir de 30 días de la fecha de cancelación del monto total por el proyecto.</strong><br>\r\n* Besign, C.A. otorga a Ud, nuestro cliente Agencia de Publicidad un <strong>descuento del 20% sobre el costo por Diseño y Desarrollo</strong>', '30 días', '3', 15860984, 'Arepas El Primo', '0'),
(333, 103, '19 de septiembre de 2007', 34, 'direccion fisica', 'Proyecto Web', 8250000.000, 9, 742500.000, 'El Website estará programado con tecnología HTML+FLASH+PHP+XML que permitirá integrar animaciones, fotos y texto, creando un diseño amigable e interactivo. \r\nLas animaciones estarán probablemente presentes en Cabecera y Botones para lograr un site más agradable y captar mas atención y empatía con los usuarios.<br><br>\r\n* El tiempo de desarrollo hasta el 05/10, contempla como 1era etapa: Quienes Somos, Como anunciarse, Nuestras tarifas, Revista impresa, Publicidad en página web, Revista Virtual, Puntos de distribución, Información de interés, Contáctenos <br>\r\n* El tiempo de desarrollo en 2da etapa para Buscador de Inmuebles, Publicar Inmuebles y Panel Mi Cuenta, será de 25 a 30 dias adicionales aproximadamente.\r\n ', 'A convenir con el cliente', '1', 15869947, 'Toimudao.com', '0'),
(334, 5, '18 de septiembre de 2007', 0, 'direccion fisica', 'Diseño Industrial', 1290000.000, 9, 116100.000, '*La tarifa variará en conformidad a la complejidad del modelo y de la representacion final solicitada. \r\n*El cliente debe contratar una cantidad minima de 3 imagenes \\"render\\" para la prestación del servicio.\r\n*Las modificaciones solicitadas sobre el modelo (una vez realizada la entrega) generaran costos adicionales. \r\n*la realizacion de cada nueva imagen "render\\" generara un costo adicional correspondiente al precio unitario señalado en el presupuesto.\r\n', 'A convenir con el cliente', '3', 15869947, 'Levantamientos 3D', '0'),
