(354, 31, '07 de octubre de 2007', 0, 'direccion fisica', 'Proyecto Web', 585000.000, 9, 52650.000, '- El Tiempo de Entrega 24-48 horas aprox. despues de la cancelación de la primera cuota y la eleccón del dominio a habilitar.<br>\n- La habilitación de las cuentas de correo bajo el dominio seleccionado, unicamente es posible a través de la contratación del servicio de hosting.<br>\n- El presente presupuesto no comprende desarrollo para Website.<br>\n- El cliente contará con una pantalla en su dominio con el mensaje "Sitio en Desarrollo" y la información de contacto como telefonos y direccion, email.', 'A convenir con el cliente', '4', 15860984, 'Hosting + Correo', '0'),
