(362, 110, '28 de octubre de 2007', 0, 'direccion fisica', 'Proyecto Web', 5250000.000, 9, 472500.000, 'El Website estará programado con tecnología HTML+FLASH+XML+PHP que permitirá integrar animaciones, fotos y texto, creando un diseño amigable e interactivo. <br>\r\nLas animaciones estarán presentes en Cabecera, Botones e Imágenes para lograr un site más agradable y captar mas atención y empatía con los usuarios. A su vez, será para la empresa reflejo de mayor tecnología, al mostrar un meticuloso y sobrio diseño.<br>\r\nSe aspira desarrollar un <strong>planteamento gráfico acorde a las tendencias ecológicas y minimalistas</strong> que identifican la razón de la empresa, el cual capturará y encantará al usuario visitante y le proporcionará una idea clara sobre la personalidad de la marca.\r\n<br>\r\nSe plantea incorporar un grupo de animaciones que muestren al usuario los procesos por los que pasa la prenda, a modo de afianzar la idea del trato personalizado y exclusivo que se le da a cada pieza. Esto a través de una especie de <strong>recorrido interactivo</strong> por diferentes etapas del servicio donde el usuario será el actor principal.\r\n<br><br>\r\n* La presente propuesta no contempla los costos sobre dominio ".com" o ".com.ve", ni servidor u hospedaje, puesto que actualmente el cliente ya cuenta con los mismos. En caso de requerirlos puede solicitar un complemento en la presente cotizacion.<br>\r\n* El tiempo de desarrollo puede oscilar entre 45-60 días. Pueden plantearse etapas de culminacion, de modo que pueda publicarse la mayor cantidad de secciones desarrolladas de la pagina en un 1era fase<br>\r\n* Los <strong>Términos y condiciones</strong> de esta propuesta son ampliados en el contrato entre las partes que se presentará una vez aprobada la cotización', '60 días', '1', 15860984, '', '0'),
(363, 111, '28 de octubre de 2007', 0, 'direccion fisica', 'Proyecto Web', 4000000.000, 9, 360000.000, 'El Website estará programado con tecnología HTML+FLASH+XML+PHP que permitirá integrar animaciones, fotos y texto, creando un diseño amigable e interactivo. <br>\r\nLas animaciones estarán presentes en Cabecera, Botones e Imágenes para lograr un site más agradable y captar mas atención y empatía con los usuarios. A su vez, será para la empresa reflejo de mayor tecnología, al mostrar un meticuloso y sobrio diseño.<br>\r\nEl <strong>planteamento gráfico</strong> a desarrollar podria involucrar animaciones relativas al proceso de costura y elementos que destacan a la marca.\r\n<br>\r\nSe incluirá un <strong>localizador de tiendas</strong> para la seccion de contacto, con la posibilidad de incluir foto de fachada y datos bases de cada sucursal franquicia.\r\n<br><br>\r\n* La presente propuesta no contempla los costos sobre dominio \\".com\\" o \\".com.ve\\", ni servidor u hospedaje, puesto que actualmente el cliente ya cuenta con los mismos. En caso de requerirlos puede solicitar un complemento en la presente cotizacion.<br>\r\n* Los <strong>Términos y condiciones</strong> de esta propuesta son ampliados en el contrato entre las partes que se presentará una vez aprobada la cotización', '45 días', '1', 15860984, '', '0'),
