(368, 108, '07 de noviembre de 2007', 0, 'direccion fiscal', 'Proyecto Web', 4120000.000, 9, 370800.000, 'El Website estará programado con tecnología HTML+FLASH que permitirá integrar animaciones, fotos y texto, creando un diseño amigable e interactivo. \r\nLas animaciones estarán presentes en Cabecera, Botones e Imágenes para lograr un site más agradable y captar mas atención y empatía con los usuarios.  \r\n<br>\r\n* El costo por mantenimiento es cancelado mensualmente y puede ser modificado en función a la complejidad de los cambios solicitados por el cliente\r\n<br>\r\n<strong>* El pago por mantenimiento se realizará mensualmente a partir de 30 días de la fecha de cancelación del monto total por el proyecto.</strong><br>\r\n* El costo por la Herramienta de Postulacion puede variar en funcion de cualquier instruccion adicional sobre la misma.<br>\r\n* El tiempo de entrega es estimado entre 45-60 días.<br>\r\n* La herramienta de Postulacion permitiría que los usuarios ingresaran sus datos en la web para reservar cupos en cursos en programación, y a DTG permitiría la publicación de nuevos cursos en la web a través de datos de horario, costos, fechas y cupos disponibles. <br>\r\n* Besign asumirá el costo por <strong>mantenimiento de 5 meses como Consideracion de Alianza con DTG Consultores.</strong>\r\n', '60 días', '1', 15869947, 'Sistema de postulacion', '0'),
