(381, 98, '16 de noviembre de 2007', 0, 'direccion fiscal', 'Diseño Gráfico', 9999999.999, 9, 4198500.000, '*El presente presupuesto deberá ser aprobado por escrito.<br>\r\n*El tiempo de entrega dispuesto por la imprenta para este año (2007) es de 30 días (a partir de la entrega del material), tomando en cuenta que estarán activos laboralmente hasta el 22 de Diciembre de 2007.<br>\r\n*En caso de que el material sea entregado a partir de Enero 2008, el tiempo de entrega estimado es de 21 días (a partir de la entrega del material).<br>\r\n*El costo unitario por página diagramada, variará en función al aumento o disminución de la cantidad de páginas propuestas en cada folleto.<br>\r\n*<strong>Las características principales del material impreso (según folleto referencial Sofitel), son descritas a continuación:</strong><br>\r\n<strong>PORTADA</strong><br>\r\n   \r\n    Formato: 21 x 21 cms<br>\r\n    Solapas internas en portada y contraportada de 15 cms c/u<br>\r\n    Cara Anversa Tinta Especial (en Dorado)<br>\r\n    Material Glassé Matte 350 gr<br>\r\n    Full Color + Tinta Especial<br>\r\n    Armado a 2 grapas<br>\r\n\r\n<strong>TRIPA</strong><br>\r\n\r\n\r\n   Formato: 21 x 21 cms<br>\r\n   - 36 páginas Glassé Matte 200 gr - full color + tinta especial<br>\r\n   - 8 páginas de Separatas en Glassé delgado<br>\r\n   (las separatas seran impresas por 1 sola cara)<br>\r\n    1 color + Tinta Especial.<br>\r\n\r\n- Si llegase a haber alguna diferencia en las características de impresión y material, favor comunicarlo lo antes posible, ya que puede existir alguna variación de precio en el material a imprimir.\r\n\r\n', 'A convenir con el cliente', '3', 17031028, 'Folleto VIP', '0'),
