(396, 122, '15 de enero de 2008', 39, 'direccion fisica', 'Diseño Gráfico', 6057.000, 9, 545.130, '* El presente presupuesto deberá ser aprobado por escrito.<br>\r\n* El montaje de los elementos presupuestados para la fachada, debe hacerse preferiblemente al momento de que la tienda no se encuentre en reparaciones exteriores ni construcciones cercanas que puedan perjudicar la colocación de los elementos finales.<br>\r\n* El costo final por Vitrina/Fachada varia segun las medidas, cantidad de colores y diseño finales, por lo tanto, debe ser represupuestado y el precio aqui presentado es unicamente para fines referenciales.<br>\r\n* No se incluyen tarifas de traslado.', 'A convenir con el cliente', '3', 15860984, 'Apertura para el 25/01', '0'),
