(400, 3, '18 de enero de 2008', 2, 'direccion fisica', 'Proyecto Web', 4365.000, 9, 392.850, 'El Website estará programado con tecnología HTML+FLASH que permitirá integrar animaciones, fotos y texto, creando un diseño amigable e interactivo. \r\nLas animaciones estarán presentes en Cabecera, Botones e Imágenes para lograr un site más agradable y captar mas atención y empatía con los usuarios.  \r\n<br>\r\nEl desarrollo del Sitio Web contempla la inclusión de hasta 70 productos en el catalogo on-line, a cargo de Besign con material que será suministrado por el cliente (con imagen, ampliacion y detalles del producto)<br>\r\n* El costo por mantenimiento es cancelado mensualmente y puede ser modificado en función a la complejidad de los cambios solicitados por el cliente\r\n<br>\r\n<strong>* El pago por mantenimiento se realizará mensualmente a partir de 30 días de la fecha de cancelación del monto total por el proyecto.</strong><br>\r\n* El tiempo de entrega es estimado entre 45-60 días.<br>\r\n* El costo por el Proyecto Web puede variar en función del contenido a incluir en el mismo.<br>\r\n* Besign, C.A. otorga a Ud, nuestro cliente Agencia de Publicidad un <strong>descuento del 20% sobre el costo por Diseño y Desarrollo</strong>', '45 días', '3', 15860984, 'Opticadeny', '0'),
(401, 108, '26 de enero de 2008', 0, 'direccion fiscal', 'Mantenimiento', 330.000, 9, 29.700, '* Se han considerado hasta 7500 envíos mensuales<br>\r\n* El contenido de cada boletín será actualizado por el cliente y remitido a Besign para ejecutar el envío<br>\r\n* El peso máximo por boletín es de 4 MB (incluyendo archivos adjuntos si los contiene).<br>\r\n* Cada envío debe ser solicitado con mínimo de anticipación de 24 h a \r\nla fecha deseada para circulación del boletín. Los boletines circularán en días hábiles, salvo casos solicitados por el cliente, con suficiente antelación para programar la circulación durante días hábiles.<br>\r\n* El costo por Servicio de mensajería de texto es aplicado cada vez que el Cliente solicita el envío de un mensaje al grupo registrado. Se emitirá una factura mensual con el total de envíos realizados acumulados correspondientes al mes que el cliente dé uso al servicio. ', 'Mensualmente', '5', 15860984, 'Mailing list Medium (hasta 7500 envios)', '0'),
(402, 124, '23 de enero de 2008', 0, 'direccion fisica', 'Proyecto Web', 8255.000, 9, 742.950, '* El <strong>Website</strong> estará programado con tecnología FLASH+XML+PHP que permitirá integrar animaciones, fotos y texto, creando un diseño interactivo y altamente dinámico.\r\n<br>\r\nLas animaciones estarán basadas en ejemplos de sitios de alta categoria como <strong>www.oneill.com, www.diesel.com</strong> para lograr un site impactante y con tecnologia de punta, digno de referencias internacionales a fin de captar la atención y empatía de los usuarios. El diseño tendrá como premisa la tendencia urbana que identifica a la marca.<br>\r\n* El sitio contará con un llamativo <strong>Home Flash</strong> e igualmente con un <strong>Catálogo HTML</strong>, simple y navegable desde cualquier máquina o velocidad.<br>\r\n* El <strong>Plan de Mantenimiento</strong> comprende la actualización de noticias, promociones y eventos relacionados a la empresa ó la marca, solicitados por el cliente. El precio puede ser replanteado en función de lo que se establezcan como cambios regulares<br>\r\n* El Cliente contará con la activacion de un Modulo de Venta nacional para articulos, el cual será tramitado a través de acciones entre el Cliente, Banco Mercantil y Besign.<br>\r\n* El cliente contará con una <strong>herramienta de administracion</strong> de contenido que permitirá la administracion con total autonomia del catálogo de productos, manejando precios, imagenes, categorias, subcategorias, marcas, politicas de envio\r\n* El tiempo de desarrollo se establecerá en etapas que serán previamente coordinadas y aprobadas por el cliente.<br>\r\n* El cliente recibirá un <strong>Entrenamiento e Induccion</strong> en sus oficinas de la herramienta de administración, de modo que pueda manejar con autonomia el contenido de la pagina. Le será entregado al cliente un manual impreso como referencia a la inducción<br>\r\n* Seran creadas por Besign todas las categorias de Productos existentes y se incluirá 1 producto por categoria para mostrar contenido, sin embargo el resto de los productos serán introducidos por el cliente. <br>\r\n* Besign, C.A. no se responsabiliza por demoras en el proceso de activacion del sistema de pago electronico causadas por el proceso de gestión del Banco o el Cliente, que puedan interferir con el cumplimiento de los tiempos aqui estipulados.<br>\r\n* El <strong>Tiempo de Entrega</strong> podrá aumentar o disminuir en función de la extensión del catálogo, sus otras aplicaciones.', 'A convenir con el cliente', '1', 15860984, '', '0'),
