(408, 124, '28 de enero de 2008', 0, 'direccion fisica', 'Proyecto Web', 2160.000, 9, 194.400, 'El Website estará programado con tecnología HTML+FLASH que permitirá integrar animaciones, fotos y texto, creando un diseño amigable e interactivo. <br>\r\nEl desarrollo del Sitio Web esta planteado bajo un Plan Básico, sin dejar de tener una excelente apariencia y presentación<br>\r\n* El costo por mantenimiento es cancelado mensualmente y puede ser modificado en función a la complejidad de los cambios solicitados por el cliente<br>\r\n<strong>* El presupuesto es presentado para el proyecto TUTOEXPO</strong><br>', '30 días', '3', 15860984, 'Tuto Expo', '0'),
(409, 125, '11 de febrero de 2008', 0, 'direccion fisica', 'Diseño Industrial', 744.000, 9, 66.960, 'diseño industrial', '15 días', '3', 15869947, 'Habladores Acrilico', '0'),
(410, 126, '01 de febrero de 2008', 0, 'direccion fisica', 'Proyecto Web', 1875.000, 9, 168.750, 'El Website estará programado con tecnología HTML+FLASH que permitirá integrar animaciones, fotos y texto, creando un diseño amigable e interactivo. <br>\r\nEl desarrollo del Sitio Web esta planteado bajo un Plan Básico, sin dejar de tener una excelente apariencia y presentación<br>\r\n* El costo por mantenimiento es cancelado mensualmente y puede ser modificado en función a la complejidad de los cambios solicitados por el cliente. Permite la publicación de noticias y eventos ocasionales.<br>\r\n* Las secciones o módulos que no se contemplen en este presupuesto, podrán ser posteriormente incluidas en el proyecto final desarrollado mas deben ser presupuestados y aprobados por el cliente previo al momento de su inclusión.<br>\r\n* El Dominio y Hosting para este proyecto son suministrados por el cliente.', '45 días', '3', 15860984, 'Etapa I', '0'),
(411, 127, '01 de febrero de 2008', 0, 'direccion fisica', 'Proyecto Web', 5445.000, 9, 490.050, 'El Website estará programado con tecnología HTML+FLASH+XML que permitirá integrar animaciones, fotos y texto, creando un diseño amigable e interactivo. <br>\r\nLas animaciones estarán presentes en Cabecera, Botones e Imágenes para lograr un site más agradable y captar mas atención y empatía con los usuarios. A su vez, serán reflejo de mayor tecnología, al mostrar un meticuloso y sobrio diseño conjugado con animaciones de alto impacto.<br><br>\r\n* El paquete presentado en este presupuesto estima el desarrollo del Proyecto<strong> "Simon Lopez"</strong><br>\r\n* El Proyecto contará con <strong>herramientas administrativas</strong> para la publicación de fechas de presentaciones y noticias.<br>', '60 días', '1', 15860984, 'Simon Lopez', '0'),
(412, 127, '01 de febrero de 2008', 0, 'direccion fisica', 'Mantenimiento', 40.150, 9, 3.613, '* El costo por <strong> servicio de mensajería de texto</strong> es aplicado cada vez que el Cliente solicita el envío de un mensaje al grupo registrado. <br>\r\n* El <strong>costo unitario por mensaje de texto</strong> será totalizado contra la cantidad de mensajes enviados. Este total variará en función de la cantidad de registrados en la Base de Datos<br>\r\n* La línea utilizada para el Servicio de Mensajería es <strong>Movistar</strong>, pertenece a Besign, C.A., y está destinada únicamente para este servicio. No podrá ser utilizado como número de contacto, recepción de mensajes o buzón de voz. <br>\r\n* El <strong>máximo de caracteres</strong> por mensaje de texto es de 120.<br>\r\n* Cada envío debe ser solicitado con mínimo de <strong>anticipación de 24 h </strong> a la fecha deseada para circulación del mensaje.<br>\r\n* Se emitirá una <strong>factura mensual</strong> con el total de envios y mensajes acumulados correspondientes al uso en el mes que el cliente dé al servicio.\r\n<br>--------------------------------------------------<br>\r\n* Costos validos para 01 hasta 500 mensajes. Si la cantidad es superior, por favor solicite una nueva cotización', 'A convenir con el cliente', '4', 15860984, 'SMS Conciertos', '0'),
(413, 127, '01 de febrero de 2008', 0, 'direccion fisica', 'Mantenimiento', 115.000, 9, 10.350, '* Se han considerado hasta 2500 envíos mensuales<br>\r\n* El contenido de cada boletín será remitido por el cliente a Besign para ejecutar el envío<br>\r\n* El peso máximo por boletín es de 4 MB (incluyendo archivos adjuntos si los contiene).<br>\r\n* Cada envío debe ser solicitado con mínimo de anticipación de 24 h a \r\nla fecha deseada para circulación del boletín. Los boletines circularán en días hábiles, salvo casos solicitados por el cliente, con suficiente antelación para programar la circulación durante días hábiles.<br>\r\n* El costo por Servicio de Envío de Boletín es aplicado cada vez que el Cliente solicita el envío de un mensaje al grupo registrado. Se emitirá una factura mensual con el total de envíos realizados acumulados correspondientes al mes que el cliente dé uso al servicio. ', 'A convenir con el cliente', '4', 15860984, 'Boletines', '0'),
(414, 6, '12 de febrero de 2008', 0, 'direccion fisica', 'Suministros', 14205.000, 9, 1278.450, '* Los indicados en este presupuesto corresponden a las <strong>cantidades mínimas de compra</strong>.<br>\r\n* El costo correspondiente a Bolígrafos incluye la realización del positivo y la clisés necesarios para el proceso de impresión.<br>\r\n* El costo para el programa de bordado no esta incluido y variara segun la cantidad de puntadas y puede afectar los costos para gorras, bolsos, camisas y chemises<br>', 'A convenir con el cliente', '3', 15860984, 'POP + Impresos Aniversario', '0'),
(415, 128, '12 de febrero de 2008', 0, 'direccion fisica', 'Proyecto Web', 3465.000, 9, 311.850, 'El<strong> Website</strong> estará programado con tecnología HTML+XML+FLASH que permitirá integrar animaciones, fotos y texto, creando un diseño amigable e interactivo. \r\nEsto será para la empresa reflejo de mayor tecnología, al mostrar tambien un meticuloso y sobrio diseño. \r\n<br>\r\n* El costo por mantenimiento es cancelado mensualmente y puede ser modificado en función a la complejidad de los cambios solicitados por el cliente. Permite la publicación de noticias y eventos ocasionales.<br>\r\n* Las secciones o módulos que no se contemplen en este presupuesto, podrán ser posteriormente incluidas en el proyecto final desarrollado mas deben ser presupuestados y aprobados por el cliente previo al momento de su inclusión.', '45 días', '3', 15860984, 'Firma Arquitectos', '0'),
