(420, 131, '06 de marzo de 2008', 0, 'direccion fisica', 'Proyecto Web', 2460.000, 9, 221.400, 'El Website estará programado con tecnología HTML+FLASH+PHP que permitirá integrar animaciones, fotos y texto, creando un diseño amigable e dinámico.<br>\r\nLas animaciones estarán probablemente presentes en Cabecera, Botones e Imágenes para lograr un site más agradable y captar mas atención y empatía con los usuarios.<br><br>\r\n* El cliente contará con una <strong>herramienta de administracion de contenido</strong> que permitirá la actualización de toda la informacion de texto y banners en secciones de la pagina. Igualmente esta herramienta permite al cliente administrar con total autonomia el catálogo, manejando imagenes, categorias, subcategorias, descripción de imagen, ambiente adecuado a un trabajo en específico<br>\r\n\r\n* El <strong>tiempo de desarrollo</strong> es de 30-45 días aproximadamente a partir de la cancelacion de la primera cuota y de la recepcion del material de contenido.<br>\r\n* El cliente recibirá un <strong>Entrenamiento e Induccion</strong> en sus oficinas de la herramienta de asministracion, de modo que pueda manejar con autonomia el contenido de la pagina.<br>\r\n* Seran creadas por Besign todas las categorias existentes y se incluirá 1 imagen por categoria para mostrar contenido, sin embargo el resto de las mismas serán introducidas por el cliente.<br>', '45 días', '1', 15860984, 'Portafolio Personal', '0'),
