(423, 120, '23 de abril de 2008', 0, 'direccion fisica', 'Impresos', 2040.000, 9, 183.600, '* El tiempo de entrega es de 10-15 días hábiles aproximadamente.<br>\r\n* El contenido e imágenes para el diseño será suministrado por el cliente.<br>\r\n* Los precios pueden ser sometidos a variación de costo, a razón de verse involucrados materiales importados para la ejecución de este trabajo. Precios válidos por 15 días.', 'A convenir con el cliente', '4', 15860984, 'Dipticos', '0'),
(424, 72, '10 de abril de 2008', 28, 'direccion fisica', 'Diseño Gráfico', 3000.000, 9, 270.000, '* El <strong>tiempo de entrega</strong>, será definido por el cliente y el mismo debe ser comunicado al diseñador con antelación de forma que pueda convenirse un calendario de trabajo entre la fundación y el diseñador<br>\r\n* Serán presentados hasta <strong>3 bocetos, sobre 1 pieza escogida a desarrollar</strong>, para definir la imagen sobre la que estarán basados el resto de los señalados en el presupuesto.<br>\r\n* Se contemplan el manejo de correcciones sobre el boceto seleccionado. Una vez definida la imagen, se desarrollaran el total de las piezas.<br>', 'A convenir con el cliente', '3', 15860984, '3er Salón Nacional', '0'),
