(431, 127, '28 de abril de 2008', 0, 'direccion fisica', 'Mantenimiento', 250.000, 9, 22.500, '* El pago por mantenimiento se realizará mensualmente a partir de 30 días de la fecha de cancelación del monto total por el proyecto.<br>\r\n* El costo por mantenimiento es estimado en función de lo que Besign anticipa como frecuencia de cambios y modificaciones. Este precio puede variar previo acuerdo y notificación.<br>\r\n* La condición de pago por mantenimiento se mantiene incluso durante los meses sin solicitud de actualización, ya que el mismo es una tarifa de derecho a servicio.', 'Mensualmente', '5', 15860984, 'Mario Spinali', '0'),
(432, 127, '28 de abril de 2008', 0, 'direccion fisica', 'Proyecto Web', 2085.000, 9, 187.650, 'El Website estará programado con tecnología HTML+FLASH que permitirá integrar animaciones, fotos y texto, creando un diseño amigable e interactivo. <br>\r\nEl desarrollo del Sitio Web esta planteado bajo un Plan Básico, sin dejar de tener una excelente apariencia y presentación<br>\r\n* El costo por mantenimiento es cancelado mensualmente y puede ser modificado en función a la complejidad de los cambios solicitados por el cliente. Permite la publicación de noticias y eventos ocasionales. Es opcional, si el cliente lo considera innecesario; si se requieren modificaciones sobre la pagina eventualmente, se pueden cotizar tarifas unicas por cambios.<br>', '45 días', '1', 15860984, 'Traffic Entertainment', '0'),
(433, 101, '28 de abril de 2008', 0, 'direccion fisica', 'Proyecto Web', 2930.000, 9, 263.700, 'El Website estará programado con tecnología HTML+FLASH+PHP que permitirá integrar animaciones, fotos y texto, creando un diseño amigable e interactivo. \r\nLas animaciones estarán probablemente presentes en Cabecera, Botones e Imágenes para lograr un site más agradable y captar mas atención y empatía con los usuarios.<br>\r\n* El Catálogo de Productos, se incluirá en una segunda fase de desarrollo del Proyecto Web, y deberá ser cotizado en su momento, aparte.<br>\r\n* Este presupuesto ya refleja un descuento aplicado por<strong>Besign, C.A.</strong> del 15% sobre el monto de Diseño y Desarrollo del contratado.<br>\r\n* El tiempo de entrega aproximado es de 45-60 días', '45 días', '1', 15860984, 'Sin Catalogo POP (sin dominio: ya pago)', '0'),
