(435, 101, '09 de mayo de 2008', 0, 'direccion fisica', 'Proyecto Web', 2300.000, 9, 207.000, 'El Website estará programado con tecnología HTML+FLASH+PHP que permitirá integrar animaciones, fotos y texto, creando un diseño amigable e interactivo. Será reaizado con un sistema de administracion que permitirá máximo control por parte del cliente en cuanto a la actualizacion del contenido de la pagina. Incluirá cabeceras y botoneras animadas. El sitio será concebido como sencillo, sin perder en mente la cualidad de la calidad<br>\r\n* El tiempo de entrega aproximado es de 45 días<br>\r\n* El Proyecto contará con herramientas administrativas para la publicación de fotos, videos, notas de prensa, presentaciones<br>', '45 días', '3', 15860984, 'Wasabi.com.ve', '0'),
