(453, 88, '09 de julio de 2008', 0, 'direccion fisica', 'Proyecto Web', 7065.000, 9, 635.850, '* El <strong>Website</strong> estará programado con tecnología FLASH+XML+PHP que permitirá integrar animaciones, fotos y texto, creando un diseño interactivo y altamente dinámico.\r\n<br>\r\nLas animaciones estarán basadas en ejemplos de sitios de alta categoria como <strong>www.diesel.com, www.adidas.com/women</strong> para lograr un site impactante y con tecnologia de punta, digno de referencias internacionales a fin de captar la atención y empatía de los usuarios. El diseño y concepto tendrá como premisa la tendencia que identifica a la marca.<br>\r\n* El sitio contará con un <strong>Catalogo de productos</strong> con opción a compra en linea para usuarios registrados, simple y navegable desde cualquier máquina o velocidad.<br><br>\r\n* El Cliente contará con la activación de un Modulo de Venta para articulos, el cual será tramitado a través de acciones entre el Cliente, Banco Mercantil y Besign.\r\nEl catalogo en linea, estará destinado a revendedores y mayoristas, que deberan registrarse en la pagina para navegar el contenido y obtener la lista de precios asi como realizar sus compras. La pagina manejará una base de datos de clientes para este fin.<br>\r\n\r\n* El tiempo de desarrollo es de 30 a 45 días aproximadamente a partir de la cancelacion de la primera cuota y de la recepcion del material de contenido.<br>\r\n\r\n* Besign, C.A. no se responsabiliza por demoras en el proceso de activacion del sistema de pago electronico causadas por el proceso de gestión del Banco o el Cliente, que puedan interferir con el cumplimiento de los tiempos aqui estipulados.\r\n\r\n<br><br>\r\n* El <strong>Plan de Mantenimiento</strong> comprende la inclusión en el catálogo de la página hasta 10 prendas por mes. En caso de requerir más piezas o de requerir actualizaciones más completas para el catálogo, debe ser solicitada la estimación de un nuevo presupuesto.\r\n<br>\r\n* La selección del <strong>Plan de Financiamiento</strong> para la cancelación del Proyecto, es negociable<br>\r\n* El <strong>Tiempo de Entrega</strong> podrá aumentar o disminuir en función de la extensión del catálogo', '45 días', '1', 15860984, 'Andartu', '0'),
