(471, 149, '24 de septiembre de 2008', 0, 'direccion fisica', 'Proyecto Web', 5605.000, 9, 504.450, '* El <strong>Website</strong> estará programado con tecnología FLASH+XML+PHP que permitirá integrar animaciones, fotos y texto, creando un diseño interactivo y altamente dinámico. Las animaciones estarán probablemente presentes en Cabecera, Botones e Imágenes para lograr un site más agradable y captar mas atención y empatía con los usuarios.\r\n<br>\r\nEl diseño y concepto tendrá como premisa la tendencia que identifica a la marca.<br>\r\n* El sitio contará con un <strong>Catalogo de productos</strong> con opción a compra en linea para usuarios registrados, simple y navegable desde cualquier máquina o velocidad.<br><br>\r\n* El Cliente contará con la activación de un Modulo de Venta para articulos, el cual será tramitado a través de acciones entre el Cliente, Banco de su preferencia y Besign.\r\nEl catalogo en linea, estará destinado a revendedores y mayoristas, que deberan registrarse en la pagina para navegar el contenido y obtener la lista de precios asi como realizar sus compras. La pagina manejará una base de datos de clientes para este fin.<br>\r\n* Besign, C.A. tomará fotografias para el desarrollo del catalogo en linea y del diseño de la pagina, de hasta 50 productos.<br>\r\n* El tiempo de desarrollo es de 45 a 60 días aproximadamente a partir de la cancelacion de la primera cuota y de la recepcion del material de contenido.<br>\r\n\r\n* Besign, C.A. no se responsabiliza por demoras en el proceso de activacion del sistema de pago electronico causadas por el proceso de gestión del Banco o el Cliente, que puedan interferir con el cumplimiento de los tiempos aqui estipulados.\r\n\r\n<br><br>\r\n* El <strong>Plan de Mantenimiento</strong> comprende la inclusión en el catálogo de la página hasta 20 productos por mes. En caso de requerir más piezas o de requerir actualizaciones más completas para el catálogo, debe ser solicitada la estimación de un nuevo presupuesto.\r\n<br>\r\n* La selección del <strong>Plan de Financiamiento</strong> para la cancelación del Proyecto, es negociable<br>\r\n* El <strong>Tiempo de Entrega</strong> podrá aumentar o disminuir en función de la extensión inicial del catálogo', '45 días', '1', 15860984, 'Catalogo', '0'),
(472, 149, '26 de septiembre de 2008', 0, 'direccion fisica', 'Cd Multimedia', 1940.000, 9, 174.600, '* El costo por desarrollo de CD Corporativo podría variar en función del contenido a incluir en el mismo.<br>\r\n* Besign, C.A. tomará fotografias para el desarrollo del catalogo en linea y del diseño de la pagina, de hasta 50 productos.', '30 días', '3', 15860984, 'Presentacion Mini Cds', '0'),
(473, 148, '08 de octubre de 2008', 0, 'direccion fisica', 'Impresos', 10240.000, 9, 921.600, '* El tiempo de entrega aproximado para los Folletos  es de 10-12 días hábiles después de aprobado el diseño y cancelada la primera cuota de pago.<br>\r\n* El tiempo de entrega aproximado para los Dipticos es de 5-7 días hábiles después de aprobado el diseño y cancelada la primera cuota de pago.<br>\r\n* El contenido para el material impreso será suministrado por el cliente.<br>\r\n* El cliente deberá aprobar por escrito los artes y diseño finales para autorizar su reproducción.<br>\r\n* Emitir pago a nombre de BESIGN, C.A. ó realizar depósitos en Banco Mercantil, Cta Corriente, 0105-0730-89-173001130 a nombre de BESIGN, C.A.', 'A convenir con el cliente', '3', 15860984, 'Material vario LOCTI', '0'),
