(479, 152, '16 de diciembre de 2008', 43, 'direccion fisica', 'Diseño Gráfico', 5380.000, 9, 484.200, '* EL presente presupuesto deberá ser aprobado por escrito.<br>\r\n* Para el Logotipo Se presentarán tres (3) bocetos con manejo de colores y tipografía diferentes.<br>\r\n* Se establece una tarifa de Bs 15,oo por modificaciones adicionales sobre la propuesta de logotipo seleccionada se totaliza una vez finalizado el proceso de diseño y cambios. El total final variará en función a la cantidad de cambios solicitados por el cliente. <br>\r\n* Para todos los diseños se incluirá la entrega de un CD conteniendo las bases necesarias para reproducción e impresión del material desarrollado.<br>\r\n* El diseño para el Website, solo contempla el diseño gráfico del mismo, siendo un propuesta estática que servirá de guia al programador encargado del desarrollo final del site.<br>\r\n* El cliente deberá suministrar el material de apoyo digital e impreso necesario para el desarrollo de todos los diseños. \r\n', 'A convenir con el cliente', '3', 15860984, 'Proyecto Río Pao y Unare', '0'),
