(481, 152, '08 de enero de 2009', 43, 'direccion fisica', 'Diseño Gráfico', 3060.000, 9, 275.400, '* EL presente presupuesto deberá ser aprobado por escrito.<br>\r\n* Para el Logotipo Se presentarán dos (2) bocetos con manejo de colores y tipografía diferentes.<br>\r\n* Se establece una tarifa de Bs 10,oo por modificaciones adicionales sobre la propuesta de logotipo seleccionada se totaliza una vez finalizado el proceso de diseño y cambios. El total final variará en función a la cantidad de cambios solicitados por el cliente. <br>\r\n* Para todos los diseños se incluirá la entrega de un CD conteniendo las bases necesarias para reproducción e impresión del material desarrollado.<br>\r\n* La adaptacion de diseño consistirá en una variaciones a partir de un unico diseño aprobado base, a modo de traducirlo en las diversas aplicaciones indicadas en el presupuesto, segun las medidas y formatos correspondientes<br>\r\n* El diseño para el Website, solo contempla el diseño gráfico del mismo, siendo un propuesta estática que servirá de guia al programador encargado del desarrollo final del site. Serán entregados los originales digitales para edicion o creacion posterior sobre el mismo proyecto por el programador o terceros<br>\r\n* El cliente deberá suministrar el material de apoyo digital e impreso necesario para el desarrollo de todos los diseños. \r\n', 'A convenir con el cliente', '3', 15860984, 'Proyecto Río Pao y Unare Ajustado', '0'),
