(486, 155, '29 de enero de 2009', 0, 'direccion fisica', 'Proyecto Web', 2400.000, 9, 216.000, 'El Website estará programado con tecnología HTML+FLASH+PHP que permitirá integrar animaciones, fotos y texto, creando un diseño amigable e dinámico.<br>\r\nLas animaciones estarán probablemente presentes en Cabecera, Botones e Imágenes para lograr un site más agradable y captar mas atención y empatía con los usuarios.<br><br>\r\n\r\n* El <strong>tiempo de desarrollo</strong> es de 30-45 días aproximadamente a partir de la cancelacion de la primera cuota y de la recepcion del material de contenido.<br>\r\n* Se incluirá un espacio Blog externo al diseño de la página, sin dejar de mantener relacion grafica y visual con el site principal. Este espacio se destinará para la publicación de textos ocasionales. El cliente podrá enviar el texto y se incluirá en el blog como parte del servicio de mantenimiento.\r\n* El cliente ya posee dominio y hosting para su pagina web. Suministrará las claves ftp necesarias para la publicacion del sitio.', '45 días', '3', 15860984, 'Site Personal Locutor', '0'),
(487, 156, '03 de febrero de 2009', 0, 'direccion fisica', 'Cd Multimedia', 3300.000, 9, 297.000, '* Emitir pago a nombre de BESIGN, C.A. ó realizar depósitos en Banco Mercantil, Cta Corriente, 0105-0730-89-1730011306 a nombre de BESIGN, C.A.<br>\r\n* Calidad 200Dpi (Dots Per Inch) optima para la aplicacion planteada.<br>\r\n* Los textos contenidos en el material digitalizado, no podran ser seleccionables.<br>\r\n* Besign C.A. garantiza la no divulgacion y confidencialidad sobre el material procesado.<br>\r\n* Besign C.A. no se hace responsable por perjuicios ocasionados por la reproduccion del material.<br>', '10 días', '3', 15860984, 'Digitalizacion Manuales Monaca', '0'),
(488, 133, '05 de febrero de 2009', 0, 'direccion fisica', 'Proyecto Web', 4035.000, 9, 363.150, 'El Website estará programado con tecnología HTML+FLASH+PHP que permitirá integrar animaciones, fotos y texto, creando un diseño amigable e interactivo. \r\nLas animaciones estarán presentes en Cabecera, Botones e Imágenes para lograr un site más agradable y captar mas atención y empatía con los usuarios. A su vez, serán reflejo de mayor tecnología, al mostrar un meticuloso y sobrio diseño conjugado con animaciones de alto impacto.\r\n<br>\r\n* Se suministrará un usuario para un detallado <strong>sistema de estadisticas</strong> de las visitas a la pagina, donde se almacena informacion como ciudad de visita, paginas que referencian la visita y tiempo de visita.<br>\r\n* La <strong>Base de datos</strong> estará a disposición del cliente siempre que lo solicite, y será de unico y exclusivo conocimiento del cliente. No será aprovechada por Besign, C.A. para fines distintos a los relacionados con el Cliente.<br>\r\n* El <br>mantenimiento<br> incluirá la inserción en la pagina de videos, mp3, fotos y envío de boletín de noticias a los usuarios en la base de datos. El pago por mantenimiento se realizará mensualmente a partir de 30 días de la fecha de cancelación del monto total por el proyecto.<br>\r\n* La condición de pago por mantenimiento se mantiene incluso durante los meses sin solicitud de actualización, ya que el mismo es una tarifa de derecho a servicio.', '45 días', '3', 15860984, 'SGRUPO', '0'),
(489, 155, '09 de febrero de 2009', 0, 'direccion fisica', 'Proyecto Web', 2018.350, 9, 181.651, 'El Website estará programado con tecnología HTML+FLASH+PHP que permitirá integrar animaciones, fotos y texto, creando un diseño amigable e dinámico.<br>\r\nLas animaciones estarán probablemente presentes en Cabecera, Botones e Imágenes para lograr un site más agradable y captar mas atención y empatía con los usuarios.<br><br>\r\n\r\n* El <strong>tiempo de desarrollo</strong> es de 30-45 días aproximadamente a partir de la cancelacion de la primera cuota y de la recepcion del material de contenido.<br>\r\n* El cliente ya posee dominio y hosting para su pagina web. Suministrará las claves ftp necesarias para la publicacion del sitio.', '45 días', '3', 15860984, 'Site Personal Locutor', '0'),
