(553, 18, '11 de agosto de 2009', 0, 'direccion fisica', 'Diseño Gráfico', 2727.850, 12, 327.342, '<p>* La tarifa por modificaciones sobre dise&ntilde;o seleccionado se totaliza una vez finalizado el proceso de dise&ntilde;o y cambios. El total final variar&aacute; en funci&oacute;n a la cantidad de cambios solicitados por el cliente.<br /> * Emitir pago a nombre de BESIGN, C.A. &oacute; realizar dep&oacute;sitos en Banco Mercantil, Cta Corriente, 0105-0730-89-1730011306 a nombre de BESIGN, C.A.</p>', 'A convenir con el cliente', '3', 15860984, 'Logo, Triptico y Web', '0'),
(554, 182, '03 de agosto de 2009', 0, 'direccion fisica', 'Proyecto Web', 5135.000, 12, 616.200, 'El Website estará programado con tecnología HTML+FLASH+PHP que permitirá integrar animaciones, fotos y texto, creando un diseño amigable e interactivo. \r\nLas animaciones estarán presentes en Cabecera, Botones e Imágenes para lograr un site más agradable y captar mas atención y empatía con los usuarios. A su vez, serán reflejo de mayor tecnología, al mostrar un meticuloso y sobrio diseño conjugado con animaciones de alto impacto.\r\n<br>\r\n* Se suministrará un usuario para un detallado <strong>sistema de estadisticas</strong> de las visitas a la pagina, donde se almacena informacion como ciudad de visita, paginas que referencian la visita y tiempo de visita.<br>\r\n* La <strong>Base de datos</strong> estará a disposición del cliente siempre que lo solicite, y será de unico y exclusivo conocimiento del cliente. No será aprovechada por Besign, C.A. para fines distintos a los relacionados con el Cliente.<br>\r\n* El <strong>mantenimiento</strong> incluirá la inserción en la pagina de videos, mp3, fotos y envío de boletín de noticias a los usuarios en la base de datos. El pago por mantenimiento se realizará mensualmente a partir de 30 días de la fecha de cancelación del monto total por el proyecto.<br>\r\n* La condición de pago por mantenimiento se mantiene incluso durante los meses sin solicitud de actualización, ya que el mismo es una tarifa de derecho a servicio.', '45 días', '3', 15860984, 'Primo de Carlos Mochuelo', '488'),
(555, 180, '03 de agosto de 2009', 0, 'direccion fisica', 'Proyecto Web', 7735.000, 12, 928.200, 'El Website estará programado con tecnología XML+FLASH+PHP que permitirá integrar animaciones, fotos y texto, creando un diseño amigable e interactivo. <br>\r\nLas animaciones estarán presentes en Cabecera, Botones e Imágenes para lograr un site más agradable y captar mas atención y empatía con los usuarios, al mostrar un diseño conjugado con animaciones de alto impacto.<br> Se propone un Test con sistema de encuesta, que pretende presentar un cuestionario breve de conocimientos basicos-medios-avanzados sobre el mundo de la cocina, de modo que el aspirante pueda entusiasmarse con el resultado; el mismo mostrara su estado de buenas y malas respuestas a traves de un simil con una olla o similar, donde se "prepare" un platillo, el cual sera exitoso o no en funcion al grado de las respuestas.<br>\r\nLa grafica y estética se realizarán manteniendo como guía el material pdf suministrado por el cliente (brochure internacional).\r\n<br>\r\n* En este presupuesto se presentan costos separados del plan mantenimiento y del administrador "miweb". La contratacion de uno de estos servicios sustituye al otro<br>\r\n * Se suministrará un usuario para un detallado sistema de estadisticas de las visitas a la pagina, donde se almacena informacion como ciudad de visita, paginas que referencian la visita y tiempo de visita.<br>\r\n* La condición de pago por mantenimiento se mantiene incluso durante los meses sin solicitud de actualización, ya que el mismo es una tarifa de derecho a servicio.<br>\r\n* El costo del panel de administracion para el Cliente, "miweb", puede variar en función a las áreas sobre las que el Cliente desee actualizar a su discreción.', '45 días', '1', 15860984, 'Web ICC', '537'),
