(561, 107, '19 de agosto de 2009', 0, 'direccion fisica', 'Señalética', 4390.000, 12, 526.800, '<p>* Emitir pago a nombre de BESIGN, C.A. &oacute; realizar dep&oacute;sitos en Banco Mercantil, Cta Corriente, 0105-0730-89-1730011306 a nombre de BESIGN, C.A.</p>\r\n<p>* Los costos por el rotulado de vinyl son aproximadados. Pueden aumentar o disminuir segun el dise&ntilde;o. Este costo debe ser recotizado una vez que el arte sea desarrollado.</p>', '7 días', '3', 15860984, 'Pared + Pendones + Tarjetas', '0'),
