(563, 185, '24 de agosto de 2009', 0, 'direccion fisica', 'Proyecto Web', 10200.000, 12, 1224.000, '<p>El Website estar&aacute; programado con tecnolog&iacute;a HTML+PHP+FLASH+XML que permitir&aacute; integrar animaciones, fotos y texto, creando un dise&ntilde;o amigable e interactivo.</p>\r\n<p>Las animaciones estar&aacute;n presentes en Cabecera, Botones e Im&aacute;genes para lograr un site m&aacute;s agradable y captar mas atenci&oacute;n y empat&iacute;a con los usuarios. A su vez, ser&aacute; para la empresa reflejo de mayor tecnolog&iacute;a, al mostrar un meticuloso y sobrio dise&ntilde;o.</p>\r\n<p>La premisa a mantener en el look&amp;feel del site es: innovaci&oacute;n, modernidad, alta tecnolog&iacute;a, seriedad y responsabilidad.</p>\r\n<p>* Este presupuesto contempla un maximo de <strong>15 lineas </strong>de productos por unidad de negocio. Si el cliente requiere modificar esta cantidad, el presupuesto podr&aacute; ser ajustado, previo acuerdo entre las partes.<br />Las l&iacute;neas ser&aacute;n publicadas como grupos, con fotografias y descripcion general, adicionandosele las especificaciones tecnicas a trav&eacute;s de links al site del fabricante.</p>\r\n<p>* El usuario contara con un panel de administracion <strong>"mi web"</strong>, desde el cual con usuario y clave tendra potestad de actualizacion y publicacion de informacion en la secci&oacute;n de noticias, para contenido de texto, imagenes y documentos.</p>\r\n<p>* Se suministrar&aacute; un usuario para un detallado <strong>sistema de estadisticas</strong> de las visitas a la pagina, donde se almacena informacion como ciudad de visita, paginas que referencian la visita y tiempo de visita.</p>\r\n<p>* La condici&oacute;n de pago por <strong>mantenimiento</strong> se mantiene incluso durante los meses sin solicitud de actualizaci&oacute;n, ya que el mismo es una tarifa de derecho a servicio.</p>\r\n<p>* La plataforma del website contemplar&aacute; la incorporaci&oacute;n a futuro del funcionamiento e-commerce (catalogo de productos con solicitud de pedido online), cuando el cliente requiera y cotize dicha funcionalidad.</p>\r\n<p>* El tiempo de entrega es de 45 a 60 d&iacute;as aproximadamente, previa aprobaci&oacute;n del dise&ntilde;o gr&aacute;fico y consignaci&oacute;n del material de contenido.</p>\r\n<p>* Emitir pago a nombre de BESIGN, C.A. &oacute; realizar dep&oacute;sitos en Banco Mercantil, Cta Corriente, 0105-0730-89-1730011306 a nombre de BESIGN, C.A.</p>', '60 días', '1', 15860984, '15 productos x Area', '0');
