1306 a nombre de BESIGN, C.A.</p>\r\n<p>* La activaci&oacute;n del Modulo Bot&oacute;n de Pago ser&aacute; tramitado a trav&eacute;s de acciones entre el Cliente, Banco seleccionado por el Cliente y Besign.</p>\r\n<p><br />* Besign, C.A. no se responsabiliza por demoras en el proceso de activaci&oacute;n del sistema de pago electronico causadas por el proceso de gesti&oacute;n del Banco o el Cliente, que puedan interferir con el cumplimiento de los tiempos aqui estipulados.</p>\r\n<p>* El Tiempo de entrega es de 90 d&iacute;as aproximadamente, previa aprobaci&oacute;n del dise&ntilde;o gr&aacute;fico y consignaci&oacute;n del material de contenido. La estimaci&oacute;n de tiempos de culminaci&oacute;n se modificar&aacute; igualmente en funci&oacute;n a los M&oacute;dulos seleccionados para desarrollar, este punto igualmente afectar&aacute; los costos presentados en este presupuesto. Los tiempos y el costos podr&aacute;n aumentar o disminuir en funci&oacute;n de la extensi&oacute;n de las otras aplicaciones.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</p>', '60 días', '1', 15869947, 'Web Deportes Markano', '0'),
(613, 209, '06 de mayo de 2010', 0, 'direccion fisica', 'Proyecto Web', 8258.000, 12, 990.960, '<p><span style="\\">\r\n<div>\r\n<ul>\r\n<li><span style="font-family: Tahoma; font-size: 11px; line-height: 17px;">El Mantenimiento de las redes Sociales abarca: aceptar amigos, envio de mensajes de bienvenida, publicacion de contenido de noticias, fotos y material audiovisual. Los mensajes directos seran controlados exclusivamente por integrantes de la banda</span></li>\r\n<li><span style="font-family: Tahoma; font-size: 11px; line-height: 17px;">Emitir pago a nombre de BESIGN, C.A. &oacute; realizar dep&oacute;sitos en Banco Mercantil, Cta Corriente, 0105-0730-89-1730011306 a nombre de BESIGN, C.A.<br /></span></li>\r\n</ul>\r\n</div>\r\n</span></p>', 'A convenir con el cliente', '1', 15860984, 'con mantenimiento de Redes Sociales', '610'),
