(735, 266, '26 de junio de 2013', 0, 'direccion fisica', 'Mantenimiento', 9660.710, 12, 1159.285, '<p>\r\n<ul>\r\n<li>Una vez contratado el Plan de Mantenimiento, el cobro por concepto del mismo se aplica indistintamente del uso o frecuencia. Besign, C.A. puede modificar las tarifas, si considera que el m&aacute;ximo de productos en el plan de mantenimiento no coincide con el uso real que el cliente da al plan. Dicho cambio de tarifa ser&aacute; previamente comunicado al cliente.</li>\r\n<li>El cliente debe suministrar la informaci&oacute;n de im&aacute;genes y textos pertienentes para la publicaci&oacute;n del material.&nbsp;</li>\r\n<li>Si la cantidad de productos planteada en este mantenimiento es muy alta o muy baja respecto a las exxpectativas del cliente, por favor solic&iacute;te un ajuste de Plan para una nueva propuesta de tarifa.</li>\r\n<li>Emitir pago a nombre de BESIGN, C.A. &oacute; realizar dep&oacute;sitos en Banco Mercantil, Cta Corriente, 0105-0730-89-1730011306 a nombre de BESIGN, C.A.</li>\r\n</ul>\r\n</p>', 'A convenir con el cliente', '4', 158699474, 'Mantenimiento 200 productos', '0'),
