(738, 264, '03 de julio de 2012', 0, 'direccion fisica', 'Proyecto Web', 14883.930, 12, 1786.072, '<p>El Website estar&aacute; programado con tecnolog&iacute;a HTML+FLASH+XML que permitir&aacute; integrar animaciones, fotos y texto, creando un dise&ntilde;o amigable e interactivo.  Las animaciones estar&aacute;n presentes en Cabecera, Botones e Im&aacute;genes para lograr un site m&aacute;s agradable y captar mas atenci&oacute;n y empat&iacute;a con los usuarios. A su vez, ser&aacute; para la empresa reflejo de mayor tecnolog&iacute;a, al mostrar un meticuloso y sobrio dise&ntilde;o.</p>\n<p>*El cliente debera realizar las gestiones pertinenetes a la inclusion del boton de pago en la tienda electronica (carrito de compras) BESIGN, C.A. se limita a su instalacion en la seccion correspondiente.<br /> * Emitir pago a nombre de BESIGN, C.A. &oacute; realizar dep&oacute;sitos en Banco Mercantil, Cta Corriente, 0105-0730-89-1730011306 a nombre de BESIGN, C.A.</p>', 'A convenir con el cliente', '3', 158699474, 'WEB Tienda Virtual', '0'),
(739, 0, '08 de julio de 2012', 0, 'direccion fisica', 'Proyecto Web', 38500.000, 12, 4620.000, '<ul>\r\n<li>El cliente suministrar&aacute; toda la informaci&oacute;n de contenido necesaria para el Website.</li>\r\n<li>Los tiempos de entrega pueden variar en funci&oacute;n a la complejidad de los desarrollos.</li>\r\n<li>Todas las pautas de <strong>Dise&ntilde;o gr&aacute;fico</strong>, elementos y archivos relativos ser&aacute;n suministradas por el Cliente para la programaci&oacute;n y desarrollo del Sitio Web. Las mismas ser&aacute;n sensibles a ser modificadas o interpretadas por Besign, seg&uacute;n las consideremos pertinentes para la Web en terminos de optimizaci&oacute;n y navegablidad.</li>\r\n<li>En este presupuesto no se incluyen aspectos relacionados al <strong>servidor y dominio</strong>, ya que el Cliente cuenta con los mismos. Las claves y niveles de acceso necesarias para la programaci&oacute;n y configuraci&oacute;n ser&aacute;n suministradas a Besign por el Cliente.</li>\r\n<li>Las <strong>modificaciones</strong> adicionales sobre cualquier aspecto del proyecto ser&aacute;n contabilizadas y totalizadas al final de cada mes durante el desarrollo total del proyecto. Tienen un valor adicional de Bs 200,oo + IVA por modificaci&oacute;n. </li>\r\n<li>Modulos adicionales o cambios estructurales deber&aacute;n ser cotizados aparte. Igualmente ser&aacute; notificado al Cliente cuando Besign considere que el Cliente ha solicitado un cambio de este tipo.</li>\r\n<li>El material did&aacute;ctivo/informativo en la secci&oacute;n <strong>Producci&oacute;n</strong> ser&aacute; publicado en la p&aacute;gina como est&aacute;ticos (imagen) con transiciones simples entre cada una.</li>\r\n<li>El <strong>M&oacute;dulo B </strong>contendr&aacute; la plataforma y estructura de los contenidos, pero los mismos ser&aacute;n alimentados por el Cliente. Si el Cliente desea delegar la publicaci&oacute;n de esta informaci&oacute;n puede solicitar a Besign la cotizaci&oacute;n de un Plan de Mantenimiento.</li>\r\n<li>Los juegos a incluir en el <strong>Modulo C </strong>son aplicaciones gen&eacute;ricas que se adaptar&aacute;n al tema y Cliente, en la medida de lo posible.</li>\r\n<li>Es pol&iacute;tica de Besign, C.A. no entregar Archivos Base de  desarollo de ning&uacute;n tipo. La informaci&oacute;n que puede ser entregada al Cliente final es aquella contenida en el servidor (incluyendo Base de Datos), en cualquier momento que &eacute;ste la solicite.</li>\r\n<li>Emitir pago a nombre de BESIGN, C.A. &oacute; realizar dep&oacute;sitos en Banco  Mercantil, Cta Corriente, 0105-0730-89-1730011306 a nombre de BESIGN,  C.A.</li>\r\n</ul>', 'A convenir con el cliente', '4', 158699474, 'Web Pulp.com y pulpin.com', '732'),
(740, 265, '16 de julio de 2012', 0, 'direccion fisica', 'Audiovisual', 7589.286, 12, 910.714, '<ul>\r\n<li><span style="\\">Esta pieza no incluye locuci&oacute;n.</span></li>\r\n<li>La entrega incluye DVD para reproducci&oacute;n en TV del audiovisual.</li>\r\n<li>Se establece una tarifa de<strong> Bs 150,oo + IVA</strong> por  modificaciones adicionales sobre la propuesta seleccionada, se totaliza  una vez finalizado el proceso de dise&ntilde;o y cambios. El total final  variar&aacute; en funci&oacute;n a la cantidad de cambios solicitados por el cliente. </li>\r\n<li>Las grabaciones en Estudio no est&aacute;n contempladas en este presupuesto.</li>\r\n<li>El presente presupuesto est&aacute; sujeto a cambio, hasta la aprobaci&oacute;n del mismo, con orden de compra y adelanto seg&uacute;n el plan de pago.</li>\r\n<li>Los costos pueden variar en funci&oacute;n a modificaciones conceptuales que el cliente desee realizar en la fase de Gui&oacute;n y Storyboard.</li>\r\n<li>Las copias adicionales de este material tendr&aacute;n un valor de Bs. 40 c/u.</li>\r\n<li>Emitir pago a nombre de BESIGN, C.A. &oacute; realizar dep&oacute;sitos en Banco Mercantil, Cta Corriente, 0105-0730-89-1730011306 a nombre de BESIGN, C.A.</li>\r\n</ul>\r\n<p>&nbsp;</p>', 'A convenir con el cliente', '3', 158609840, 'Presentacion Medueleelpie', '0'),
