(801, 244, '02 de mayo de 2013', 0, 'direccion fisica', 'Proyecto Web', 118500.000, 12, 14220.000, '<ul style="\\">\r\n<li>Este presupuesto tiene una valid&eacute;z de 10 d&iacute;as.</li>\r\n<li>La ejecuci&oacute;n de los modulos en este presupuesto, pueden solicitarse y pagarse por separado. En cuyo caso, deber&aacute; solicitarse a Besign un presupuesto actualizado a la fecha de solicitud de cada m&oacute;dulo.</li>\r\n<li>El cliente suministrar&aacute; toda la informaci&oacute;n de contenido necesaria para el Website.</li>\r\n<li>Los tiempos de entrega pueden variar en funci&oacute;n a la complejidad de los desarrollos.</li>\r\n<li>Todas las pautas de&nbsp;<strong>Dise&ntilde;o gr&aacute;fico</strong>, elementos y archivos relativos ser&aacute;n suministradas por Creatividad y Punto C.A.para la programaci&oacute;n y desarrollo del Sitio Web. Las mismas ser&aacute;n sensibles a ser modificadas o interpretadas por Besign, seg&uacute;n las consideremos pertinentes para la Web en terminos de optimizaci&oacute;n y navegablidad.</li>\r\n<li>Correcciones de dise&ntilde;o gr&aacute;fico y elementos adicionales o no estipulados en el brief inicial del proyecto, ser&aacute;n evaluadas para determinar si generan costos adicionales no contemplados en este presupuesto.</li>\r\n<li>En este presupuesto no se incluyen aspectos relacionados al&nbsp;<strong>servidor y dominio</strong>, ya que el Cliente cuenta con los mismos. Las claves y niveles de acceso necesarias para la programaci&oacute;n y configuraci&oacute;n ser&aacute;n suministradas a Besign por el Cliente.</li>\r\n<li>Modulos adicionales o cambios estructurales deber&aacute;n ser cotizados aparte. Igualmente ser&aacute; notificado al Cliente cuando Besign considere que el Cliente ha solicitado un cambio de este tipo.</li>\r\n<li>Los modulos que requieran actualizaciones periodicas de contenidos ser&aacute;n alimentados por el Cliente con herramientas dispuestas para ello por Besign. Si el Cliente desea delegar la publicaci&oacute;n de esta informaci&oacute;n puede solicitar a Besign la cotizaci&oacute;n de un Plan de Mantenimiento.</li>\r\n<li>Es pol&iacute;tica de Besign, C.A. no entregar Archivos Base de desarollo de ning&uacute;n tipo. La informaci&oacute;n que puede ser entregada al Cliente final es aquella contenida en el servidor (incluyendo Base de Datos), en cualquier momento que &eacute;ste la solicite.</li>\r\n<li>Emitir pago a nombre de BESIGN, C.A. &oacute; realizar dep&oacute;sitos en Banco Mercantil, Cta Corriente, 0105-0730-89-1730011306 a nombre de BESIGN, C.A.</li>\r\n</ul>', 'A convenir con el cliente', '3', 158609840, 'Proyecto Web Edil', '0'),
