(844, 271, '14 de octubre de 2013', 0, 'direccion fisica', 'Proyecto Web', 53000.000, 12, 6360.000, '<div>\r\n<table style="color: #000000; font-family: Tahoma, Verdana, Arial, Helvetica, sans-serif; font-size: 11px; line-height: 17px;" border="0" cellspacing="0" cellpadding="0" width="620" align="center">\r\n<tbody>\r\n<tr>\r\n<td align="left">\r\n<p>El Website estar&aacute; programado con tecnolog&iacute;a que permitir&aacute; integrar animaciones, fotos y texto, creando un dise&ntilde;o amigable e interactivo. Las animaciones estar&aacute;n presentes en Cabecera, Botones e Im&aacute;genes para lograr un site m&aacute;s agradable y captar mas atenci&oacute;n y empat&iacute;a con los usuarios. A su vez, ser&aacute; para la empresa reflejo de mayor tecnolog&iacute;a, al mostrar un meticuloso y sobrio dise&ntilde;o.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<ul>\r\n<li style="\\">La seccion "Home" contendr&aacute; un Video Animado.</li>\r\n<li style="\\">Las fotografias, videos y textos a utilizar para el proyecto seran suministradas por el cliente.</li>\r\n<li style="\\">Las Animaciones y/o levantamientos 3D podr&iacute;an ser cotizados aparte en funci&oacute;n a su mayor o menor complejidad.</li>\r\n<li style="\\">Este presupuesto contempla hasta un m&aacute;ximo de&nbsp;15 productos con hasta 3 fotograf&iacute;as cada uno. Adicionales a los estipulado, deber&aacute;n ser cotizados adicionalmente.</li>\r\n<li style="\\">Los costos en el presente presupuesto pueden variar en funci&oacute;n a la mayor o menor complejidad de los desarrollos.&nbsp;</li>\r\n<li style="\\">Emitir pago a nombre de BESIGN, C.A. &oacute; realizar dep&oacute;sitos en Banco Mercantil, Cta Corriente, 0105-0730-89-1730011306 a nombre de BESIGN, C.A.</li>\r\n</ul>', 'A convenir con el cliente', '3', 158609840, 'Proyecto Web SuperVision', '830'),
(845, 187, '03 de octubre de 2013', 0, 'direccion fisica', 'Impresos', 7950.000, 12, 954.000, '<ul>\r\n<li style="\\">Presupuesto esta sujeto a cambios en funci&oacute;n de la disponibilidad del material de impresi&oacute;n, previa notificaci&oacute;n al cliente.</li>\r\n<li style="\\">Emitir pago a nombre de BESIGN, C.A. &oacute; realizar dep&oacute;sitos en Banco Mercantil, Cta Corriente, 0105-0730-89-1730011306 a nombre de BESIGN, C.A.</li>\r\n</ul>', '7 días', '3', 158609840, 'Impresion de etiquetas ', '844'),
(846, 295, '14 de octubre de 2013', 52, 'direccion fisica', 'Proyecto Web', 88700.000, 12, 10644.000, '<ul style="\\">\r\n<li>Este presupuesto tiene una valid&eacute;z de 10 d&iacute;as.</li>\r\n<li><span style="font-family: Tahoma, Verdana, Arial, Helvetica, sans-serif; font-size: 11px; line-height: 17px;">Se establece un compromiso de publicaci&oacute;n de las secciones home y contacto, para el 8 de Diciembre 2013 o antes, en funci&oacute;n a su t&eacute;rmino y aprobaci&oacute;n. El resto de las secciones se ir&aacute;n habilitando en la medida que est&eacute;n funcionales y aprobadas para ser publicadas.</span></li>\r\n<li>La ejecuci&oacute;n de los modulos en este presupuesto, pueden solicitarse y pagarse por separado. En cuyo caso, deber&aacute; solicitarse a Besign un presupuesto actualizado a la fecha de solicitud de cada m&oacute;dulo.</li>\r\n<li>El cliente suministrar&aacute; toda la informaci&oacute;n de contenido necesaria para el Website.</li>\r\n<li>Los tiempos de entrega pueden variar en funci&oacute;n a la complejidad de los desarrollos.</li>\r\n<li>Correcciones de dise&ntilde;o gr&aacute;fico y elementos adicionales o no estipulados en el brief inicial del proyecto, ser&aacute;n evaluadas para determinar si generan costos adicionales no contemplados en este presupuesto.</li>\r\n<li>En este presupuesto no se incluyen aspectos relacionados al&nbsp;<strong>servidor y dominio</strong>, ya que el Cliente cuenta con los mismos. Las claves y niveles de acceso necesarias para la programaci&oacute;n y configuraci&oacute;n ser&aacute;n suministradas a Besign por el Cliente.</li>\r\n<li>Modulos adicionales o cambios estructurales deber&aacute;n ser cotizados aparte. Igualmente ser&aacute; notificado al Cliente cuando Besign considere que el Cliente ha solicitado un cambio de este tipo.</li>\r\n<li>Los modulos que requieran actualizaciones periodicas de contenidos ser&aacute;n alimentados por el Cliente con herramientas dispuestas para ello por Besign. Si el Cliente desea delegar la publicaci&oacute;n de esta informaci&oacute;n puede solicitar a Besign la cotizaci&oacute;n de un Plan de Mantenimiento.</li>\r\n<li>Es pol&iacute;tica de Besign, C.A. no entregar Archivos Base de desarollo de ning&uacute;n tipo. La informaci&oacute;n que puede ser entregada al Cliente final es aquella contenida en el servidor (incluyendo Base de Datos), en cualquier momento que &eacute;ste la solicite.</li>\r\n<li>Emitir pago a nombre de BESIGN, C.A. &oacute; realizar dep&oacute;sitos en Banco Mercantil, Cta Corriente, 0105-0730-89-1730011306 a nombre de BESIGN, C.A.</li>\r\n</ul>', 'A convenir con el cliente', '3', 158609840, 'Proyecto Alcaldia Bolivariana de Guacara', '0'),
