(904, 315, '02 de mayo de 2014', 0, 'direccion fisica', 'Diseño Gráfico', 24000.000, 12, 2880.000, '<ul>\r\n<li>Se establece una tarifa de Bs 400,oo (Mas I.V.A.) por modificaciones adicionales sobre la propuesta del emblema seleccionado se totaliza una vez finalizado el proceso de dise&ntilde;o y cambios. El total final variar&aacute; en funci&oacute;n a la cantidad de cambios solicitados por el cliente.&nbsp;</li>\r\n<li>Se entragan los archivos digitales, como conclusi&oacute;n del desarrollo del emblema, conteniendo las bases necesarias para reproducci&oacute;n e impresi&oacute;n del material desarrollado.</li>\r\n<li>Emitir pago a nombre de BESIGN, C.A. &oacute; realizar dep&oacute;sitos en Banco Mercantil<span style="\\">, 0105-0730-89-1730011306 a nombre de BESIGN, C.A.</span></li>\r\n</ul>\r\n<p>&nbsp;</p>', 'A convenir con el cliente', '3', 0, 'Emblemas y manual corporativo', '903'),
(905, 315, '02 de mayo de 2014', 0, 'direccion fisica', 'Proyecto Web', 96000.000, 12, 11520.000, '<ul>\r\n<li style="\\">Besign C.A. no es responsable por el contenido informativo del WebSite.</li>\r\n<li style="\\">Los costos en el presente presupuesto pueden variar en funci&oacute;n a la mayor o menor complejidad de los desarrollos.</li>\r\n<li>Los tiempos de entrega pueden variar en funci&oacute;n a la complejidad de los desarrollos.</li>\r\n<li><span style="font-size: 10px;">El cliente suministrar&aacute; todas las im&aacute;genes y textos necesarios para la publicacion del site.</span></li>\r\n<li>Este presupuesto tiene una valid&eacute;z de 10 d&iacute;as.</li>\r\n<li style="\\"><span style="\\">Es pol&iacute;tica de Besign, C.A. no entregar Archivos Base de desarollo de ning&uacute;n tipo. La informaci&oacute;n que puede ser entregada al Cliente final es aquella contenida en el servidor (incluyendo Base de Datos), en cualquier momento que &eacute;ste la solicite</span>&nbsp;</li>\r\n<li style="\\">El presupuesto no incluye las imagenes a utilizarse en el proyecto. En caso de que el cliente desida asignar a Besign, C.A. la tarea de obtener dichas imagenes, se realizara un presupuesto aparte por la labor requerida.</li>\r\n<li style="\\">Emitir pago a nombre de BESIGN, C.A. &oacute; realizar dep&oacute;sitos en Banco Mercantil, Cta Corriente, 0105-0730-89-1730011306 a nombre de BESIGN, C.A.</li>\r\n</ul>', 'A convenir con el cliente', '3', 0, 'Proyecto Web ', '887'),
(906, 58, '25 de abril de 2014', 0, 'direccion fisica', 'Mantenimiento', 6000.000, 12, 720.000, '<ul>\r\n<li>El cliente suministrar&aacute; las claves de acceso a la Base de Datos actual, en caso de que las mismas hayan sido modificadas.</li>\r\n<li>La informaci&oacute;n a actualizar ser&aacute; suministrada por el cliente.</li>\r\n<li>El tiempo de entrega puede variar dependiendo de la complejidad del mantenimiento.</li>\r\n<li>Cualquier otra correccion o ajuste necesario que no se encuentre contemplado en este presupuesto, debera ser solicitado por escrito y sera presupuestado segun su grado de complejidad.</li>\r\n<li>Emitir pago a nombre de BESIGN, C.A. &oacute; realizar dep&oacute;sitos en Banco Mercantil, Cta Corriente, 0105-0730-89-1730011306 a nombre de BESIGN, C.A.</li>\r\n</ul>\r\n<p>&nbsp;</p>', 'A convenir con el cliente', '3', 0, 'Actualizaciones de WebSite (Nuevo Precio)', '0'),
