(914, 276, '07 de mayo de 2014', 0, 'direccion fisica', 'Proyecto Web', 18000.000, 12, 2160.000, '<ul>\r\n<li>El modulo sera instalado en el WebSite www.BeOneCollections en una seccion privada que exija usuario y contrase&ntilde;a para acceder.</li>\r\n<li>El modulo permite agregar otras herramientas cuando el cliente lo solicite. Dichos costos no se encuentran contemplanos en este presupuesto.&nbsp;</li>\r\n<li>Las fotografias e imagenes a utilizar en el proyecto deben ser suministradas por el clliente.</li>\r\n<li>Emitir pago a nombre de BESIGN, C.A. &oacute; realizar dep&oacute;sitos en Banco Mercantil, Cta Corriente, 0105-0730-89-1730011306 a nombre de BESIGN, C.A.</li>\r\n</ul>\r\n<p>&nbsp;</p>', 'A convenir con el cliente', '3', 15860984, 'Sistema Administrativo Basico', '913'),
(915, 244, '09 de mayo de 2014', 0, 'direccion fisica', '', 30000.000, 12, 3600.000, '<p>&nbsp;</p>\r\n<ul>\r\n<li>Los precios en este presupuesto son <strong>absolutamente</strong>&nbsp;<strong>referenciales</strong>.</li>\r\n<li>El levantamiento 3D se realizara con base en fotografias que seran facilitadas por el cliente.</li>\r\n<li><strong>Cuando el cliente entregue las fotogracias y deas espesificaciones necesarias, se hara un nuevo presupuesto con los costos definitivos.</strong></li>\r\n<li>El tiempo de entrega ser&aacute; a convenir con el cliente.</li>\r\n<li>Emitir pago a nombre de BESIGN, C.A. &oacute; realizar dep&oacute;sitos en Banco Mercantil, Cta Corriente, 0105-0730-89-1730011306 a nombre de BESIGN, C.A.</li>\r\n</ul>', 'A convenir con el cliente', '3', 0, 'diseño de interior y mobiliario', '0'),
(916, 244, '09 de mayo de 2014', 0, 'direccion fisica', 'Proyecto Web', 2000.000, 12, 240.000, '<ul>\r\n<li>El cliente entregar&aacute; el dise&ntilde;o grafico de todas las paginas relacionadas al sitio a desarrollar, asi como las imagenes y textos correspondientes</li>\r\n<li>Emitir pago a nombre de BESIGN, C.A. &oacute; realizar dep&oacute;sitos en Banco Mercantil, Cta Corriente, 0105-0730-89-1730011306 a nombre de BESIGN, C.A.</li>\r\n</ul>\r\n<p>&nbsp;</p>', 'A convenir con el cliente', '3', 15860984, 'una seccion', '0'),
