(920, 317, '22 de mayo de 2014', 0, 'direccion fisica', 'Proyecto Web', 117875.000, 12, 14145.000, '<ul>\r\n<li>El cliente se compromete a suministrar el dise&ntilde;o grafico de todos los modulos y seciones.</li>\r\n<li>De hacer falta algun dise&ntilde;o grafico, este sera presupuestado aparte, segun su complejjidad.</li>\r\n<li>De ser necesarias fotografias para ser incorporporados al web site, deben ser suministrados por el cliente.</li>\r\n<li>El tiempo de entrega puede variar dependiendo de la complejidad del mantenimiento.</li>\r\n<li>Cualquier otra correccion o ajuste necesario que no se encuentre contemplado en este presupuesto, debera ser solicitado por escrito y sera presupuestado segun su grado de complejidad.</li>\r\n<li>Los precios en este presupuesto son&nbsp;<strong>absolutamente</strong>&nbsp;<strong>referenciales</strong>. Cuando el cliente suministre mas detalle del alcance de cada modulo y seccion, se podra emitir un presupuesto definitivo.</li>\r\n<li>Emitir pago a nombre de BESIGN, C.A. &oacute; realizar dep&oacute;sitos en Banco Mercantil, Cta Corriente, 0105-0730-89-1730011306 a nombre de BESIGN, C.A.</li>\r\n</ul>\r\n<p>&nbsp;</p>', 'A convenir con el cliente', '3', 0, 'web site Sin diseño', '919'),
(921, 319, '26 de mayo de 2014', 0, 'direccion fisica', 'Proyecto Web', 20321.429, 12, 2438.571, '<ul>\r\n<li>LOS PRECIOS EN EL PRESENTE PRESUPUESTO PUEDEN VARIAR SIN PREVIO AVISO DESPUES DE 5 DIAS CONTINUOS.</li>\r\n<li>Las fotografias a ser publicadas, deben ser suministradas por el cliente.</li>\r\n<li>Emitir pago a nombre de BESIGN, C.A. &oacute; realizar dep&oacute;sitos en Banco Mercantil, Cta Corriente, 0105-0730-89-1730011306 a nombre de BESIGN, C.A.</li>\r\n</ul>\r\n<p>&nbsp;</p>', 'A convenir con el cliente', '3', 0, 'web site', '919'),
(922, 230, '28 de mayo de 2014', 0, 'direccion fisica', '', 3400.000, 12, 408.000, '<ul>\r\n<li>Emitir pago a nombre de BESIGN, C.A. &oacute; realizar dep&oacute;sitos en Banco Mercantil, Cta Corriente, 0105-0730-89-1730011306 a nombre de BESIGN, C.A.</li>\r\n</ul>\r\n<p>&nbsp;</p>', 'A convenir con el cliente', '3', 0, 'Asesoria en Mercadeo', '918');
