03/sxsw2011/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:52:"http://wordpress.org/news/2011/03/sxsw2011/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 14 Mar 2011 11:24:46 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:3:{i:0;a:5:{s:4:"data";s:9:"Community";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:10:"genius bar";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:2;a:5:{s:4:"data";s:4:"sxsw";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:33:"http://wordpress.org/news/?p=1746";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:322:"If you&#8217;ve ever heard Matt Mullenweg talk about the early days of WordPress, the South by Southwest (SxSW) Interactive festival that takes place each spring in Austin, TX usually crops up in the story. South by Southwest is in full swing right now, and WordPress has been all over the place. On Friday the 11th, [...]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:10:"Jane Wells";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:2105:"<p>If you&#8217;ve ever heard Matt Mullenweg talk about the early days of WordPress, the <a title="SxSW Interactive" href="http://sxsw.com/interactive">South by Southwest (SxSW) Interactive</a> festival that takes place each spring in Austin, TX usually crops up in the story. South by Southwest is in full swing right now, and WordPress has been all over the place.</p>\n<p>On Friday the 11th, Matt was interviewed by John Battelle of Federated Media in front of a packed ballroom, talking about the future of WordPress. That night, the annual SxSW WordPress BBQ party played host to hundreds of WordPress users, developers, and businesspeople, and attendees got an extra treat this year in the form of a t-shirt made especially to commemorate WordPress and its Texas roots.</p>\n<p>On Saturday the 12th, a second party co-hosted by the Austin WordPress Meetup Group and GeekAustin (and co-sponsored by the WordPress Foundation and WPEngine) brought together a similar crowd but with the addition of local WordPress community members who were not registered for the SxSW conference.</p>\n<p>Starting today, the South by Southwest trade show opens, and this year for the first time it will feature an official WordPress Genius Bar. Staffed by professional WordPress support staff, developers, advanced users, theme designers, and even some of the core contributors and project leaders, the booth will be open from 11am-6pm each day to answer questions and help people with any WordPress problems they might have. If you are at South by Southwest this year, consider stopping by to say hello and pick up a WordPress button or sticker. We&#8217;ll also have a limited supply of the special WordPress/Texas shirts that we&#8217;ll be giving away at the booth, so if you&#8217;re at SxSW between now and Thursday, stop by.  Hope to see you there!</p>\n<p><em>Location: The WordPress booth will be in trade show stand numbers 829, 831, 928, and 930 (it&#8217;s an endcap booth that combines those four spaces). You can find us in those spaces by following the numbered banners hanging from the ceiling.</em></p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:48:"http://wordpress.org/news/2011/03/sxsw2011/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:1;a:6:{s:4:"data";s:41:"\n		\n		\n		\n		\n		\n				\n\n		\n		\n			\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:5:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:26:"WordPress 3.1, lots of fun";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:43:"http://wordpress.org/news/2011/02/threeone/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:52:"http://wordpress.org/news/2011/02/threeone/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Wed, 23 Feb 2011 14:00:54 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:1:{i:0;a:5:{s:4:"data";s:8:"Releases";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:33:"http://wordpress.org/news/?p=1704";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:388:"The long-awaited fourteenth release of WordPress is now available. WordPress 3.1 &#8220;Reinhardt&#8221; is named in honor of the jazz guitarist Django Reinhardt. Version 3.1 is available for download, or you can update from within your dashboard. This release features a lightning fast redesigned linking workflow which makes it easy to link to your existing posts and pages, an [...]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:14:"Matt Mullenweg";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:17146:"<p>The long-awaited fourteenth release of WordPress is now available. WordPress 3.1 &#8220;Reinhardt&#8221; is named in <a href="http://wordpress.org/about/roadmap/">honor of</a> the jazz guitarist <a href="http://en.wikipedia.org/wiki/Django_Reinhardt">Django Reinhardt</a>. Version 3.1 is <a href="http://wordpress.org/download/">available for download</a>, or you can <a href="http://codex.wordpress.org/Dashboard_Updates_SubPanel">update from within your dashboard</a>.</p>\n<p>This release features a lightning fast <strong>redesigned linking workflow</strong> which makes it easy to link to your existing posts and pages, an <strong>admin bar</strong> so you&#8217;re never more than a click away from your most-used dashboard pages, a <strong>streamlined writing interface</strong> that hides many of the seldom-used panels by default to create a simpler and less intimidating writing experience for new bloggers (visit Screen Options in the top right to get old panels back), and a <strong>refreshed blue admin scheme</strong> available for selection under your personal options.</p>\n<p>There&#8217;s a bucket of candy for developers as well, including our new <strong>Post Formats support</strong> which makes it easy for themes to create portable tumblelogs with different styling for different types of posts, <strong>new CMS capabilities</strong> like archive pages for custom content types, a <strong>new Network Admin</strong>, an overhaul of the import and export system, and the ability to perform<strong> advanced taxonomy and custom fields queries</strong>.</p>\n<p>With the 3.1 release, <strong>WordPress is more of a CMS than ever before</strong>. The only limit to what you can build is your imagination.</p>\n<p>(No video yet for 3.1, we&#8217;re going to add it later.)</p>\n<h3>By the Numbers</h3>\n<p>There were over <strong>two thousand commits</strong> to the codebase in the 3.1 cycle! For a more comprehensive look at everything that has improved in 3.1, check out <a href="http://codex.wordpress.org/Version_3.1">3.1’s Codex page</a> or the <a href="http://core.trac.wordpress.org/query?status=closed&amp;resolution=fixed&amp;milestone=3.1&amp;group=status&amp;desc=1&amp;order=priority">more than 820 closed issues in Trac</a>.</p>\n<p>Now is the time to drop by our development channels if you are interested in being involved with 3.2, as the agenda will be under discussion shortly. We&#8217;re hoping to get the 3.2 release out in a shorter development cycle (3.1 took too long) and include some fun improvements around plugins and the speed of the admin. (Don&#8217;t worry, we&#8217;re still planning <a href="http://www.djangoproject.com/">on using PHP</a>.)</p>\n<h3>We&#8217;re All in This Together</h3>\n<p>WordPress is the result of the combined effort of people from all over the world united with a common goal: to make the best darn web software for publishing your story on the web and sharing it with the world. Here is a list of the more than 180 people who helped out with development during the 3.1 cycle:</p>\n<p><a href="http://profiles.wordpress.org/aaroncampbell">Aaron Campbell (aaroncampbell)</a>, <a href="http://profiles.wordpress.org/adambackstrom">Adam Backstrom (adambackstrom)</a>, <a href="http://profiles.wordpress.org/aldenta">John Ford (aldenta)</a>, <a href="http://profiles.wordpress.org/ale