tribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:2;a:6:{s:4:"data";s:47:"\n		\n		\n		\n		\n		\n				\n		\n		\n\n		\n		\n			\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:5:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:45:"WordPress 3.0.5 (and 3.1 Release Candidate 4)";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:50:"http://wordpress.org/news/2011/02/wordpress-3-0-5/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:59:"http://wordpress.org/news/2011/02/wordpress-3-0-5/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 07 Feb 2011 23:29:50 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:3:{i:0;a:5:{s:4:"data";s:8:"Releases";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:8:"Security";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:2;a:5:{s:4:"data";s:7:"Testing";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:33:"http://wordpress.org/news/?p=1683";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:366:"WordPress 3.0.5 is now available and is a security hardening update for all previous WordPress versions. This security release is required if you have any untrusted user accounts, but it also comes with important security enhancements and hardening. All WordPress users are strongly encouraged to update. Three point oh point five Enhances security Three point [...]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:12:"Andrew Nacin";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:3674:"<p><a href="http://wordpress.org/download/">WordPress 3.0.5</a> is now available and is a security hardening update for all previous WordPress versions.</p>\n<p><a href="http://codex.wordpress.org/Version_3.0.5">This security release</a> is required if you have any untrusted user accounts, but it also comes with important security enhancements and hardening. All WordPress users are strongly encouraged to update.</p>\n<p>Three point oh point five<br />\nEnhances security<br />\nThree point one comes soon</p>\n<p>The release addresses a number of issues and provides two additional enhancements:</p>\n<p><strong>Two moderate security issues</strong> were fixed that could have allowed a Contributor- or Author-level user to gain further access to the site.</p>\n<p><strong>One information disclosure issue</strong> was addressed that could have allowed an Author-level user to view contents of posts they should not be able to see, such as draft or private posts.</p>\n<p><strong>Two security enhancements</strong> were added. One improved the security of any plugins which were not properly leveraging our security API. The other offers additional defense in depth against a vulnerability that was fixed in previous release.</p>\n<p>Thanks to Nils Jueneman and Saddy for their private and responsible disclosures to security@wordpress.org for two of the issues. The others were reported or repaired by our security team.</p>\n<p><strong><a href="http://wordpress.org/download/">Download 3.0.5</a> or update automatically from the Dashboard &gt; Updates menu in your site&#8217;s admin area. Please update immediately.</strong></p>\n<hr />\n<h3>WordPress 3.1 Release Candidate 4 is also now available.</h3>\n<p>The Release Candidate 4  build includes the security fixes and enhancements included in 3.0.5 and addresses about two dozen additional bugs. This includes fixes for:</p>\n<ul>\n<li>Deleting a user and reassigning their posts to another user.</li>\n<li>Marking multiple users or sites as spam in multisite.</li>\n<li>PHP4 compatibility.</li>\n</ul>\n<p>As outlined in <a href="http://wordpress.org/news/2011/01/wordpress-3-1-release-candidate-3/">previous</a> <a href="http://wordpress.org/news/2011/01/wordpress-3-1-release-candidate-2/">RC</a> <a href="http://wordpress.org/news/2010/12/wordpress-3-1-release-candidate/">posts</a>, if you are testing the release candidate and think you&#8217;ve found a bug, there are a few ways to let us know:</p>\n<ul>\n<li>Post it to the <a href="http://wordpress.org/support/forum/alphabeta/">Alpha/Beta area in the support forums</a></li>\n<li>Report it to the <a href="http://lists.automattic.com/mailman/listinfo/wp-testers">wp-testers mailing list</a></li>\n<li>Join the development IRC channel and tell us live at irc.freenode.net #wordpress-dev</li>\n<li>File a bug ticket on the <a href="http://core.trac.wordpress.org/">WordPress Trac</a></li>\n</ul>\n<p>To test WordPress 3.1, try the <a href="http://wordpress.org/extend/plugins/wordpress-beta-tester/">WordPress Beta Tester plugin</a> (you&#8217;ll want &#8220;bleeding edge nightlies&#8221;). Or you can <a href="http://wordpress.org/wordpress-3.1-RC4.zip">download the release candidate here</a> (zip). If any new issues become known, you&#8217;ll be able to <a href="http://core.trac.wordpress.org/report/6">find them here</a>.</p>\n<p>After nearly five months of development and testing, we think we&#8217;re very close to a final release. <strong>Users and developers, please test your themes and plugins.</strong></p>\n<p>Download <a href="http://wordpress.org/wordpress-3.1-RC4.zip">WordPress 3.1 RC4</a> or <a href="http://wordpress.org/download/">WordPress 3.0.5</a> now.</p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:55:"http://wordpress.org/news/2011/02/wordpress-3-0-5/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:3;a:6:{s:4:"data";s:41:"\n		\n		\n		\n		\n		\n				\n\n		\n		\n			\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:5:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:49:"The Annual WordPress Conference: WordCamp SF 2011";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:51:"http://wordpress.org/news/2011/01/wordcamp-sf-2011/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:60:"http://wordpress.org/news/2011/01/wordcamp-sf-2011/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 24 Jan 2011 22:57:02 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:1:{i:0;a:5:{s:4:"data";s:8:"WordCamp";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:33:"http://wordpress.org/news/?p=1674";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:368:"Mark your calendars: WordCamp San Francisco, the official annual WordPress conference, will be August 12-14, 2011. This year will mark the 5th anniversary of WordCamp, and as always will feature Matt Mullenweg&#8217;s &#8220;State of the Word&#8221; address as well as a variety of amazing speakers that you&#8217;d normally only get to see at expensive industry [...]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:10:"Jane Wells";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:1450:"<p>Mark your calendars: <a title="WordCamp San Francisco" href="http://2011.sf.wordcamp.org">WordCamp San Francisco</a>, the official annual WordPress conference, will be August 12-14, 2011. This year will mark the 5th anniversary of WordCamp, and as always will feature Matt Mullenweg&#8217;s &#8220;State of the Word&#8221; address as well as a variety of amazing speakers that you&#8217;d normally only get to see at expensive industry conferences. This year the program will be expanded to three days, with programming for publishers, bloggers, and developers. There will also be related activities, like core team summits, workshops  for contributors, designers, and local organizers, and various professional and networking events. The planning is just beginning, so save the date on your calendar and keep an eye on the <a title="WordCamp SF 2011" href="http://2011.sf.wordcamp.org/">WordCamp SF 2011</a> site (and/or follow the <a href="http://twitter.com/#!/WordCampSF">@wordcampsf</a> twitter account) for updates as details become available.</p>\n<p>*For people who attended WordCamp SF last year who thought the annual event this year would be called WordCon, with WordCamp SF becoming a more locally-oriented event, you can read <a title="What''s in a Name? WordCamp SF vs. WordCon" href="http://central.wordcamp.org/?p=1006">my long-winded explanation</a> of why we didn&#8217;t go that route over the on the WordCamp Central blog.</p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:56:"http://wordpress.org/news/2011/01/wordcamp-sf-2011/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:4;a:6:{s:4:"data";s:44:"\n		\n		\n		\n		\n		\n				\n		\n\n		\n		\n			\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:5:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:33:"WordPress 3.1 Release Candidate 3";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:68:"http://wordpress.org/news/2011/01/wordpress-3-1-release-candidate-3/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:77:"http://wordpress.org/news/2011/01/wordpress-3-1-release-candidate-3/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Sat, 22 Jan 2011 18:58:35 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:2:{i:0;a:5:{s:4:"data";s:8:"Releases";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:7:"Testing";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:33:"http://wordpress.org/news/?p=1664";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:343:"WordPress 3.1 Release Candidate 3 is now available. After careful evaluation of the 3.1 features in RC2, we recognized the need to make some adjustments. There are some significant differences from previous versions of 3.1, so please review the changes if you have been developing against a beta or RC version. The biggest change is the [...]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:12:"Andrew Nacin";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:4042:"<p>WordPress 3.1 Release Candidate 3 is now available. After careful evaluation of the 3.1 features in RC2, we recognized the need to make some adjustments. There are some significant differences from previous versions of 3.1, so <strong>please</strong> review the changes if you have been developing against a beta or RC version.</p>\n<p>The biggest change is the removal of AJAX list tables, which had been an effort to move all of our list-style screens to full AJAX for pagination, searches, and column sorts, and to consolidate the list-style screens into a single API that plugins could leverage. Unfortunately, with more testing came realizations that there were too many major bugs and usability issues with how the functionality was implemented, so we&#8217;ve spent the last week rolling back the most important portions of the feature.</p>\n<ul>\n<li><strong>For users:</strong> AJAX has been entirely disabled for the list tables. We hope to bring this back again, in a form that is properly and fully implemented, in a future release. Column sorting remains, but everything else has returned to its 3.0 state.</li>\n<li><strong>For developers:</strong> The entire list table API is now marked <em>private</em>. If you attempt to leverage new components of the API, you are pretty much guaranteeing that your plugins will break in a future release, so please don&#8217;t do that. <img src=''http://wordpress.org/news/wp-includes/images/smilies/icon_smile.gif'' alt='':-)'' class=''wp-smiley'' />  We hope to enable all the fun new goodies for public use in a future release.</li>\n</ul>\n<p>This is the only way we could prevent any regressions in functionality and usability from WordPress 3.0 to 3.1. That&#8217;s right, users and plugin authors can still do everything you used to be able to do (and a little bit more).</p>\n<p>Because of the code churn between RC2 and RC3, <strong>this release candidate needs a lot of testing</strong>. Every list screen needs testing. In particular, the comment moderation screen needs testing, especially with keyboard shortcuts (if you didn&#8217;t know about those, now&#8217;s your chance to try them out).</p>\n<p>Other fixes in RC3 include:</p>\n<ul>\n<li>Properly display the author dropdown in Quick Edit</li>\n<li>Various important fixes to numerous taxonomy query variables</li>\n<li>Fixes to the theme deletion process</li>\n<li>Fixes to pages used for posts</li>\n<li>IIS and Multisite: Avoid resetting web.config on permalink save</li>\n<li>Properly validate post formats and their rewrite rules</li>\n</ul>\n<p>I&#8217;m assembling a group of friends in Washington, D.C., this weekend to test WordPress 3.1 and provide feedback. We&#8217;d love to see this idea catch on among friends at coffee shops around the world. (We&#8217;ll blog our results, and we&#8217;re thinking about using the hashtag #wptest on Twitter.) If you are testing the release candidate and think you&#8217;ve found a bug, there are a few ways to let us know:</p>\n<ul>\n<li>Post it to the <a href="http://wordpress.org/support/forum/alphabeta/">Alpha/Beta area in the support forums</a></li>\n<li>Report it to the <a href="http://lists.automattic.com/mailman/listinfo/wp-testers">wp-testers mailing list</a></li>\n<li>Join the development IRC channel and tell us live at irc.freenode.net #wordpress-dev</li>\n<li>File a bug ticket on the <a href="http://core.trac.wordpress.org/">WordPress Trac</a></li>\n</ul>\n<p>To test WordPress 3.1, try the <a href="http://wordpress.org/extend/plugins/wordpress-beta-tester/">WordPress Beta Tester plugin</a> (you&#8217;ll want &#8220;bleeding edge nightlies&#8221;). Or you can <a href="http://wordpress.org/wordpress-3.1-RC3.zip">download the release candidate here</a> (zip).</p>\n<p>We&#8217;re going to study this release carefully to see where we can improve on our internal processes in the future. With that, our requisite haiku, authored by Jane:</p>\n<p>Pulling the AJAX &#8211;<br />\nsometimes you need to step back<br />\nand show some restraint.</p>\n<p>Happy testing!</p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:73:"http://wordpress.org/news/2011/01/wordpress-3-1-release-candidate-3/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:5;a:6:{s:4:"data";s:44:"\n		\n		\n		\n		\n		\n				\n		\n\n		\n		\n			\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:5:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:33:"WordPress 3.1 Release Candidate 2";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:68:"http://wordpress.org/news/2011/01/wordpress-3-1-release-candidate-2/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:77:"http://wordpress.org/news/2011/01/wordpress-3-1-release-candidate-2/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Sat, 01 Jan 2011 23:57:06 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:2:{i:0;a:5:{s:4:"data";s:8:"Releases";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:7:"Testing";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:33:"http://wordpress.org/news/?p=1649";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:321:"The second release candidate for WordPress 3.1 is now available. The requisite haiku: Rounding up stragglers Last few bugs for 3.1 Go test RC2 As I outlined in the announcement post for RC1, release candidates are the last stop before the final release. It means we think we&#8217;re done, and we again have no bugs [...]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:12:"Andrew Nacin";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:2973:"<p>The second release candidate for WordPress 3.1 is now available. The requisite haiku:</p>\n<p>Rounding up stragglers<br />\nLast few bugs for 3.1<br />\nGo test RC2</p>\n<p>As I outlined in <a title="WordPress 3.1 Release Candidate" href="http://wordpress.org/news/2010/12/wordpress-3-1-release-candidate/">the announcement post for RC1</a>, release candidates are the last stop before the final release. It means we think we&#8217;re done, and we again have no bugs to squash. But with tens of millions of users, many server configurations and setups, and thousands of plugins and themes, it&#8217;s still possible we&#8217;ve missed something.</p>\n<p>Beta 1 came on Thanksgiving, RC1 on Christmas, and RC2 on New Year&#8217;s Day. We won&#8217;t be waiting for another holiday for the final release, though, so <strong>if you haven&#8217;t tested WordPress 3.1 yet, now is the time!</strong></p>\n<p>Select changes since RC1:</p>\n<ul>\n<li>The security fixes included in WordPress 3.0.4</li>\n<li>Fix issues related to handling a static front page</li>\n<li>Fixes and enhancements for the pagination buttons</li>\n<li>Fix searching for partial usernames</li>\n<li>Properly reactivate plugins after editing them</li>\n<li>Always show the current author in the author dropdown when editing a post</li>\n<li>Fixes for attachment taxonomies</li>\n<li>Fix node removal for the admin bar</li>\n<li>Fix the custom post type show_in_menu argument</li>\n<li>Various fixes for right-to-left languages</li>\n<li>and <a href="http://core.trac.wordpress.org/log/trunk/?action=stop_on_copy&amp;mode=stop_on_copy&amp;rev=17204&amp;stop_rev=17149&amp;limit=100&amp;verbose=on">a few dozen more changes</a></li>\n</ul>\n<p>If you are testing the release candidate and think you&#8217;ve found a bug, there are a few ways to let us know:</p>\n<ul>\n<li>Post it to the <a href="http://wordpress.org/support/forum/alphabeta/">Alpha/Beta area in the support forums</a></li>\n<li>Report it to the <a href="http://lists.automattic.com/mailman/listinfo/wp-testers">wp-testers mailing list</a></li>\n<li>Join the development IRC channel and tell us live at irc.freenode.net #wordpress-dev</li>\n<li>File a bug ticket on the <a href="http://core.trac.wordpress.org/">WordPress Trac</a></li>\n</ul>\n<p>To test WordPress 3.1, try the <a href="http://wordpress.org/extend/plugins/wordpress-beta-tester/">WordPress Beta Tester plugin</a> (you&#8217;ll want &#8220;bleeding edge nightlies&#8221;). Or you can <a href="http://wordpress.org/wordpress-3.1-RC2.zip">download the release candidate here</a> (zip).</p>\n<p>If any known issues crop up, you&#8217;ll be able to <a href="http://core.trac.wordpress.org/report/5">find them here</a>. If you&#8217;d like to know which levers to pull in your testing, <a href="http://wordpress.org/news/2010/11/wordpress-3-1-beta-1/">check out a list of features</a> in our Beta 1 post.</p>\n<p><a href="http://wordpress.org/wordpress-3.1-RC2.zip">Download WordPress 3.1 RC 2</a></p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:73:"http://wordpress.org/news/2011/01/wordpress-3-1-release-candidate-2/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:6;a:6:{s:4:"data";s:44:"\n		\n		\n		\n		\n		\n				\n		\n\n		\n		\n			\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:5:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:31:"3.0.4 Important Security Update";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:47:"http://wordpress.org/news/2010/12/3-0-4-update/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:56:"http://wordpress.org/news/2010/12/3-0-4-update/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Wed, 29 Dec 2010 21:50:23 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:2:{i:0;a:5:{s:4:"data";s:8:"Releases";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:8:"Security";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:33:"http://wordpress.org/news/?p=1641";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:343:"Version 3.0.4 of WordPress, available immediately through the update page in your dashboard or for download here, is a very important update to apply to your sites as soon as possible because it fixes a core security bug in our HTML sanitation library, called KSES. I would rate this release as &#8220;critical.&#8221; This issue affects [...]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:14:"Matt Mullenweg";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:1207:"<p>Version 3.0.4 of WordPress, available immediately through the update page in your dashboard or <a href="http://wordpress.org/download/">for download here</a>, is a very important update to apply to your sites as soon as possible because it fixes a core security bug in our HTML sanitation library, called KSES. I would rate this release as &#8220;critical.&#8221;</p>\n<p>This issue affects all versions of WordPress prior to 3.0.4, so if you are still on a 2.X release you need to update as well.</p>\n<p>I realize an update during the holidays is no fun, but this one is worth putting down the eggnog for. In the spirit of the holidays, consider helping your friends as well.</p>\n<p>If you are a security researcher, we&#8217;d appreciate you <a href="http://core.trac.wordpress.org/changeset/17172/branches/3.0">taking a look over this changeset</a> as well to review our update. We&#8217;ve given it a lot of thought and review but since this is so core we want as many brains on it as possible. Thanks to <a href="http://www.sneaked.net">Mauro Gentile</a> and <a title="duck undah" href="http://joncave.co.uk">Jon Cave (duck_)</a> who discovered and alerted us to these XSS vulnerabilities first.</p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:52:"http://wordpress.org/news/2010/12/3-0-4-update/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:7;a:6:{s:4:"data";s:41:"\n		\n		\n		\n		\n		\n				\n\n		\n		\n			\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:5:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:26:"Coming Up: Meet the Makers";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:60:"http://wordpress.org/news/2010/12/coming-up-meet-the-makers/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:69:"http://wordpress.org/news/2010/12/coming-up-meet-the-makers/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 27 Dec 2010 20:34:09 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:1:{i:0;a:5:{s:4:"data";s:9:"Community";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:33:"http://wordpress.org/news/?p=1633";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:374:"I am often asked how decisions are made for WordPress, who&#8217;s involved in decision-making, and how the open source project is structured in general. WordPress is a meritocracy, meaning that anyone can get involved, and a combination of the quality of someone&#8217;s contributions and their level of interest/time commitment will determine how much influence they [...]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:10:"Jane Wells";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:2899:"<p>I am often asked how decisions are made for WordPress, who&#8217;s involved in decision-making, and how the open source project is structured in general. WordPress is a meritocracy, meaning that anyone can get involved, and a combination of the quality of someone&#8217;s contributions and their level of interest/time commitment will determine how much influence they have over decisions. Because these factors vary, we have several levels of contributors to the core WordPress application, ranging from full-time lead developers to casual one-patch contributors.</p>\n<p>I loved it when that Intel commercial in 2009 gave Ajay Bhatt, co-inventor of the USB, some recognition as a rock star of geekland (though I hated it that it wasn&#8217;t actually Ajay Bhatt, but an actor &#8212; way to kill the message, Intel).<sup>1</sup> In WordPress-land, most people know who Matt Mullenweg is, but most of the other leaders and contributors are much less visible. Moving forward, I&#8217;m going to be posting profiles here of some of our more dedicated contributors.</p>\n<p>Why now? We&#8217;re coming up on the second annual WordPress core leadership meetup in January 2011, and we&#8217;re thinking we&#8217;ll hold a video town hall at some point during our time together. Between now and then the profiles I post will be of the core developers who will be at the meetup. After that, I&#8217;ll be branching out and posting about other contributors, including developers, designers, forum moderators, etc.</p>\n<p>I&#8217;ll post here in January when we have dates/times set for the video town hall. In the meantime, you can submit questions for us to answer then in the forum thread <a title="Suggestions thread" href="http://wordpress.org/support/topic/what-should-2011-hold-for-wordpress?">What Should 2011 Hold for WordPress?</a></p>\n<p>To get a sense of how all these people fit together and how decisions are made, you can check out the presentation I did at WordCamp Portland in October on <a title="How WordPress Decisions Get Made video" href="http://wordpress.tv/2010/09/18/jane-wells-how-wordpress-decisions-get-made/">How WordPress Decisions Get Made</a><span style="font-size: 11.6667px">.</span></p>\n<p><sup>1 &#8211; And how lame is it that Conan O&#8217;Brien&#8217;s interview with the real Ajay Bhatt is no longer available on the The Tonight Show&#8217;s website, and everyone&#8217;s embedded videos are blank? I found a copy of it <a title="Conan interviews the real Ajay Bhatt" href="http://vimeo.com/10662430">here</a>. And here&#8217;s the <a title="Intel rock star commercial" href="http://video.intel.com/?fr_story=8d8f50ebfdded3db4eb14514d66e4f9628f653b5&amp;rf=sitemap">original Intel commercial</a> if you were living under a rock and never saw it. <img src=''http://wordpress.org/news/wp-includes/images/smilies/icon_smile.gif'' alt='':)'' class=''wp-smiley'' /> </sup></p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:65:"http://wordpress.org/news/2010/12/coming-up-meet-the-makers/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:8;a:6:{s:4:"data";s:44:"\n		\n		\n		\n		\n		\n				\n		\n\n		\n		\n			\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:5:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:31:"WordPress 3.1 Release Candidate";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:66:"http://wordpress.org/news/2010/12/wordpress-3-1-release-candidate/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:75:"http://wordpress.org/news/2010/12/wordpress-3-1-release-candidate/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Sat, 25 Dec 2010 23:59:05 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:2:{i:0;a:5:{s:4:"data";s:8:"Releases";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:7:"Testing";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:33:"http://wordpress.org/news/?p=1606";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:337:"The first release candidate (RC1) for WordPress 3.1 is now available. An RC comes after the beta period and before final release. That means we think we&#8217;re done. We currently have no known issues or bugs to squash. But with tens of millions of users, a variety of configurations, and thousands of plugins, it&#8217;s possible [...]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:12:"Andrew Nacin";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:2568:"<p>The first release candidate (RC1) for WordPress 3.1 is now available.</p>\n<p>An RC comes after the beta period and before final release. That means we think we&#8217;re done. We currently have no known issues or bugs to squash. But with tens of millions of users, a variety of configurations, and thousands of plugins, it&#8217;s possible we&#8217;ve missed something. So if you haven&#8217;t tested WordPress 3.1 yet, now is the time! Please though, not on your live site unless you&#8217;re extra adventurous.</p>\n<p>Things to keep in mind:</p>\n<ul>\n<li>With <a href="http://core.trac.wordpress.org/milestone/3.1">nearly 700 tickets closed</a>, there are tons of changes. Plugin and theme authors, <strong>please test your plugins and themes now</strong>, so that if there is a compatibility issue, we can figure it out before the final release.</li>\n<li><strong>Users</strong> are also encouraged to test things out. If you find problems, let your plugin/theme authors know so they can figure out the cause.</li>\n<li>If any known issues crop up, you&#8217;ll be able to <a href="http://core.trac.wordpress.org/report/5">find them here</a>.</li>\n</ul>\n<p>If you are testing the release candidate and think you&#8217;ve found a bug, there are a few ways to let us know:</p>\n<ul>\n<li>Post it to the <a href="http://wordpress.org/support/forum/alphabeta/">Alpha/Beta area in the support forums</a></li>\n<li>Report it to the <a href="http://lists.automattic.com/mailman/listinfo/wp-testers">wp-testers mailing list</a></li>\n<li>Join the development IRC channel and tell us live at irc.freenode.net #wordpress-dev</li>\n<li>File a bug ticket on the <a href="http://core.trac.wordpress.org/">WordPress Trac</a></li>\n</ul>\n<p>To test WordPress 3.1, try the <a href="http://wordpress.org/extend/plugins/wordpress-beta-tester/">WordPress Beta Tester plugin</a> (you&#8217;ll want &#8220;bleeding edge nightlies&#8221;). Or you can <a href="http://wordpress.org/wordpress-3.1-RC1.zip">download the release candidate here</a> (zip).</p>\n<p>We <a href="http://wordpress.org/news/2010/11/wordpress-3-1-beta-1/">released</a> WordPress 3.1 Beta 1 on Thanksgiving, so it&#8217;s only fitting that the release candidate comes as a Christmas present. Happy holidays and happy testing!</p>\n<p><a href="http://wordpress.org/wordpress-3.1-RC1.zip">Download WordPress 3.1 RC 1</a></p>\n<p><em>If you&#8217;d like to know which levers to pull in your testing, <a href="http://wordpress.org/news/2010/11/wordpress-3-1-beta-1/">check out a list of features</a> in our Beta 1 post.</em></p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:71:"http://wordpress.org/news/2010/12/wordpress-3-1-release-candidate/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:9;a:6:{s:4:"data";s:47:"\n		\n		\n		\n		\n		\n				\n		\n		\n\n		\n		\n			\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:5:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:20:"WordPress 3.1 Beta 2";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:55:"http://wordpress.org/news/2010/12/wordpress-3-1-beta-2/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:64:"http://wordpress.org/news/2010/12/wordpress-3-1-beta-2/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Wed, 15 Dec 2010 03:18:57 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:3:{i:0;a:5:{s:4:"data";s:8:"Releases";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:7:"Testing";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:2;a:5:{s:4:"data";s:3:"3.1";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:33:"http://wordpress.org/news/?p=1572";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:321:"Haikus from Jane on her 39th birthday: Practice makes perfect is what they say about things, but sometimes it&#8217;s not. In this case it is not practice but refinement, and then more testing. You can help WordPress! Now: 3.1, beta 2 is here; needs testing. But! Remember this: Only install on test sites, as YMMV. [...]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:12:"Andrew Nacin";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:1689:"<p>Haikus from Jane on her 39th birthday:</p>\n<blockquote><p>Practice makes perfect<br />\nis what they say about things,<br />\nbut sometimes it&#8217;s not.</p>\n<p>In this case it is<br />\nnot practice but refinement,<br />\nand then more testing.</p>\n<p>You can help WordPress!<br />\nNow: 3.1, beta 2<br />\nis here; needs testing.</p>\n<p>But! Remember this:<br />\n<strong>Only install on test sites</strong>,<br />\nas YMMV.</p></blockquote>\n<p>The second beta of WordPress 3.1 is now available!</p>\n<p>For things to test, please review our <a href="http://wordpress.org/news/2010/11/wordpress-3-1-beta-1/">Beta 1 release announcement</a>. A <a href="http://core.trac.wordpress.org/report/5">list of known issues</a> can be found on our bug tracker.</p>\n<p>Already have a test install that you want to switch over to the beta? <a href="http://wordpress.org/extend/plugins/wordpress-beta-tester/">Try the beta tester plugin</a>. Please test 3.1 on a test site, not on your live site, as interactions with plugins that haven&#8217;t been updated may be unpredictable, and we can&#8217;t predict (see how that works?) whether something will break or not&#8230; that&#8217;s why we&#8217;re asking people to help us test everything! <img src=''http://wordpress.org/news/wp-includes/images/smilies/icon_smile.gif'' alt='':)'' class=''wp-smiley'' /> </p>\n<p>Testers, don&#8217;t forget to use the <a href="http://lists.automattic.com/mailman/listinfo/wp-testers">wp-testers mailing list</a> to discuss bugs you encounter. Plugin and theme authors, please test your plugins for compatibility.</p>\n<p><a href="http://wordpress.org/wordpress-3.1-beta2.zip">Download the WordPress 3.1 Beta 2</a> now.</p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:60:"http://wordpress.org/news/2010/12/wordpress-3-1-beta-2/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}}}s:27:"http://www.w3.org/2005/Atom";a:1:{s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:0:"";s:7:"attribs";a:1:{s:0:"";a:3:{s:4:"href";s:31:"http://wordpress.org/news/feed/";s:3:"rel";s:4:"self";s:4:"type";s:19:"application/rss+xml";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:44:"http://purl.org/rss/1.0/modules/syndication/";a:2:{s:12:"updatePeriod";a:1:{i:0;a:5:{s:4:"data";s:6:"hourly";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:15:"updateFrequency";a:1:{i:0;a:5:{s:4:"data";s:1:"1";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explic