;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:2568:"<p>WordPress is all over the South by Southwest (SXSW) festival this year &#8211; from networking parties to a WordPress Genius Bar at the trade show, WordPress has definitely left its mark on the conference.</p>\n<p>The WordPress Genius Bar will be at the trade show through Thursday, March 17th. Stop by and say hi, grab some swag or talk to the geniuses about WordPress. But get there early &#8211; it&#8217;s been packed! (Booth #s  829, 831, 928, and 930)</p>\n<p>More details on the <a href="http://wordpress.org/news/2011/03/sxsw2011/">WordPress Development site</a></p>\n<p><img class="aligncenter size-full wp-image-1316" title="WordPress at South by Southwest" src="http://wordpresspublishers.files.wordpress.com/2011/03/5527735530_f1f74811b7.jpg?w=500&h=333" alt="" width="500" height="333" /><em>Photo by Terry Chay</em></p>\n<br />  <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gocomments/wordpresspublishers.wordpress.com/1315/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/comments/wordpresspublishers.wordpress.com/1315/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/godelicious/wordpresspublishers.wordpress.com/1315/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/delicious/wordpresspublishers.wordpress.com/1315/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gofacebook/wordpresspublishers.wordpress.com/1315/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/facebook/wordpresspublishers.wordpress.com/1315/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gotwitter/wordpresspublishers.wordpress.com/1315/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/twitter/wordpresspublishers.wordpress.com/1315/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gostumble/wordpresspublishers.wordpress.com/1315/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/stumble/wordpresspublishers.wordpress.com/1315/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/godigg/wordpresspublishers.wordpress.com/1315/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/digg/wordpresspublishers.wordpress.com/1315/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/goreddit/wordpresspublishers.wordpress.com/1315/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/reddit/wordpresspublishers.wordpress.com/1315/" /></a> <img alt="" border="0" src="http://stats.wordpress.com/b.gif?host=publisherblog.automattic.com&blog=1470857&post=1315&subd=wordpresspublishers&ref=&feed=1" width="1" height="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Tue, 15 Mar 2011 17:42:32 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:10:"Sara Rosso";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:1;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:56:"Weblog Tools Collection: Big Changes for Blogger in 2011";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:40:"http://weblogtoolscollection.com/?p=9779";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:73:"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/ljmPvH4qFXM/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1017:"<p><a href="http://www.blogger.com/">Blogger</a>, Google&#8217;s 11-year-old blogging platform, will be kicking it into high gear in 2011 with <a href="http://googleblog.blogspot.com/2011/03/whats-new-with-blogger.html">a few improvements</a>.</p>\n<p>Premiered this year at <a href="http://www.sxsw.com/">SXSW</a>, Blogger will be launching a completely overhauled user interface, putting to rest an interface that has begun to show its age. Following on its heels will be new mobile themes, and a new content discovery engine, &#8220;that lets you uncover interesting and related content based on the topics of the blog you&#8217;re currently reading.&#8221; Google promises that there will be more to come, but they are not ready to reveal anything else at this time.</p>\n<p>2011 is starting to sound like a big year for the blogging giant, and it will certainly be interesting to see what comes of it.</p>\n<img src="http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/ljmPvH4qFXM" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Tue, 15 Mar 2011 13:00:18 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:10:"James Huff";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:2;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:79:"WordPress.tv: Reed Gustow: Creating a Customized Navigation System in WordPress";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:27:"http://wordpress.tv/?p=5757";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s