ents/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:7:"Anthony";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:5;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:58:"Weblog Tools Collection: WordPress Theme Releases for 3/14";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:40:"http://weblogtoolscollection.com/?p=9775";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:73:"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/WLoCs4zm8vE/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:886:"<p><img class="alignnone size-full wp-image-9776" title="minimalgeorgia" src="http://weblogtoolscollection.com/wp-content/uploads/2011/03/minimalgeorgia.jpg" alt="" width="150" height="113" /></p>\n<p><a href="http://wordpress.org/extend/themes/minimal-georgia"><strong>Minimal Georgia</strong></a> is a sweet multi-color theme filled with Georgia goodness, including two columns, widgets and menus.</p>\n<p><img class="alignnone size-full wp-image-9777" title="supermodne" src="http://weblogtoolscollection.com/wp-content/uploads/2011/03/supermodne.jpg" alt="" width="150" height="113" /></p>\n<p><a href="http://wordpress.org/extend/themes/supermodne"><strong>Supermodne</strong></a> is a modern, clean and clear theme. Designed for blogs and portals about fashion and women.</p>\n<img src="http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/WLoCs4zm8vE" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 14 Mar 2011 13:00:07 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:10:"James Huff";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:6;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:43:"Dev Blog: Live from South by Southwest 2011";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:33:"http://wordpress.org/news/?p=1746";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:43:"http://wordpress.org/news/2011/03/sxsw2011/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:2104:"<p>If you&#8217;ve ever heard Matt Mullenweg talk about the early days of WordPress, the <a title="SxSW Interactive" href="http://sxsw.com/interactive">South by Southwest (SxSW) Interactive</a> festival that takes place each spring in Austin, TX usually crops up in the story. South by Southwest is in full swing right now, and WordPress has been all over the place.</p>\n<p>On Friday the 11th, Matt was interviewed by John Battelle of Federated Media in front of a packed ballroom, talking about the future of WordPress. That night, the annual SxSW WordPress BBQ party played host to hundreds of WordPress users, developers, and businesspeople, and attendees got an extra treat this year in the form of a t-shirt made especially to commemorate WordPress and its Texas roots.</p>\n<p>On Saturday the 12th, a second party co-hosted by the Austin WordPress Meetup Group and GeekAustin (and co-sponsored by the WordPress Foundation and WPEngine) brought together a similar crowd but with the addition of local WordPress community members who were not registered for the SxSW conference.</p>\n<p>Starting today, the South by Southwest trade show opens, and this year for the first time it will feature an official WordPress Genius Bar. Staffed by professional WordPress support staff, developers, advanced users, theme designers, and even some of the core contributors and project leaders, the booth will be open from 11am-6pm each day to answer questions and help people with any WordPress problems they might have. If you are at South by Southwest this year, consider stopping by to say hello and pick up a WordPress button or sticker. We&#8217;ll also have a limited supply of the special WordPress/Texas shirts that we&#8217;ll be giving away at the booth, so if you&#8217;re at SxSW between now and Thursday, stop by.  Hope to see you there!</p>\n<p><em>Location: The WordPress booth will be in trade show stand numbers 829, 831, 928, and 930 (it&#8217;s an endcap booth that combines those four spaces). You can find us in those spaces by following the numbered banners hanging from the ceiling.</em></p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 14 Mar 2011 11:24:46 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:10:"Jane Wells";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:7;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:59:"Weblog Tools Collection: WordPress Plugin Releases for 3/12";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:40:"http://weblogtoolscollection.com/?p=9772";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:73:"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/AsF-rUiApqw/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1077:"<h3>New plugins</h3>\n<p><a href="http://jetpack.me/"><strong>Jetpack</strong></a> supercharges your self-hosted WordPress site with the awesome cloud power of WordPress.com.</p>\n<p><a href="http://www.designchemical.com/blog/index.php/wordpress-plugins/wordpress-plugin-jquery-vertical-mega-menu-widget/"><strong>jQuery Vertical Mega Menu</strong></a> can handle multiple vertical mega menus per page, offers 3 different animation effects and speeds for displaying the mega menu and can select the flyout direction &#8211; left or right.</p>\n<h3>Updated plugins</h3>\n<p><a href="http://www.faktor.cc/Fotomobil/wp-osm-plugin"><strong>OSM</strong></a> displays maps in your WP-blog using the OpenLayers technology &#8211; no API key is needed.</p>\n<p><a href="http://scribu.net/wordpress/query-multiple-taxonomies/"><strong>Taxonomy Drill-Down</strong></a> is a plugin that lets you make use of the advanced taxonomy querying capabilities introduced in WordPress 3.1.</p>\n<img src="http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/AsF-rUiApqw" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Sat, 12 Mar 2011 14:00:22 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:10:"James Huff";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:8;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:66:"Alex King: Carrington Build 1.1 & Carrington Business 1.1 Released";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:27:"http://alexking.org/?p=5608";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:65:"http://alexking.org/blog/2011/03/11/carrington-build-business-1-1";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:2344:"<p>I&#8217;m very pleased to announce that we have released version 1.1 of <a href="http://crowdfavorite.com/wordpress/carrington-build/" rel="external">Carrington Build</a> and our <a href="http://crowdfavorite.com/wordpress/themes/carrington-business/">Carrington Business theme</a> for WordPress. Carrington Build is our drag and drop layout tool for WordPress themes, it is included in our Carrington Business theme.</p>\n<p class="center"><a href="http://www.flickr.com/photos/alexkingorg/5518281630/" title="Carrington Business 1.1 by alexkingorg, on Flickr"><img src="http://farm6.static.flickr.com/5216/5518281630_379e9c8f01_m.jpg" width="240" height="148" alt="Carrington Business 1.1" /></a></p>\n<p>Carrington Build has been a great product for us. We&#8217;re building bigger and bigger sites with it, and we&#8217;ve seen it work just like we anticipated: we&#8217;ve given our clients the power to manage their own sites, including sophisticated design and layout changes.</p>\n<p>We have made a bunch of improvements in Carrington Build since our 1.0 release. Here is a short list of some of the changes and enhancements in the new release:</p>\n<ul>\n<li>Added a carousel module.</li>\n<li>Created an extension framework to the WordPress revision system and implemented it in Build so that Build pages have all of their custom layout data saved within the WordPress revision system. This framework will actually be released as a public plugin soon on wordpress.org.</li>\n<li>Enhance the Loop module to support custom post types, taxonomies, etc. and add feature to allow it to be used in order to create multi-column lists of items.</li>\n<li>WordPress 3.1 compatibility.</li>\n<li>Lost of misc. changes and bug fixes.</li>\n<li>We&#8217;ve posted our <a href="http://crowdfavorite.com/news/2011/03/carrington-build-and-carrington-business-theme-versions-1-1-released/">QA checklist for Build</a> in our news release, in case you&#8217;re interested in seeing what we run through on every release candidate.</li>\n</ul>\n<p>This is just a sampling, the full changelog (included in the download) is about 75 items long. And we&#8217;ve got a bunch more stuff we&#8217;re excited about for the next version.</p>\n<p>Check it out, I hope you like it.</p>\n<img src="http://alexking.org/wp/?ak_action=api_record_view&id=5608&type=feed" alt="" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Fri, 11 Mar 2011 20:50:41 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:4:"Alex";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:9;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:73:"WP Blackberry: WordPress for BlackBerry 1.4.6.1 Security Update Available";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:38:"http://blackberry.wordpress.org/?p=455";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:59:"http://blackberry.wordpress.org/2011/03/11/release-1-4-6-1/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:4079:"<p>WordPress for BlackBerry version 1.4.6.1 has been released to <a href="http://appworld.blackberry.com/webstore/content/5802">BlackBerry App World</a>.</p>\n<p>WordPress for BlackBerry 1.4.6.1 is a security update that also improves the communication layer within the app. To store your credentials, the app is now using a completely different, strongly encrypted storage model. Due to these changes, we&#8217;ve held back on developing new features in this release to make sure the transition to the new storage model is as smooth as possible. While the app should transfer your credentials to the new storage model, you might be forced to re-add your blogs/sites when updating. (Draft posts will not be erased, so once you have re-added a blog the old drafts should become visible again.)</p>\n<p>Other changes include:</p>\n<ul>\n<li>You can now select which type of the Media API that should be used for uploading photos and videos.</li>\n<li>Added the Preview for Private Posts/Pages</li>\n<li>Improved the preview screen, which is now using the BlackBerry browser or any browser installed on your device.</li>\n<li>Fix for VideoPress issue when uploading multiple videos <a href="http://blackberry.trac.wordpress.org/ticket/181" target="_blank">#181</a>.</li>\n<li>Fix for app permission issues that could freeze the app if all permissions are not set to Allow <a href="http://blackberry.trac.wordpress.org/ticket/179" target="_blank">#179</a>.</li>\n<li>Fix for postID that are bigger than the XML-RPC specification <a href="http://blackberry.trac.wordpress.org/ticket/180" target="_blank">#180</a>.</li>\n<li>Improved the communication layer.</li>\n<li>Improved the XML-RPC calls.</li>\n<li>Fix for post/page comments setting that allow people to post comments on new articles created using the app <a href="http://blackberry.trac.wordpress.org/ticket/163" target="_blank">#163</a>.</li>\n<li>Other minor changes.</li>\n</ul>\n<p>Do you have questions or feedback on how we can make the app better? Please visit the <a href="http://blackberry.forums.wordpress.org/">WordPress for BlackBerry forums</a> and tell us your thoughts! Also make sure to a follow <a href="http://twitter.com/WPBlackBerry">@WPBlackBerry</a> on Twitter for the latest news and updates.</p>\n<p>Note: Depending on your region or country, you may not see the latest version in BlackBerry App World yet. However, the new release should be available for download on your device starting today.</p>\n<br />  <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gocomments/wpblackberry.wordpress.com/455/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/comments/wpblackberry.wordpress.com/455/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/godelicious/wpblackberry.wordpress.com/455/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/delicious/wpblackberry.wordpress.com/455/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gofacebook/wpblackberry.wordpress.com/455/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/facebook/wpblackberry.wordpress.com/455/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gotwitter/wpblackberry.wordpress.com/455/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/twitter/wpblackberry.wordpress.com/455/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gostumble/wpblackberry.wordpress.com/455/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/stumble/wpblackberry.wordpress.com/455/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/godigg/wpblackberry.wordpress.com/455/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/digg/wpblackberry.wordpress.com/455/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/goreddit/wpblackberry.wordpress.com/455/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/reddit/wpblackberry.wordpress.com/455/" /></a> <img alt="" border="0" src="http://stats.wordpress.com/b.gif?host=blackberry.wordpress.org&blog=8247031&post=455&subd=wpblackberry&ref=&feed=1" width="1" height="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Fri, 11 Mar 2011 15:09:04 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:6:"Danilo";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:10;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:59:"Weblog Tools Collection: Watch The Development of WordPress";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:40:"http://weblogtoolscollection.com/?p=9767";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:73:"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/1FL60E40g7g/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:434:"<p><a href="http://wordpress.org/">WordPress</a> has come a long way since 2003, and <a href="http://joncave.co.uk/2011/02/road-to-wordpress-3-1/">this handy video</a> from Jon Cave traces every step along the way. Don&#8217;t miss a beat when things really start to heat up in 2005 as work begins on WordPress 2.</p>\n<p></p>\n<img src="http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/1FL60E40g7g" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Fri, 11 Mar 2011 14:00:00 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:10:"James Huff";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:11;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:58:"Weblog Tools Collection: WordPress Theme Releases for 3/10";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:40:"http://weblogtoolscollection.com/?p=9760";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:73:"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/Q31J_r-eymk/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1338:"<p><img class="alignnone size-full wp-image-9761" title="anton" src="http://weblogtoolscollection.com/wp-content/uploads/2011/03/anton.jpg" alt="" width="150" height="113" /></p>\n<p><a href="http://www.wpexplorer.com/anton-free-wordpress-theme.html"><strong>Anton</strong></a> is a very clean yet bold WordPress theme that is perfect for all sorts of blogs. It comes with a gray and red design and has been enhanced with some good premium-like features.</p>\n<p><img class="alignnone size-full wp-image-9762" title="europe" src="http://weblogtoolscollection.com/wp-content/uploads/2011/03/europe.jpg" alt="" width="150" height="113" /></p>\n<p><a href="http://wordpress.org/extend/themes/europe"><strong>Europe</strong></a> is clean, simple and stylish.</p>\n<p><img class="alignnone size-full wp-image-9764" title="minimal" src="http://weblogtoolscollection.com/wp-content/uploads/2011/03/minimal.jpg" alt="" width="150" height="113" /></p>\n<p><a href="http://www.club-wp.com/minimal-single-column-wordpress-theme/"><strong>Minimal</strong></a> is a very simple theme that should be easy to extend with your own styling should you want to. It has 3 widget areas in the footer for extra links and a navigation area in the header.</p>\n<img src="http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/Q31J_r-eymk" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 10 Mar 2011 14:00:35 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:10:"James Huff";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:12;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:40:"Publisher Blog: Jetpack by WordPress.com";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:43:"http://publisherblog.automattic.com/?p=1297";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:72:"http://publisherblog.automattic.com/2011/03/09/jetpack-by-wordpress-com/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:2382:"<p>Today Automattic (WordPress.com &amp; more) released <a href="http://www.jetpack.me">Jetpack</a>, a plugin that brings WordPress.com functionality to self-hosted WordPress users.</p>\n<p>Read <a href="http://jetpack.me/2011/03/09/blast-off/">the backstory from Matt on why Jetpack is so important for WordPress</a>.</p>\n<p><a href="http://www.jetpack.me"><img class="aligncenter size-full wp-image-1298" title="JetPack by WordPress.com" src="http://wordpresspublishers.files.wordpress.com/2011/03/picture-8.png?w=640&h=443" alt="" width="640" height="443" /></a></p>\n<p>[<a href="http://www.jetpack.me"><strong>Visit Jetpack.me</strong></a>]</p>\n<br />  <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gocomments/wordpresspublishers.wordpress.com/1297/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/comments/wordpresspublishers.wordpress.com/1297/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/godelicious/wordpresspublishers.wordpress.com/1297/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/delicious/wordpresspublishers.wordpress.com/1297/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gofacebook/wordpresspublishers.wordpress.com/1297/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/facebook/wordpresspublishers.wordpress.com/1297/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gotwitter/wordpresspublishers.wordpress.com/1297/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/twitter/wordpresspublishers.wordpress.com/1297/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gostumble/wordpresspublishers.wordpress.com/1297/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/stumble/wordpresspublishers.wordpress.com/1297/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/godigg/wordpresspublishers.wordpress.com/1297/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/digg/wordpresspublishers.wordpress.com/1297/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/goreddit/wordpresspublishers.wordpress.com/1297/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/reddit/wordpresspublishers.wordpress.com/1297/" /></a> <img alt="" border="0" src="http://stats.wordpress.com/b.gif?host=publisherblog.automattic.com&blog=1470857&post=1297&subd=wordpresspublishers&ref=&feed=1" width="1" height="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 10 Mar 2011 00:15:37 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:10:"Sara Rosso";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:13;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:44:"Alex King: Speaking About WordPress at SxSWi";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:27:"http://alexking.org/?p=5577";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:69:"http://alexking.org/blog/2011/03/09/speaking-about-wordpress-at-sxswi";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:2103:"<p>At SxSWi this year I&#8217;ll be joining <a href="http://shanepearlman.com/" rel="external">Shane Pearlman</a>, <a href="http://blog.epicerastudio.com/about/" rel="external">Brandon Jones</a> and <a href="http://www.remarkable-communication.com/about/" rel="external">Sonia Simone</a> on a panel entitled <a href="http://lanyrd.com/2011/sxsw/scbbc/" rel="external">Making Money with WordPress (Without Working at Automattic)</a>.<sup><a href="http://alexking.org/blog/topic/wordpress/feed#fn1299654342318n" id="fn1299654342318" class="footnote">1</a></sup></p>\n<p class="center"><a href="http://schedule.sxsw.com/events/event_IAP6179"><img src="http://img.sxsw.com/2011/logos/I_SeeMe.png" alt="See me at SxSW" /></a></p>\n<p>We&#8217;ll be on stage bright and early at 9:30am on Sunday. Get coffee on the way.</p>\n<p>I think it will be a pretty interesting discussion. We&#8217;ve got the major WordPress revenue streams (products, services, content) well covered, and each of us has a unique viewpoint on the WordPress community, ecosystem and marketplace.</p>\n<p>I expect to be talking primarily about my experience working with large engagements and building the team and complimentary services (<a href="http://backupmoxie.com">BackupMoxie</a>, <a href="http://cloudmoxie.com">CloudMoxie</a>) at <a href="http://crowdfavorite.com">Crowd Favorite</a> along with some lessons learned from my <a href="http://wphelpcenter.com">WordPress HelpCenter</a> experiment. But it&#8217;s a panel, so really the discussion could go anywhere. And that&#8217;s why it&#8217;s fun! <img src="http://alexking.org/wp/wp-includes/images/smilies/icon_smile.gif" alt=":)" class="wp-smiley" /> </p>\n<p>If you&#8217;d like to meet up at SxSW, please <a href="http://alexking.org/contact">get in touch</a>.</p>\n<ol class="footnotes">\n<li id="fn1299654342318n">My thanks to Shane for doing all the hard work and inviting me to participate. [<a href="http://alexking.org/blog/topic/wordpress/feed#fn1299654342318">back</a>]</li>\n</ol>\n<img src="http://alexking.org/wp/?ak_action=api_record_view&id=5577&type=feed" alt="" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_la