attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1573:"<p><a href="http://automattic.com/">Automattic</a> has <a href="http://jetpack.me/2011/03/09/blast-off/">just launched Jetpack</a>, a new plugin which allows self-hosted <a href="http://wordpress.org/">WordPress</a> users to enjoy several features previously available only to <a href="http://wordpress.com/">WordPress.com</a> blogs.</p>\n<p>Simply put, <a href="http://jetpack.me/">Jetpack</a> is a vehicle to bring some of the best WordPress.com features to your self-hosted WordPress blog, and it&#8217;s launching today with <a href="http://en.support.wordpress.com/gravatar-hovercards/">Gravatar Hovercards</a>, <a href="http://en.support.wordpress.com/stats/">WordPress.com Stats</a>, <a href="http://en.support.wordpress.com/widgets/twitter-widget/">the Twitter widget</a>, <a href="http://en.support.wordpress.com/shortcodes/">a wealth of cool shortcodes</a>, <a href="http://en.support.wordpress.com/shortlinks/">Shortlinks</a>, <a href="http://en.support.wordpress.com/latex/">LaTeX markup</a>, <a href="http://en.support.wordpress.com/sharing/">Sharedaddy</a>, and <a href="http://en.support.wordpress.com/proofreading/">After the Deadline</a>.</p>\n<p>Of course, these features are just the launch set. There are plenty more on the way, and all you need to do is watch for them to magically appear in your Jetpack panel.</p>\n<p>Have you tried Jetpack yet? What do you think of it so far?</p>\n<p><strong>Disclaimer:</strong> I work for Automattic, Inc.</p>\n<img src="http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/8IDmNiORGk8" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Wed, 09 Mar 2011 16:59:08 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:10:"James Huff";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:19;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:14:"Matt: Jetpack!";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:21:"http://ma.tt/?p=37920";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:29:"http://ma.tt/2011/03/jetpack/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:560:"<p>Remember <a href="http://ma.tt/2011/01/twenty-seven/">my resolution to</a> &#8220;Launch secret new thing, code abbreviation JP&#8221; &#8212; there was even <a href="http://wpcandy.com/gives-away/wp-swag-for-guessing-what-jp-is">a WP Candy thread guessing what it was</a>. Well it&#8217;s live, and <a href="http://jetpack.me/2011/03/09/blast-off/">you can click here to read all about Jetpack</a>. Check it out, every WordPress deserves a Jetpack. <img src="http://s.ma.tt/blog/wp-includes/images/smilies/icon_smile.gif" alt=":)" class="wp-smiley" /> </p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Wed, 09 Mar 2011 16:58:47 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:4:"Matt";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:20;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_bas