weblogtoolscollection/UXMP/~3/_O_nT1-1XyM/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1147:"<h3>New plugins</h3>\n<p><a href="http://www.club-wp.com/blogroll-to-page-wordpress-plugin/"><strong>Blogroll to Page</strong></a> outputs your blogroll links to any page or post on your blog by using its &#8216;blogroll-to-page&#8217; custom short code.</p>\n<p><a href="http://wordpress.org/extend/plugins/facebook-like-thumbnail/"><strong>Facebook Like Thumbnail</strong></a> will set the first image of the post as the thumbnail which shows up on FB like and share.</p>\n<h3>Updated plugins</h3>\n<p><a href="http://wordpress.org/extend/plugins/dukapress/"><strong>DukaPress</strong></a> is an open source and free to use e-commerce platform.</p>\n<p><a href="http://wordpress.org/extend/plugins/mute-screamer/"><strong>Mute Screamer</strong></a> uses PHPIDS to detect attacks on your WordPress site and reacts in a way that you choose.</p>\n<p><a href="http://sudarmuthu.com/wordpress/posts-by-tag"><strong>Posts By Tag</strong></a> provides sidebar widgets which can be used to display posts from a specific set of tags in the sidebar.</p>\n<img src="http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/_O_nT1-1XyM" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Tue, 08 Mar 2011 14:00:34 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:10:"James Huff";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:24;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a