-content/uploads/2011/03/pinkandpurple.jpg" alt="" width="150" height="113" /></p>\n<p><a href="http://wordpress.org/extend/themes/pink-and-purple"><strong>Pink and Purple</strong></a> has an esthetic tab menu in the header, with a modern background, and is widget ready.</p>\n<p><img class="alignnone size-full wp-image-9753" title="zeereputation" src="http://weblogtoolscollection.com/wp-content/uploads/2011/03/zeereputation.jpg" alt="" width="150" height="113" /></p>\n<p><a href="http://themezee.com/zeeReputation/"><strong>zeeReputation</strong></a> is a clean two column theme for personal blogs with several features: Custom Logo, Several Color Schemes, Custom Color via Colorpicker, Content Slider, 125&#215;125 Banner Widget, Dropdown Navigation, Google Analytics Integration and more.</p>\n<img src="http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/w4z95A9m6-c" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Sun, 06 Mar 2011 14:00:51 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:10:"James Huff";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:31;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:67:"WordPress.tv: Jessica Neuman Beck: Business Blogging for Nonwriters";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:27:"http://wordpress.tv/?p=4556";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:84:"http://wordpress.tv/2010/09/28/jess