ttribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:14:"blazestreaming";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:38;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:58:"Weblog Tools Collection: WordPress Plugin Releases for 3/4";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:40:"http://weblogtoolscollection.com/?p=9745";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:73:"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/ThaeZ2nMZx8/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:3161:"<h3>New plugins</h3>\n<p><a href="http://wordpress.org/extend/plugins/admin-bar-disabler/"><strong>Admin Bar Disabler</strong></a> allow you to disable the WP Admin Bar in 3.1+ entirely, or only for roles and capabilities which aren&#8217;t in the &#8216;whitelist&#8217; or &#8216;blacklist&#8217;.</p>\n<p><a href="http://wordpress.org/extend/plugins/admin-bar-minimiser/"><strong>Admin Bar Minimizer</strong></a> allows you to minimize/maximize the new WordPress 3.1 admin bar at the click of a button</p>\n<p><a href="http://www.designchemical.com/blog/index.php/wordpress-plugins/wordpress-plugin-jquery-drill-down-ipod-menu-widget/"><strong>jQuery Drill Down iPod Menu Widget</strong></a> allows you to create a drill down ipod style menu from any WordPress custom menu using jQuery.</p>\n<p><a href="http://www.designchemical.com/blog/index.php/wordpress-plugins/wordpress-plugin-jquery-drop-down-mega-menu-widget/"><strong>jQuery Drop Down Mega Menu Widget</strong></a> allows you to quickly and easily create drop down mega menus from any WordPress custom menu.</p>\n<p><a href="http://wordpress.org/extend/plugins/sdac-author-search/"><strong>SDAC Author Search</strong></a> gives logged in authors the ability to do a normal site search or the ability to search their content only.</p>\n<p><a href="http://wordpress.org/extend/plugins/unwanted-plugins-remover/"><strong>Unwanted Plugins Remover</strong></a> allows you to remove unwanted plugins on a WordPress core upgrade process.</p>\n<h3>Updated plugins</h3>\n<p><a href="http://wordpress.org/extend/plugins/crony/"><strong>Crony Cronjob Manager</strong></a> allows you to create and manage cronjobs in WP by running scripts, functions, and/or PHP code.</p>\n<p><a href="http://ocaoimh.ie/exploit-scanner/"><strong>Exploit Scanner</strong></a> searches the files on your website, and the posts and comments tables of your database for anything suspicious. It also examines your list of active plugins for unusual filenames.</p>\n<p><a href="http://wordpress.org/extend/plugins/exports-and-reports/"><strong>Exports and Reports</strong></a> allows you to define custom Exports / Reports (using MySQL queries) for users by creating each export / report and defining the fields as well as custom MySQL queries to run.</p>\n<p><a href="http://wordpress.org/extend/plugins/hotfix/"><strong>Hotfix</strong></a> provides fixes for selected WordPress bugs, so you don&#8217;t have to wait for the next WordPress core release.</p>\n<p><a href="http://www.designchemical.com/blog/index.php/wordpress-plugins/wordpress-plugin-jquery-vertical-accordion-menu-widget/"><strong>jQuery Vertical Accordion Menu Widget 2.0</strong></a> allows you to easily create multiple jQuery vertical accordion menus using the custom menus function.</p>\n<p><a href="http://wordpress.org/extend/plugins/theme-check/"><strong>Theme-Check</strong></a> allows you to run checks on the current theme before uploading to WordPress. This plugin uses the same API and is kept more or less in sync with the WordPress.org uploader tool.</p>\n<img src="http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/ThaeZ2nMZx8" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Fri, 04 Mar 2011 14:00:04 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:10:"James Huff";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:39;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:33:"Matt: Future of WordPress at SxSW";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:21:"http://ma.tt/?p=37917";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:49:"http://ma.tt/2011/03/future-of-wordpress-at-sxsw/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:325:"<p>On Friday at 3:30 I&#8217;m going to be interviewed onstage at SxSW by the formidable <a href="http://battellemedia.com/">John Battelle</a> on the Future of WordPress &#8212; <a href="http://austin2011.sched.org/event/9ad456c5a73523838e8fc5bda1a56f0e">you can see details here</a>. Would love to see some of you there.</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 03 Mar 2011 23:01:41 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:4:"Matt";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:40;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:49:"Weblog Tools Collection: Admin Bar Plugin Roundup";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:40:"http://weblogtoolscollection.com/?p=9739";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:73:"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/ipGU16wnp0M/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:2726:"<p>When <a href="http://wordpress.org/">WordPress</a> 3.1 premiered, the new admin bar was probably the most noticeable new feature. Hiding it is as simple as unchecking an option at Users -&gt; Your Profile in your Dashboard, but what if you&#8217;ve embraced the admin bar and actually want to add to it?</p>\n<p>As you may have expected, there&#8217;s already a healthy handful of plugins that add functionality to the admin bar.</p>\n<p><a href="http://wordpress.org/extend/plugins/admin-bar-id-menu/"><strong>Admin Bar ID Menu</strong></a> displays the ID number of the page, post, category, or tag you are looking at in the WordPress Admin Bar.</p>\n<p><a href="http://wordpress.org/extend/plugins/debug-bar/"><strong>Debug Bar</strong></a> adds a debug menu to the admin bar that shows query, cache, and other helpful debugging information. When WP_DEBUG is enabled, it also tracks PHP Warnings and Notices to make them easier to find. When SAVEQUERIES is enabled, the mysql queries are tracked and displayed.</p>\n<p><a href="http://wordpress.org/extend/plugins/debug-bar-console/"><strong>Debug Bar Console</strong></a> adds a PHP/MySQL console to the debug bar. (requires the Debug Bar plugin)</p>\n<p><a href="http://wordpress.org/extend/plugins/debug-bar-extender/"><strong>Debug Bar Extender</strong></a> adds more features to the debug bar and is mainly aimed at developers who like to debug their code or want to measure runtimes to find glitches in their code. It also allows lookup of variables by adding simple code snippets in your source. (requires the Debug Bar plugin)</p>\n<p><a href="http://wordpress.org/extend/plugins/logged-out-admin-bar/"><strong>Logged Out Admin Bar</strong></a> makes that admin bar always visible even for logged out users. Adds a login button when logged out, the shortlink also displays when available.</p>\n<p><a href="http://wordpress.org/extend/plugins/snack-bar/"><strong>Snack Bar</strong></a> adds a snack menu to the admin bar that provides quick access to blog/network admin screens for SuperAdmins.</p>\n<p><a href="http://wordpress.org/extend/plugins/stats/"><strong>WordPress.com Stats</strong></a> add a 48-hour stats chart for each page to the admin bar.</p>\n<p><a href="http://wordpress.org/extend/plugins/wp-custom-admin-bar/"><strong>WP Custom Admin Bar</strong></a> gives you options to change who sees the Admin Bar based on their user role, change or override the default styling, and remove the Admin Bar altogether.</p>\n<p>What do you think of the new admin bar? Are you using a plugin that we&#8217;ve missed? If so, we&#8217;d love to hear about it!</p>\n<img src="http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/ipGU16wnp0M" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 03 Mar 2011 14:00:08 +0000";s