tp://weblogtoolscollection.com/?p=9732";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:73:"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/YvJAhJ8wrO4/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:2122:"<p><img class="alignnone size-full wp-image-9733" title="keepcalm" src="http://weblogtoolscollection.com/wp-content/uploads/2011/03/keepcalm.jpg" alt="" width="150" height="113" /></p>\n<p><a href="http://www.polaraul.com/post/3446566790/keep-calm-and-drink-tea-wordpress-theme"><strong>Keep Calm And Drink Tea</strong></a> is a grunge type theme with a retro based feel.</p>\n<p><img class="alignnone size-full wp-image-9734" title="minimo" src="http://weblogtoolscollection.com/wp-content/uploads/2011/03/minimo.jpg" alt="" width="150" height="113" /></p>\n<p><a href="http://www.wpexplorer.com/minimo-wordpress-theme.html"><strong>Minimo</strong></a> is a next generation WordPress 3.1 theme that comes jam-packed with all the awesome new wp features. Plus, it has a clean and minimal design perfect for all sorts of blogs.</p>\n<p><img class="alignnone size-full wp-image-9735" title="pongsari" src="http://weblogtoolscollection.com/wp-content/uploads/2011/03/pongsari.jpg" alt="" width="150" height="113" /></p>\n<p><a href="http://www.dynamicwp.net/free-themes/pongsari-theme/"><strong>Pongsari</strong></a> is a simple and clean WP Theme, modified from TwentyTen.</p>\n<p><img class="alignnone size-full wp-image-9736" title="simpleblog" src="http://weblogtoolscollection.com/wp-content/uploads/2011/03/simpleblog.jpg" alt="" width="150" height="113" /></p>\n<p><a href="http://www.wpexplorer.com/simple-blog-wordpress-theme.html"><strong>Simple Blog</strong></a> is a theme for those that want a super clean and simple blogging solution while still keeping some premium-like features.</p>\n<p><img class="alignnone size-full wp-image-9737" title="zeemagazine" src="http://weblogtoolscollection.com/wp-content/uploads/2011/03/zeemagazine.jpg" alt="" width="150" height="113" /></p>\n<p><a href="http://themezee.com/zeeMagazine/"><strong>zeeMagazine</strong></a> is a clean two column theme in magazine style with great features: Costum Logo, Colorpicker, Content Slider, Shortcodes, Dropdown Navigation and more.</p>\n<img src="http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/YvJAhJ8wrO4" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Wed, 02 Mar 2011 14:00:47 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:10:"James Huff";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:45;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:16:"Matt: Enterproid";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:21:"http://ma.tt/?p=37913";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:32:"http://ma.tt/2011/03/enterproid/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:795:"<p>Last year <a href="http://audrey.co/">Audrey</a> made an investment in <a href="http://www.enterproid.com/">Enterproid, which just came out of stealth</a>. Basically it&#8217;s a mod of Android that creates a virtualized environment so you can separate your work stuff and personal stuff, and be able to do fun stuff on your phone that everyone expects but not many IT departments allow. They&#8217;ve gotten good coverage <a href="http://techcrunch.com/2011/02/28/enterproid-separates-professional-and-personal-lives-on-android-phones/">on TechCrunch</a> <a href="http://www.readwriteweb.com/archives/enteproid_work_and_play_safely_coexist_on_your_mobile_phone.php">and ReadWriteWeb</a>, and just won several hundred thousand dollars from the QPrize and presented at the DEMO conference.</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Wed, 02 Mar 2011 05:12:41 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:4:"Matt";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:46;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:41:"Matt: WordPress SxSW party — 15 invites";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:21:"http://ma.tt/?p=37883";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:32:"http://ma.tt/2011/03/sxsw-party/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:568:"<p>A few super-hip folks (Automattic, Wall Street Journal, and HostGator) are hosting a WordPress party with open bar and all-you-can-eat BBQ on Friday night at SxSW (<a href="http://automattic.files.wordpress.com/2011/02/sxsw-invite1.jpg">deets here</a>) but it&#8217;s invite only and there&#8217;ll be a list at the door. (We can only feed so many people!) However I have 15 spaces to give away to Ma.tt readers, which will go to the first 15 people to comment with a link to an image of the WP logo in a cool place (Photoshop allowed) and your WP-powered blog.</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Wed, 02 Mar 2011 00:20:27 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:4:"Matt";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:47;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:69:"Publisher Blog: Elance: WordPress #2 for Top Overall Skills in Demand";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:43:"http://publisherblog.automattic.com/?p=1271";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:79:"http://publisherblog.automattic.com/2011/03/01/elance-wordpress-top-cms-choice/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:3104:"<p>Elance&#8217;s 2010 Q4 Online Employment Report catapults WordPress into the #2 spot for <strong>Top Overall Skills in Demand.</strong> WordPress has made a steady climb in the Skills in Demand ranking, listed as <a href="http://publisherblog.automattic.com/2009/05/20/wordpress-elance/">#13 in May 2009</a> and <a href="http://publisherblog.automattic.com/2010/09/01/wordpress-top-elance/">#6 in September 2010</a>.</p>\n<p>&#8220;A number of popular open-source platforms like Drupal and Joomla! are  available for online content, but over the course of 2010, <strong>WordPress appears to have moved from top contender to top choice</strong>:  Demand for WordPress experts rose an impressive 15%  quarter-over-quarter, moving up three highly coveted spots to #2,  trailing only behind PHP programmers. <strong>This marks the first time  that any content management system has moved into the top three skills  in demand by businesses, solidifying it as the undisputed champ of  content, for now</strong>.&#8221;</p>\n<p><strong><a><img class="aligncenter size-full wp-image-1278" title="Picture 2" src="http://wordpresspublishers.files.wordpress.com/2011/03/picture-2.png?w=269&h=252" alt="" width="269" height="252" /></a><br />\n</strong></p>\n<p>[<a href="http://www.elance.com/p/online-employment-report.html">Read more in Elance''s Online Employment Report</a>]</p>\n<br />  <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gocomments/wordpresspublishers.wordpress.com/1271/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/comments/wordpresspublishers.wordpress.com/1271/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/godelicious/wordpresspublishers.wordpress.com/1271/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/delicious/wordpresspublishers.wordpress.com/1271/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gofacebook/wordpresspublishers.wordpress.com/1271/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/facebook/wordpresspublishers.wordpress.com/1271/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gotwitter/wordpresspublishers.wordpress.com/1271/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/twitter/wordpresspublishers.wordpress.com/1271/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gostumble/wordpresspublishers.wordpress.com/1271/"><img alt="" border="0" src="http://feeds.wordpress.c