nt. If you don&#8217;t have google + account then you can as for invite on <a href="http://googleplusinvitations.com" title="Google Plus Invitations" target="_blank">GooglePlusInvitations.com</a>.</p>\n<p>Add following lines of code inside your themes functions.php file. Make sure to add code inside PHP tag.</p>\n<div id="attachment_1417" class="wp-caption aligncenter" style="width: 388px"><img src="http://www.snilesh.com/wp-content/uploads/2011/08/google-plus-features.jpg" alt="" title="google-plus-features" width="378" height="230" class="size-full wp-image-1417" /><p class="wp-caption-text">Google Plus Features</p></div>\n<pre class="brush: php; title: ; notranslate">\nfunction google_plus_feed($id,$items=5)\n	{\n		$feed=''http://plusfeed.appspot.com/''.$id;\n		include_once(ABSPATH.WPINC.''/rss.php'');\n		$rss = fetch_feed($feed);\n		if (!is_wp_error( $rss ) ) : // Checks that the object is created correctly\n	    // Figure out how many total items there are, but limit it to 5.\n		$maxitems = $rss-&gt;get_item_quantity($items);\n	    // Build an array of all the items, starting with element 0 (first element).\n		$rss_items = $rss-&gt;get_items(0, $maxitems);\n		?&gt;\n		&lt;ul&gt;\n		&lt;?php if ($maxitems == 0) echo ''&lt;li&gt;No items.&lt;/li&gt;'';\n		else\n		// Loop through each feed item and display each item as a hyperlink.\n		foreach ( $rss_items as $item ) : ?&gt;\n		&lt;li&gt;\n		&lt;a href=''&lt;?php echo esc_url( $item-&gt;get_permalink() ); ?&gt;'' title=''''&gt;\n		&lt;?php echo esc_html( $item-&gt;get_title() ); ?&gt;&lt;/a&gt;\n		&lt;small&gt;&lt;?php echo ''Posted On''.$item-&gt;get_date(''j F Y | g:i a''); ?&gt;&lt;/small&gt;\n		&lt;/li&gt;\n		&lt;?php endforeach; ?&gt;\n		&lt;/ul&gt;\n		&lt;?php\n		endif;\n	}\n</pre>\n<p>After that call add following lines of code inside your theme&#8217;s php file where you want to display your latest updates</p>\n<pre class="brush: php; title: ; notranslate">\n        if(function_exists(''google_plus_feed''))\n	{\n	google_plus_feed(''100104078886116260091'',5); /* Replace 100104078886116260091 with your google Plus ID */\n	}\n</pre>\n<p>In above function call first parameter is your google plus id check following image to see what is google plus id. To get your google plus id visit your google plus profile page and check your address bar. </p>\n<p>And second parameter is number of updates you want to display.</p>\n<div id="attachment_1415" class="wp-caption aligncenter" style="width: 512px"><img src="http://www.snilesh.com/wp-content/uploads/2011/08/google_plus_id.jpg" alt="" title="google_plus_id" width="502" height="159" class="size-full wp-image-1415" /><p class="wp-caption-text">Where to find your Google Plus ID</p></div>\n<p><a href="http://feedads.g.doubleclick.net/~a/41OfdJ42d8TM2VavWvpenVyyf18/0/da"><img src="http://feedads.g.doubleclick.net/~a/41OfdJ42d8TM2VavWvpenVyyf18/0/di" border="0" ismap="true"></img></a><br/>\n<a href="http://feedads.g.doubleclick.net/~a/41OfdJ42d8TM2VavWvpenVyyf18/1/da"><img src="http://feedads.g.doubleclick.net/~a/41OfdJ42d8TM2VavWvpenVyyf18/1/di" border="0" ismap="true"></img></a></p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:103:"http://www.snilesh.com/resources/wordpress/display-your-latest-5-google-updates-on-wordpress-blog/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:3;a:6:{s:4:"data";s:41:"\n		\n		\n		\n		\n		\n				\n\n		\n		\n			\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:5:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:17:"Google Plus Theme";s:7:"a