ired by new media and social networking site Google +. As the Google network, and users are growing much faster than any other social networking platform.</p>\n<p><img class="aligncenter size-full wp-image-1395" title="google_plus_preview" src="http://www.snilesh.com/wp-content/uploads/2011/07/google_plus_preview.jpg" alt="" width="550" height="344" /></p>\n<h3>Google Theme Features</h3>\n<ul>\n<li>Google Plus UI Inspired</li>\n<li>Minimalist, 3 Columns Layout</li>\n<li>Left And Right Sidebars Enabled</li>\n<li>Theme Options Panel for settings</li>\n<li>Compitable with Custom Menus</li>\n<li>Google AdSense Enabled</li>\n<li>Custom Avatar Enabled</li>\n<li>Post Thumbnails Enabled</li>\n<li>Fixed Theme Width</li>\n<li>Valid CSS and XHTML</li>\n<li>Licensed Under GPL</li>\n</ul>\n<p>Download <strong>Free wordpress theme</strong> from following link</p>\n<p><a href="http://privatehostingclub.com/" title="google plus wp theme demo" target="_blank"><img src="http://www.snilesh.com/wp-content/uploads/2011/07/button-basic-demo.png" alt="" title="button-basic-demo" width="274" height="45" class="alignnone size-full wp-image-1422" /></a>&nbsp;<a href="http://googlepluswordpresstheme.com/" title="google plus wp theme download" target="_blank"><img src="http://www.snilesh.com/wp-content/uploads/2011/07/button-basic-download.png" alt="" title="button-basic-download" width="274" height="45" class="alignnone size-full wp-image-1420" /></a></p>\n<p>And if you want premium theme with more features then you can signup on this website for updates.</p>\n<p><a href="http://googlepluswptheme.com/" title="google plus premium theme" target="_blank"><img src="http://www.snilesh.com/wp-content/uploads/2011/07/button-premium.jpg" alt="google plus premium theme" title="button-premium" width="560" height="45" class="aligncenter size-full wp-image-1410" /></a></p>\n<p><a href="http://feedads.g.doubleclick.net/~a/3EtSr47L0jd3h60FDjkswqXxSCU/0/da"><img src="http://feedads.g.doubleclick.net/~a/3EtSr47L0jd3h60FDjkswqXxSCU/0/di" border="0" ismap="true"></img></a><br/>\n<a href="http://feedads.g.doubleclick.net/~a/3EtSr47L0jd3h60FDjkswqXxSCU/1/da"><img src="http://feedads.g.doubleclick.net/~a/3EtSr47L0jd3h60FDjkswqXxSCU/1/di" border="0" ismap="true"></img></a></p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:68:"http://www.snilesh.com/free-wordpress-themes/google-plus-theme/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"9";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:4;a:6:{s:4:"data";s:44:"\n		\n		\n		\n		\n		\n				\n		\n\n		\n		\n			\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:5:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:47:"Twitter Facebook Like Time Difference using PHP";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:85:"http://www.snilesh.com/resources/php/twitter-facebook-like-time-difference-using-php/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:94:"http://www.snilesh.com/resources/php/twitter-facebook-like-time-difference-using-php/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 18 Jul 2011 09:17:36 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:2:{i:0;a:5:{s:4:"data";s:3:"PHP";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:8:"snippets";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:30:"http://www.snilesh.com/?p=1389";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:288:"If you want to display time difference like twitter,facebook using PHP function then use following function which outputs time difference like 20 minutes ago,2 days ago,1 week<a href="http://www.snilesh.com/resources/php/twitter-facebook-like-time-difference-using-php/"> Read More...</a>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:7:"snilesh";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:1994:"<p>If you want to display time difference like twitter,facebook using PHP function then use following function which outputs time difference like 20 minutes ago,2 days ago,1 week ago</p>\n<pre class="brush: php; title: ; notranslate">\nfunction time_difference($date)\n{\n    if(empty($date)) {\n        return &quot;No date provided&quot;;\n    }\n\n    $periods         = array(&quot;second&quot;, &quot;minute&quot;, &quot;hour&quot;, &quot;day&quot;, &quot;week&quot;, &quot;month&quot;, &quot;year&quot;, &quot;decade&quot;);\n    $lengths         = array(&quot;60&quot;,&quot;60&quot;,&quot;24&quot;,&quot;7&quot;,&quot;4.35&quot;,&quot;12&quot;,&quot;10&quot;);\n\n    $now             = time();\n    $unix_date         = strtotime($date);\n\n       // check validity of date\n    if(empty($unix_date)) {\n        return &quot;Bad date&quot;;\n    }\n\n    // is it future date or past date\n    if($now &gt; $unix_date) {\n        $difference     = $now - $unix_date;\n        $tense         = &quot;ago&quot;;\n\n    } else {\n        $difference     = $unix_date - $now;\n        $tense         = &quot;from now&quot;;\n    }\n\n    for($j = 0; $difference &gt;= $lengths[$j] &amp;&amp; $j &lt; count($lengths)-1; $j++) {\n        $difference /= $lengths[$j];\n    }\n\n    $difference = round($difference);\n\n    if($difference != 1) {\n        $periods[$j].= &quot;s&quot;;\n    }\n\n    return &quot;$difference $periods[$j] {$tense}&quot;;\n}\n</pre>\n<p>call this function as </p>\n<pre class="brush: php; title: ; notranslate">\n$date = &quot;2010-07-16 17:45&quot;;\n$result = time_difference($date); // 1 year ago\n</pre>\n<p><a href="http://feedads.g.doubleclick.net/~a/B8T-hR7ocDmQ5u0NCqfR_86B350/0/da"><img src="http://feedads.g.doubleclick.net/~a/B8T-hR7ocDmQ5u0NCqfR_86B350/0/di" border="0" ismap="true"></img></a><br/>\n<a href="http://feedads.g.doubleclick.net/~a/B8T-hR7ocDmQ5u0NCqfR_86B350/1/da"><img src="http://feedads.g.doubleclick.net/~a/B8T-hR7ocDmQ5u0NCqfR_86B350/1/di" border="0" ismap="true"></img></a></p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:90:"http://www.snilesh.com/resources/php/twitter-facebook-like-time-difference-using-php/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:5;a:6:{s:4:"data";s:50:"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n\n		\n		\n			\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:5:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:28:"wordpress membership plugins";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:72:"http://www.snilesh.com/resources/wordpress/wordpress-membership-plugins/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:81:"http://www.snilesh.com/resources/wordpress/wordpress-membership-plugins/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Sun, 17 Jul 2011 07:12:19 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:4:{i:0;a:5:{s:4:"data";s:9:"Wordpress";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:8:"affliate";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:2;a:5:{s:4:"data";s:10:"membership";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:3;a:5:{s:4:"data";s:15:"private content";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:30:"http://www.snilesh.com/?p=1359";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:256:"WordPress is becoming more popular with new features. When wordpress was first released it was just a bloging script but now you can use wordpress to create<a href="http://www.snilesh.com/resources/wordpress/wordpress-membership-plugins/"> Read More...</a>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:7:"snilesh";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:6085:"<p>WordPress is becoming more popular with new features. When wordpress was first released it was just a bloging script but now you can use wordpress to create CMS websites.</p>\n<p>You can use wordpress to create a membership websites. But for that you want good membership plugins. In this post i added popular <strong>wordpress membership plugins</strong> with their features.</p>\n<p>Using membership plugins you can restrict access to your website according to membership levels.</p>\n<div class="clear"></div>\n<h3>1] <a href="http://www.sniesh.com/go/magic-members" title="Wordpress Magic Members" target="_blank">Magic Members</a></h3>\n<div id="attachment_1364" class="wp-caption alignleft" style="width: 210px"><a href="http://www.sniesh.com/go/magic-members" title="Magic Members" target="_blank"><img src="http://www.snilesh.com/wp-content/uploads/2011/07/magic_members.jpg" alt="wordpress magic members" title="magic_members" width="200" height="167" class="size-full wp-image-1364" /></a><p class="wp-caption-text">wordpress magic members</p></div> Magic Members is a premium WordPress Membership Plugin that turns your WordPress blog into a powerful, fully automated membership site. </p>\n<ol>\n<li>Unlimited Membership Levels</li>\n<li>Payment Integration Modules</li>\n<li>Control Subscription Length</li>\n<li>Unlimited Coupon Creation</li>\n<li>Pay Per Post Access</li>\n<li>Entire Blog Protection</li>\n<li>Download Manager</li>\n</ol>\n<p><div class="separator"></div>\n<h3>2] <a href="http://www.snilesh.com/go/wp-emember" title="Wordpress eMember Plugin" target="_blank">eMember</a></h3>\n<div id="attachment_1370" class="wp-caption alignleft" style="width: 210px"><a href="http://www.snilesh.com/go/wp-emember" title="Wordpress eMember Plugin" target="_blank"><img src="http://www.snilesh.com/wp-content/uploads/2011/07/wp-emember.png" alt="Wordpress eMember Plugin" title="wp-emember" width="200" height="240" class="size-full wp-image-1370" /></a><p class="wp-caption-text">Wordpress eMember Plugin</p></div><br />\nWordPress eMember is a WordPress Membership Plugin that can turn your existing or new WordPress site into a membership site easily. You can selectively protect articles by creating various membership levels (eg. Free, Basic, Premium, Ultimate) and protect the content (posts, pages etc) of your site. The plugin manages all the membership management side of things.</p>\n<ol>\n<li>Content Protection</li>\n<li>Easy PayPal Integration</li>\n<li>Autoresponder Integration</li>\n<li>WP eStore Integration</li>\n</ol>\n<div class="clear"></div>\n<p><div class="separator"></div>\n<h3>3] <a href="http://www.snilesh.com/go/wordpress-premium-content" target="_blank" title="WordPress Premium Content" >WordPress Premium Content</a></h3>\n<div id="attachment_1374" class="wp-caption alignleft" style="width: 210px"><a href="http://www.snilesh.com/go/wordpress-premium-content" title="wordpress premium content" target="_blank"><img src="http://www.snilesh.com/wp-content/uploads/2011/07/wordpress-premium-content.jpg" alt="wordpress premium content" title="wordpress-premium-content" width="200" height="186" class="size-full wp-image-1374" /></a><p class="wp-caption-text">Wordpress Premium Content</p></div><br />\nJigowatt’s WordPress Premium Content plugin allows you to easily set up a web site with content which is only accessible to users registered with an active PayPal subscription. You can easily manage your subscribers, change subscription prices and set up custom membership renewal options (annual, bi-annual or just month by month).</p>\n<div class="clear"></div>\n<p><div class="separator"></div>\n<h3>4] <a href="http://www.snilesh.com/go/wishlist-member" title="WishList Member" target="_blank">WishList Member</a></h3>\n<div id="attachment_1381" class="wp-caption alignleft" style="width: 210px"><a href="http://www.snilesh.com/go/wishlist-member" target="_blank" title="wordpress wishlist member"><img src="http://www.snilesh.com/wp-content/uploads/2011/07/wishlist_members.jpg" alt="wishlist members" title="wishlist_members" width="200" height="167" class="size-full wp-image-1381" /></a><p class="wp-caption-text">Wordpress Wishlist Member</p></div><br />\nWishList Member is a powerful solution for creating an online membership site – all built using WordPress as the core content management system.<br />\nTrusted by over 6100+ people as their preferred membership solution, it’s never been easier to control access to your content, accept payments, manage your members and so much more!</p>\n<div class="clear"></div>\n<p><div class="separator"></div>\n<h3>5] <a href="http://www.snilesh.com/go/wp-premium-members" title="WP Premium Members + Pre Advertisements admin" target="_blank">WP Premium Members + Pre Advertisements admin</a></h3>\n<p><div id="attachment_1383" class="wp-caption alignleft" style="width: 230px"><a href="http://www.snilesh.com/go/wp-premium-members" title="wordpress premium members" target="_blank"><img src="http://www.snilesh.com/wp-content/uploads/2011/07/wp-premium-members.jpg" alt="wordpress premium members" title="wp-premium-members" width="220" height="112" class="size-full wp-image-1383" /></a><p class="wp-caption-text">wordpress premium members</p></div><br />\nThis plugin is more than just a normal Membership plugin. Beside displaying Premium content to your paying members only, this plugin also manages Pre Post Advertisements. This plugin is designed to work both as a standalone premium membership plugin and it work’s together and extends the possibilities of the <a href="http://www.snilesh.com/go/wp-premium-members" title="Wordpress Premium Members" target="_blank">WP Pre Advertisement plugin</a>.</p>\n<p><a href="http://feedads.g.doubleclick.net/~a/KdGZmgj5HzbrjN-VeIqav23mCl4/0/da"><img src="http://feedads.g.doubleclick.net/~a/KdGZmgj5HzbrjN-VeIqav23mCl4/0/di" border="0" ismap="true"></img></a><br/>\n<a href="http://feedads.g.doubleclick.net/~a/KdGZmgj5HzbrjN-VeIqav23mCl4/1/da"><img src="http://feedads.g.doubleclick.net/~a/KdGZmgj5HzbrjN-VeIqav23mCl4/1/di" border="0" ismap="true"></img></a></p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:77:"http://www.snilesh.com/resources/wordpress/wordpress-membership-plugins/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"1";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:6;a:6:{s:4:"data";s:44:"\n		\n		\n		\n		\n		\n				\n		\n\n		\n		\n			\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:5:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:22:"WordPress 3.2 features";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:66:"http://www.snilesh.com/resources/wordpress/wordpress-3-2-features/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:75:"http://www.snilesh.com/resources/wordpress/wordpress-3-2-features/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 11 Jul 2011 08:54:41 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:2:{i:0;a:5:{s:4:"data";s:9:"Wordpress";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:21:"wordpress new release";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:30:"http://www.snilesh.com/?p=1338";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:245:"WordPress 3.2 is now available to the world, both as an update in your dashboard and a download on WordPress.org. The focus for this release was making<a href="http://www.snilesh.com/resources/wordpress/wordpress-3-2-features/"> Read More...</a>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:7:"snilesh";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:4708:"<p>WordPress 3.2 is now available to the world, both as an update in your dashboard and a download on WordPress.org. </p>\n<p>The focus for this release was making WordPress faster and lighter. The first thing you’ll notice when you log in to 3.2 is a refreshed dashboard design that tightens the typography, design, and code behind the admin.</p>\n<div class="clear"></div>\n<h2>Whats New in WordPress 3.2</h2>\n<h4>1] WordPress 3.2 Minimum Requirements</h4>\n<p>Major Change in WordPress 3.2 they officially drops support for older versions of PHP and MySQL. So PHP4 and MySql 4 will no longer supported by wordpress 3.2<br />\n<a href="http://wordpress.org/news/2011/07/are-you-ready-for-wordpress-3-2/" target="_blank" title="Wordpress 3.2 minimum requirements"><img src="http://www.snilesh.com/wp-content/uploads/2011/07/wordpress3_2_features1.jpg" alt="" title="wordpress3_2_features1" width="639" height="152" class="aligncenter size-full wp-image-1340" /></a><br />\nWordPress 3.2 doesn’t actually do anything that requires PHP 5, so it is a first step in that direction. Moving to PHP 5 and MySQL 5 means that future versions of WordPress can be lighter, take advantage of more new features and be better optimized for performance.</p>\n<h4>2] No Browser Support to IE6</h4>\n<p><img src="http://www.snilesh.com/wp-content/uploads/2011/07/wordpress3_2_ie_warning.png" alt="" title="wordpress3_2_ie_warning" width="440" height="187" class="aligncenter size-full wp-image-1341" /><br />\nWhen you login to your wordpress admin using IE6 you will see new warning screen saying &#8220;You are an insecure Browser&#8221;. You can still use wordpress dashboard using IE6 but it won&#8217;t look good.</p>\n<h4>3] New TwentyEleven WordPress  Theme</h4>\n<p>Twenty Eleven is the default theme for WordPress in 2011. There are tons of really cool improvements and features packed into it — more Post Formats, beautiful new header images, alternate color schemes and layouts, even custom link colors.<br />\n<div id="attachment_1344" class="wp-caption aligncenter" style="width: 650px"><a href="http://theme.wordpress.com/themes/twentyeleven/" target="_blank" title="Wordpress TwentyEleven Theme"><img src="http://www.snilesh.com/wp-content/uploads/2011/07/twenty-eleven-wordpress-theme.jpg" alt="" title="twenty-eleven-wordpress-theme" width="640" height="360" class="size-full wp-image-1344" /></a><p class="wp-caption-text">Wordpress TwentyEleven Theme</p></div><br />\nAll those features add up to the best part of Twenty Eleven: just how customizable it is. It looks great as a blog, a showcase of all your posts, and even a tumblelog or photolog.</p>\n<h4>4] New Writing Mode</h4>\n<p>WordPress 3.2 comes with new writing mode in full screen. When you enter in full screen mode you can write your posts or pages without any distraction.<br />\n<div id="attachment_1348" class="wp-caption aligncenter" style="width: 610px"><img src="http://www.snilesh.com/wp-content/uploads/2011/07/wordpress3_2_fullscreen_mode.jpg" alt="" title="wordpress3_2_fullscreen_mode" width="600" height="318" class="size-full wp-image-1348" /><p class="wp-caption-text">Wordpress 3.2 FullScreen Mode</p></div></p>\n<h4>5] New Dashboard Look</h4>\n<p>WordPress 3.2 comes with new dashboard look. For more details of design changes check following posts.</p>\n<ul>\n<li><a href="http://mattnt.com/2011/07/05/design-in-wordpress-3-2/" title="Design In WordPress 3.2 By Matt Thomas" target="_blank">Design In WordPress 3.2 By Matt Thomas</a></li>\n<li><a href="http://wpcandy.com/presents/wordpress-32-redesign-comparison-gallery" title="Wordpress 3.2 Redesign Compatison Gallery By WpCandy.com" target="_blank">WordPress 3.2 Redesign Compatison Gallery By WpCandy.com</a></li>\n<li><a href="http://mashable.com/2011/07/10/wordpress-3-2-guide/" title="Wordpress 3.2 Guide" target="_blank">WordPress 3.2 Guide</a></li>\n<li><a href="http://codex.wordpress.org/Version_3.2" target="_blank" title="Wordpress 3.2 Release">WordPress Codex</a></li>\n</ul>\n<h3>WordPress 3.2 Video Tour</h3>\n<p><embed type="application/x-shockwave-flash" src="http://s0.videopress.com/player.swf?v=1.02" width="600" height="300" wmode="direct" seamlesstabbing="true" allowfullscreen="true" allowscriptaccess="always" overstretch="true" flashvars="guid=ac07H291"></embed></p>\n<p><a href="http://feedads.g.doubleclick.net/~a/9mMjeKgSRWyOpJ1mburaT3BBsUo/0/da"><img src="http://feedads.g.doubleclick.net/~a/9mMjeKgSRWyOpJ1mburaT3BBsUo/0/di" border="0" ismap="true"></img></a><br/>\n<a href="http://feedads.g.doubleclick.net/~a/9mMjeKgSRWyOpJ1mburaT3BBsUo/1/da"><img src="http://feedads.g.doubleclick.net/~a/9mMjeKgSRWyOpJ1mburaT3BBsUo/1/di" border="0" ismap="true"></img></a></p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:71:"http://www.snilesh.com/resources/wordpress/wordpress-3-2-features/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"2";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:7;a:6:{s:4:"data";s:41:"\n		\n		\n		\n		\n		\n				\n\n		\n		\n			\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:5:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:21:"WordPress themes Free";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:65:"http://www.snilesh.com/resources/wordpress/wordpress-themes-free/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:74:"http://www.snilesh.com/resources/wordpress/wordpress-themes-free/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Fri, 08 Jul 2011 17:39:00 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:1:{i:0;a:5:{s:4:"data";s:9:"Wordpress";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:30:"http://www.snilesh.com/?p=1300";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:257:"Now days wordpress themes which have theme options in admin section are becoming more popular than traditional wordpress blog themes. In this post you will find all<a href="http://www.snilesh.com/resources/wordpress/wordpress-themes-free/"> Read More...</a>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:7:"snilesh";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:10450:"<p>Now days wordpress themes which have theme options in admin section are becoming more popular than traditional wordpress blog themes. In this post you will find all the latest <strong>wordpress free themes</strong> created for different types of websites from normal wordpress blogs to portfolio or magazine style wordpress themes.</p>\n<div class="clear"></div>\n<h3>Minimal wordpress themes</h3>\n<h5>Expositio</h5>\n<p>Expositio is a very simple &#038; free portfolio WordPress theme for photographers, designers &#038; artists.<br />\n<a href="http://wpshower.com/themes/expositio/"><img src="http://www.snilesh.com/wp-content/uploads/2011/07/expositio-wordpress-theme.jpg" alt="expositio wordpress theme" title="expositio-wordpress-theme" width="500" height="311" class="aligncenter size-full wp-image-1301" /></a><br />\n<a class="btn_arrow" href="http://wpshower.com/themes/expositio/"><span>Demo</span></a> <a class="btn_arrow" href="http://wpshower.com/themes/expositio/"><span>Download</span></a></p>\n<div class="clear"></div>\n<div class="separator"></div>\n<h5>Extricate</h5>\n<p>Extricate is a clean, minimal theme built on HTML5 and CSS3. The options page allows you to resize columns and specify post information.<br />\n<a href="http://extricate.snoother.com/"><img src="http://www.snilesh.com/wp-content/uploads/2011/07/extricate-screenshot.jpg" alt="extricate theme" title="extricate-screenshot" width="500" height="166" class="aligncenter size-full wp-image-1307" /></a><br />\n<a class="btn_arrow" href="http://extricate.snoother.com/"><span>Demo</span></a> <a class="btn_arrow" href="http://www.snoother.com/extricate/"><span>Download</span></a></p>\n<div class="clear"></div>\n<div class="separator"></div>\n<h5>Renova</h5>\n<p>Renova, a new single column theme for wordpress.The main design of renova is concentrated on a minimal style dedicated to those writers who need a simple layout without any kind of useless stuff.Just words, your words.<br />\n<a href="http://renova.llow.it/"><img src="http://www.snilesh.com/wp-content/uploads/2011/07/renova-preview.jpg" alt="renova theme" title="renova-preview" width="500" height="220" class="aligncenter size-full wp-image-1309" /></a><br />\n<a class="btn_arrow" href="http://renova.llow.it/"><span>Demo</span></a> <a class="btn_arrow" href="http://www.llow.it/renova/"><span>Download</span></a></p>\n<div class="clear"></div>\n<div class="separator"></div>\n<h5>Simply Delicious</h5>\n<p>This minimalist theme features big images, a clean style and easy browsing: perfect for modern blogs and portfolios.<br />\n<a href="http://theme.mmminimal.com/"><img src="http://www.snilesh.com/wp-content/uploads/2011/07/simple_delicious.jpg" alt="" title="simple_delicious" width="606" height="213" class="aligncenter size-full wp-image-1311" /></a><br />\n<a class="btn_arrow" href="http://theme.mmminimal.com/"><span>Demo</span></a> <a class="btn_arrow" href="http://mmminimal.com/wordpress-theme/"><span>Download</span></a></p>\n<div class="clear"></div>\n<div class="separator"></div>\n<h5>wordfinder</h5>\n<p>Wordfinder is a simple magazine-style theme for users who want to start a blog with a minimal layout. The theme has many layout features, including two home page styles and six colors for links and hover effects that are easily customizable via the options page.<br />\n<a href="http://wordfinder.llow.it/wordpress/" target="_blank"><img src="http://www.snilesh.com/wp-content/uploads/2011/07/wordfinder-preview.jpg" alt="wordfinder theme" title="wordfinder-preview" width="500" height="162" class="aligncenter size-full wp-image-1313" /></a><br />\n<a class="btn_arrow" href="http://wordfinder.llow.it/wordpress/"><span>Demo</span></a> <a class="btn_arrow" href="http://www.llow.it/wordfinder/"><span>Download</span></a></p>\n<div class="clear"></div>\n<div class="separator"></div>\n<h5>Mini Hyper</h5>\n<p>Mini Hyper comes with a basic options page where you can add your analytics tracking code and change the logo. Other than that, Mini Hyper is widget-ready and works in all browsers.</p>\n<p><a href="http://wpstyles.org/minihyper/" title="Mini Hyper" target="_blank"><img src="http://www.snilesh.com/wp-content/uploads/2011/07/sm_wordpress_theme_preview.jpg" alt="" title="sm_wordpress_theme_preview" width="500" height="177" class="aligncenter size-full wp-image-1315" /></a></p>\n<a class="btn_arrow" href="http://wpstyles.org/minihyper/"><span>Demo</span></a> <a class="btn_arrow" href="http://wpstyles.org/wordpress/mini-hyper-a-free-minimalistic-wordpress-theme/"><span>Download</span></a>\n<div class="clear"></div>\n<div class="separator"></div>\n<h5>Delicate</h5>\n<p>Delicate is a clean, minimalist theme with a focus on typography and structure.<br />\n<a href="http://test.nattywp.com/?preview_theme=Delicate" target="_blank" title="Delicate wordpress theme"><img src="http://www.snilesh.com/wp-content/uploads/2011/07/delicate_wordpress_theme.jpg" alt="delicate theme" title="delicate_wordpress_theme" width="500" height="177" class="aligncenter size-full wp-image-1317" /></a><br />\n<a class="btn_arrow" href="http://test.nattywp.com/?preview_theme=Delicate"><span>Demo</span></a> <a class="btn_arrow" href="http://www.nattywp.com/view-natty-theme.php?theme_id=99900&#038;theme_name=Delicate"><span>Download</span></a></p>\n<div class="clear"></div>\n<div class="separator"></div>\n<h5>Melville</h5>\n<p>Melville was inspired by classic literature. It has no distractions; just a simple design that focuses the reader on your writing.<br />\n<a href="http://demo.madebyraygun.com/melville/" target="_blank" title="Melville theme"><img src="http://www.snilesh.com/wp-content/uploads/2011/07/melville_preview.jpg" alt="melville theme" title="melville_preview" width="500" height="183" class="aligncenter size-full wp-image-1319" /></a><br />\n<a class="btn_arrow" href="http://demo.madebyraygun.com/melville/"><span>Demo</span></a> <a class="btn_arrow" href="http://madebyraygun.com/lab/melville/"><span>Download</span></a></p>\n<div class="clear"></div>\n<div class="separator"></div>\n<h5>Fresh &#038; Clean</h5>\n<p>Fresh &#038; Clean is another free WordPress theme I have created  that has a very clean and minimal design yet it is still pretty modern and elegant looking. </p>\n<p><a href="http://www.aoclarkejr.com/theme-previews/?themedemo=FreshAndClean" title="Fresh and Clean" target="_blank"><img src="http://www.snilesh.com/wp-content/uploads/2011/07/fresh-clean-theme.jpg" alt="fresh and clean theme" title="fresh-clean-theme" width="450" height="139" class="aligncenter size-full wp-image-1321" /></a></p>\n<a class="btn_arrow" href="http://www.aoclarkejr.com/theme-previews/?themedemo=FreshAndClean"><span>Demo</span></a> <a class="btn_arrow" href="http://www.wpexplorer.com/fresh-clean-wordpress-theme-by-wpexplorer.html"><span>Download</span></a>\n<div class="clear"></div>\n<div class="separator"></div>\n<h3>Portfolios, Galleries And Showcases themes</h3>\n<h5>Portfolium</h5>\n<p>Portfolium is a clean and flexible WordPress grid-based portfolio theme, designed in a modern and minimalist style. It is ideal for designers, artists, photographers and other creative specialists who require a professional portfolio theme.<br />\n<a href="http://portfolium.wpshower.com/" title="Portfolium" target="_blank"><img src="http://www.snilesh.com/wp-content/uploads/2011/07/portfolium.jpg" alt="" title="portfolium" width="500" height="137" class="aligncenter size-full wp-image-1323" /></a><br />\n<a class="btn_arrow" href="http://portfolium.wpshower.com/"><span>Demo</span></a> <a class="btn_arrow" href="http://wpshower.com/free-wordpress-themes/portfolium-free-wordpress-theme/"><span>Download</span></a></p>\n<div class="clear"></div>\n<div class="separator"></div>\n<h5>Shaken Grid</h5>\n<p>Shaken Grid uses the jQuery Masonry plug-in, which “arranges elements vertically then horizontally according to a grid.” The theme is perfect if you need a gallery or portfolio or just want a unique grid layout.<br />\n<a href="http://shakenandstirredweb.com/themes/" title="shaken grid" target="_blank"><img src="http://www.snilesh.com/wp-content/uploads/2011/07/shaken_grid.jpg" alt="shaken grid theme" title="shaken_grid" width="500" height="187" class="aligncenter size-full wp-image-1331" /></a></p>\n<a class="btn_arrow" href="http://shakenandstirredweb.com/themes/"><span>Demo</span></a> <a class="btn_arrow" href="http://shakenandstirredweb.com/331/introducing-our-first-free-wordpress-theme-shaken-grid"><span>Download</span></a>\n<div class="clear"></div>\n<div class="separator"></div>\n<h5>Big Square</h5>\n<p>Big Square is a stylish photoblog theme with a built-in gallery that is focused entirely on highlighting your creative visuals.<br />\n<a href="http://demo.wordspop.com/bigsquare/" title="big square theme" target="_blank"><img src="http://www.snilesh.com/wp-content/uploads/2011/07/big_square_theme.jpg" alt="big square theme" title="big_square_theme" width="500" height="149" class="aligncenter size-full wp-image-1333" /></a><br />\n<a class="btn_arrow" href="http://demo.wordspop.com/bigsquare/"><span>Demo</span></a> <a class="btn_arrow" href="http://wordspop.com/themes/big-square/"><span>Download</span></a></p>\n<div class="clear"></div>\n<div class="separator"></div>\n<h5>Journal Crunch</h5>\n<p>Journal Crunch is a gallery and portfolio theme with all of the features you would expect from a premium theme: easy set-up via the options page, plenty of shortcodes, built-in pagination, Twitter widgets, AJAX contact form and much more.<br />\n<a href="http://wordpress.site5.net/journalcrunch/" target="_blank" title="Journal Crunch"><img src="http://www.snilesh.com/wp-content/uploads/2011/07/journal_crunch.jpg" alt="journal crunch" title="journal_crunch" width="500" height="161" class="aligncenter size-full wp-image-1335" /></a><br />\n<a class="btn_arrow" href="http://wordpress.site5.net/journalcrunch/"><span>Demo</span></a> <a class="btn_arrow" href="http://www.site5.com/wordpress-themes/"><span>Download</span></a></p>\n<div class="clear"></div>\n<div class="separator"></div>\n<p><a href="http://feedads.g.doubleclick.net/~a/CoeRiHmhwCCB7dueckuyoAHkux8/0/da"><img src="http://feedads.g.doubleclick.net/~a/CoeRiHmhwCCB7dueckuyoAHkux8/0/di" border="0" ismap="true"></img></a><br/>\n<a href="http://feedads.g.doubleclick.net/~a/CoeRiHmhwCCB7dueckuyoAHkux8/1/da"><img src="http://feedads.g.doubleclick.net/~a/CoeRiHmhwCCB7dueckuyoAHkux8/1/di" border="0" ismap="true"></img></a></p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:70:"http://www.snilesh.com/resources/wordpress/wordpress-themes-free/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"4";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:8;a:6:{s:4:"data";s:47:"\n		\n		\n		\n		\n		\n				\n		\n		\n\n		\n		\n			\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:5:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:33:"wordpress pagenavi styling plugin";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:75:"http://www.snilesh.com/resources/wordpress/wordpress-pagenavi-style-plugin/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:84:"http://www.snilesh.com/resources/wordpress/wordpress-pagenavi-style-plugin/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Fri, 24 Jun 2011 06:04:31 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:3:{i:0;a:5:{s:4:"data";s:9:"Wordpress";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:15:"page navi style";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:2;a:5:{s:4:"data";s:8:"pagenavi";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:30:"http://www.snilesh.com/?p=1278";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:256:"This is my next plugin WordPress PageNavi Style Plugin it is a addon to most popular page navigation plugin Wp-PageNavi. To use this plugin you must have<a href="http://www.snilesh.com/resources/wordpress/wordpress-pagenavi-style-plugin/"> Read More...</a>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:7:"snilesh";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:3952:"<p>This is my next plugin <strong><a href="" title="Wordpress PageNavi Style Plugin" target="_blank">WordPress PageNavi Style Plugin</a></strong> it is a addon to most popular page navigation plugin <strong><a href="http://wordpress.org/extend/plugins/wp-pagenavi/" target="_blank" title="Wp PageNavi Plugin">Wp-PageNavi</a></strong>.</p>\n<p>To use this plugin you must have <strong><a href="http://wordpress.org/extend/plugins/wp-pagenavi/" target="_blank" title="Wp PageNavi Plugin">Wp-PageNavi</a></strong> installed on your wordpress blog.</p>\n<p>This plugin comes with options to style page navigation as you like. Comes with collection fo 25+ ready style which you can choose easily. And with a custom option where you can set your own colors.</p>\n<div class="clear"></div>\n<h3>1] Installation Of Wp-Pagenavi Plugin</h3>\n<p>To use this plugin you must have <a href="http://wordpress.org/extend/plugins/wp-pagenavi/" target="_blank" title="Wp-PageNavi">Wp-PageNavi</a> installed so install that plugin first.</p>\n<p>You can either install it automatically from the WordPress admin, or do it manually:</p>\n<ol>\n<li>Unzip the archive and put the wp-pagenavi folder into your plugins folder (/wp-content/plugins/).</li>\n<li>Activate the plugin from the Plugins menu.</li>\n</ol>\n<p><img src="http://www.snilesh.com/wp-content/uploads/2011/06/wp_page_navi_style.png" alt="" title="wp_page_navi_style" width="624" height="213" class="aligncenter size-full wp-image-1284" /></p>\n<h4>Usage</h4>\n<p>In your theme, replace code like this: </p>\n<pre class="brush: php; title: ; notranslate">\n&lt;div class=&quot;navigation&quot;&gt;\n    &lt;div class=&quot;nav-previous&quot;&gt;&lt;?php next_posts_link( __( ''&lt;span class=&quot;meta-nav&quot;&gt;&amp;larr;&lt;/span&gt; Older posts'', ''twentyten'' ) ); ?&gt;&lt;/div&gt;\n    &lt;div class=&quot;nav-next&quot;&gt;&lt;?php previous_posts_link( __( ''Newer posts &lt;span class=&quot;meta-nav&quot;&gt;&amp;rarr;&lt;/span&gt;'', ''twentyten'' ) ); ?&gt;&lt;/div&gt;\n&lt;/div&gt;\n</pre>\n<p>with In your theme, replace code like this:</p>\n<pre class="brush: php; title: ; notranslate">\n&lt;?php if(function_exists(''wp_pagenavi'')) { wp_pagenavi(); } ?&gt;\n</pre>\n<p>If you already have Installed Wp-PageNavi plugin and Added above code then move to next step.</p>\n<h3>2] Installation Of WP PageNavi Style Plugin</h3>\n<ol>\n<li>Upload the “wp-pagenavi-style” folder to your /wp-content/plugins/ directory.</li>\n<li>Login to your admin section, go to the Plugins section and activate the Wp PageNavi Style plugin.</li>\n<li>You can access the settings page using the PageNavi Style menu item, where you can adjust the default settings for the WP PageNavi Style Plugin.</li>\n</ol>\n<h3>Usage</h3>\n<p>If you want to use style which comes with Wp PageNavi Style Plugin then select <strong>&#8220;Existing Styles&#8221;</strong> from  &#8220;Select StyleSheet :&#8221;  dropdown. After that you can select your style from our collection in next dropdown. </p>\n<p><img src="http://www.snilesh.com/wp-content/uploads/2011/06/page_navi_style_usage.png" alt="" title="page_navi_style_usage" width="641" height="339" class="aligncenter size-full wp-image-1292" /></p>\n<p>And Save you settings.</p>\n<p>If you want to use Custom style then select custom style from first dropdown. and select your colors and options from </p>\n<p><img src="http://www.snilesh.com/wp-content/uploads/2011/06/pagenavi_style_custom.png" alt="" title="pagenavi_style_custom" width="632" height="464" class="aligncenter size-full wp-image-1294" /></p>\n<p><a href="http://feedads.g.doubleclick.net/~a/11Po0_17FQ-qtkREvzFsbZ2v4XI/0/da"><img src="http://feedads.g.doubleclick.net/~a/11Po0_17FQ-qtkREvzFsbZ2v4XI/0/di" border="0" ismap="true"></img></a><br/>\n<a href="http://feedads.g.doubleclick.net/~a/11Po0_17FQ-qtkREvzFsbZ2v4XI/1/da"><img src="http://feedads.g.doubleclick.net/~a/11Po0_17FQ-qtkREvzFsbZ2v4XI/1/di" border="0" ismap="true"></img></a></p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:80:"http://www.snilesh.com/resources/wordpress/wordpress-pagenavi-style-plugin/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:2:"13";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:9;a:6:{s:4:"data";s:59:"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n		\n		\n		\n\n		\n		\n			\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:5:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:62:"How to Add Google +1 (plus one) Share Button to wordpress blog";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:103:"http://www.snilesh.com/resources/wordpress/how-to-add-google-1-plus-one-share-button-to-wordpress-blog/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:112:"http://www.snilesh.com/resources/wordpress/how-to-add-google-1-plus-one-share-button-to-wordpress-blog/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 02 Jun 2011 16:47:02 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:7:{i:0;a:5:{s:4:"data";s:8:"snippets";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:9:"Wordpress";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:2;a:5:{s:4:"data";s:25:"Wordpress Tips and Tricks";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:3;a:5:{s:4:"data";s:9:"google +1";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:4;a:5:{s:4:"data";s:11:"google +one";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:5;a:5:{s:4:"data";s:15:"google plus one";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:6;a:5:{s:4:"data";s:8:"plus one";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:30:"http://www.snilesh.com/?p=1264";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:284:"Google released +1 buttons to the whole web. As a result, you might start seeing +1 appear on sites large and small across the Internet. Google partnered<a href="http://www.snilesh.com/resources/wordpress/how-to-add-google-1-plus-one-share-button-to-wordpress-blog/"> Read More...</a>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:7:"snilesh";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:2657:"<p>Google released +1 buttons to the whole web. As a result, you might start seeing +1 appear on sites large and small across the Internet. Google partnered with a few sites where you’ll see +1 buttons in the near future. </p>\n<p>With a single click you can recommend that news article or favorite sci-fi movie to friends, contacts and the rest of the world. The next time your connections search, they could see your +1’s directly in their search results, helping them find your recommendations when they’re most useful.</p>\n<p>So if you want to add google +1 button for each post on your wordpress blog just add following lines of code inside your themes functions.php file</p>\n<h3>Add Google Plus one (+1) button without plugin </h3>\n<pre class="brush: xml; title: ; notranslate">\n&lt;?php\n\n/* Add plusone.js to &lt;head&gt; section of your theme  */\nadd_action (''wp_enqueue_scripts'',''google_plusone_script'');\n\nfunction google_plusone_script() {\n	wp_enqueue_script(''google_plus_one'', ''<a href="https://apis.google.com/js/plusone.js&#039;" rel="nofollow">https://apis.google.com/js/plusone.js&#039;</a>, array(), null);\n}\n\n/* Add +one button after your post content by using filter */\n\nadd_filter(''the_content'', ''google_plus_one'');\n\nfunction google_plus_one($content) {\n	$content = $content.''&lt;div class=&quot;google_plus_one&quot;&gt;\n	&lt;g:plusone size=&quot;tall&quot; href=&quot;''.get_permalink().''&quot;&gt;&lt;/g:plusone&gt;&lt;/div&gt;'';\n	return $content;\n}\n\n?&gt;\n</pre>\n<p>You can style and align button in post text by applying following class</p>\n<p>Add this code in your theme&#8217;s style.css if you want to align it to left</p>\n<pre class="brush: css; title: ; notranslate">\n\n.google_plus_one{\n	display: inline;\n	float: left;\n	margin-right: 20px;\n	margin-top: 4px;\n}\n</pre>\n<p>And add this code in your theme&#8217;s style.css if you want to align it to right side</p>\n<pre class="brush: css; title: ; notranslate">\n\n.google_plus_one{\n	display: inline;\n	float: right;\n	margin-left: 20px;\n	margin-top: 4px;\n}\n</pre>\n<p>For more details about the options and Google Plus One Button Visit<br />\n<a href="http://code.google.com/apis/+1button/#configuration" target="_blank" title="Google Plus One Button">Google Plus One Button</a></p>\n<p><a href="http://feedads.g.doubleclick.net/~a/-DShNA4_XrQ9DvR_h1n6tp97Pgo/0/da"><img src="http://feedads.g.doubleclick.net/~a/-DShNA4_XrQ9DvR_h1n6tp97Pgo/0/di" border="0" ismap="true"></img></a><br/>\n<a href="http://feedads.g.doubleclick.net/~a/-DShNA4_XrQ9DvR_h1n6tp97Pgo/1/da"><img src="http://feedads.g.doubleclick.net/~a/-DShNA4_XrQ9DvR_h1n6tp97Pgo/1/di" border="0" ismap="true"></img></a></p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:108:"http://www.snilesh.com/resources/wordpress/how-to-add-google-1-plus-one-share-button-to-wordpress-blog/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"7";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}}}s:44:"http://purl.org/rss/1.0/modules/syndication/";a:2:{s:12:"updatePeriod";a:1:{i:0;a:5:{s:4:"data";s:6:"hourly";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:15:"updateFrequency";a:1:{i:0;a:5:{s:4:"data";s:1:"1";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:27:"http://www.w3.org/2005/Atom";a:1:{s:4:"link";a:2:{i:0;a:5:{s:4:"data";s:0:"";s:7:"attribs";a:1:{s:0:"";a:3:{s:3:"rel";s:4:"self";s:4:"type";s:19:"application/rss+xml";s:4:"href";s:35:"http://feeds.feedburner.com/snilesh";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:0:"";s:7:"attribs";a:1:{s:0:"";a:2:{s:3:"rel";s:3:"hub";s:4:"href";s:32:"http://pubsubhubbub.appspot.com/";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:3:{s:4:"info";a:1:{i:0;a:5:{s:4:"data";s:0:"";s:7:"attribs";a:1:{s:0:"";a:1:{s:3:"uri";s:7:"snilesh";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:14:"emailServiceId";a:1:{i:0;a:5:{s:4:"data";s:7:"snilesh";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:18:"feedburnerHostname";a:1:{i:0;a:5:{s:4:"data";s:28:"http://feedburner.google.com";s:7:"attribs";a:0:{}s:8:"xml_base";s:0