a-full-portfolio-download.html" title="Download "Imperia &#8211; Fullscreen Portfolio WordPress Theme" target="_blank"><img src="http://wordpressskins.org/wp-content/themes/wpskinsnew/timthumb.php?src=http://wordpressskins.org/wp-content/uploads/2011/08/Imperia.png&a=t&w=500"a lt="Imperia &#8211; Fullscreen Portfolio WordPress Theme" /></a></div>\n<p>&nbsp;</p>\n<h2>Theme Features</h2>\n<ol>\n<li>Unique <strong>Fullscreen Background</strong> layout with fixed Header &amp; Footer.</li>\n<li>Extensive <strong>Portfolio Options</strong>:\n<ul>\n<li>Fullscreen Image</li>\n<li>Fullscreen Video [ Youtube, Vimeo, Hosted .mp4 ]</li>\n<li>Sortable</li>\n<li>MagicFloat</li>\n</ul>\n</li>\n<li><strong>“White Label”</strong> Theme Options Panel.</li>\n<li><strong> FIVE </strong>Custom Post Types :\n<ul>\n<li>Slides</li>\n<li>Fullscreen</li>\n<li>Features</li>\n<li>Portfolio</li>\n<li>Feedback</li>\n</ul>\n</li>\n<li><strong> FIVE </strong>Custom Widgets :\n<ul>\n<li>Twitter</li>\n<li>Flickr</li>\n<li>Feedback</li>\n<li>Search</li>\n<li>Subscribe</li>\n</ul>\n</li>\n<li><strong> NINE </strong>Page Templates :\n<ul>\n<li>Archive</li>\n<li>Blog</li>\n<li>Contact</li>\n<li>Fullscreen Portfolio</li>\n<li>Fullscreen Video</li>\n<li>Magicfloat Portfolio</li>\n<li>Sortable Portfolio</li>\n<li>Service</li>\n<li>Sitemap</li>\n</ul>\n</li>\n<li><strong> THREE </strong> Homepage Sliders &amp; <strong> FOUR </strong>Homepage Options :\n<ul>\n<li>Nivo</li>\n<li>Photo Scroller</li>\n<li>Supersized</li>\n</ul>\n</li>\n<li><strong>Shortcode Manager</strong> with Preview Window</li>\n<li><strong>WordPress 3.0</strong> Ready [ Menus &amp; Featured Images ]</li>\n<li><strong>Enhanced functionality</strong> : PrettyPhoto, JQuery Plugins &amp; Other Transition / Animation Effects.</li>\n<li>Extensive <strong> PDF </strong> Documentation</li>\n<li><strong>Compatibility</strong> with All Major <strong>Browsers</strong>, <strong>iPhone</strong>, <strong>iPad</strong> &amp; <strong>Other</strong> Handheld Devices.</li>\n</ol>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:85:"http://wordpressskins.org/1135/imperia-fullscreen-portfolio-wordpress-theme.html/feed";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:3;a:6:{s:4:"data";s:107:"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n\n		\n		\n			\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:5:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:32:"Daos – Premium WordPress Theme";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:64:"http://wordpressskins.org/1129/daos-premium-wordpress-theme.html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:73:"http://wordpressskins.org/1129/daos-premium-wordpress-theme.html#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 15 Aug 2011 12:47:34 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:23:{i:0;a:5:{s:4:"data";s:18:"Adsense SEO Themes";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:4:"blog";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:2;a:5:{s:4:"data";s:20:"Blog Magazine Themes";s:7:"attri