alendar</strong></h3>\n<ul>\n<li>Custom calendar with single day, multi day and recurring events.</li>\n<li>Countdown timer widget that catches the eye. Get people to your events.</li>\n<li>Easy integration into your theme. No plugins to download.</li>\n</ul>\n<div id="attachment_1108" class="wp-caption aligncenter" style="width: 610px"><a href="http://wordpressskins.org/feat-wordpress-theme" target="_blank"  title="Wordpress theme with fanpage"><img src="http://wordpressskins.org/wp-content/uploads/2011/08/feat-fanpage.png" alt="Feat WordPress theme with Fanpage" title="feat-fanpage" width="600" height="488" class="size-full wp-image-1108" /></a><p class="wp-caption-text">Feat WordPress theme with Fanpage</p></div>\n<h3><strong>Custom Table bookings app</strong></h3>\n<ul>\n<li>Inteligent bookings application with email to customers.</li>\n<li>Send reminders of bookings to customers.</li>\n<li>Proper management of your table bookings.</li>\n</ul>\n<h3><strong>Proper Google Maps integration</strong></h3>\n<ul>\n<li>Maps and streetview maps</li>\n<li>Google directions on your site.</li>\n<li>Easy setup and a maptool included to assist you with the setup.</li>\n</ul>\n<div id="attachment_1106" class="wp-caption aligncenter" style="width: 600px"><a href="http://wordpressskins.org/feat-wordpress-theme" target="_blank" title="Wp Template with facebook fan page"><img src="http://wordpressskins.org/wp-content/uploads/2011/08/Feast-Facebook-Fanpage-WordPress-theme.jpg" alt="" title="Feast-Facebook-Fanpage-WordPress-theme" width="590" height="300" class="size-full wp-image-1106" /></a><p class="wp-caption-text">Wp theme with facebook fanpage</p></div>\n<h3><strong>Awesome unique widgets</strong></h3>\n<ul>\n<li>Menu carousel.</li>\n<li>Newsletter signup.</li>\n<li>Twitter single and multitweet widgets.</li>\n<li>Customer feedback widget.</li>\n<li>Image link widgets that links to any content.</li>\n</ul>\n<h3><strong>Even more</strong></h3>\n<ul>\n<li>24 color combinations.<